DROP PROCEDURE IF EXISTS `sp_bitacoralogin`;
delimiter ;;
CREATE PROCEDURE `sp_bitacoralogin`(in user varchar(80), in pass varchar(80),in usuario int, in tipo varchar(80), in ip varchar(80),in pais varchar(255),in ciudad varchar(255),in region varchar(255),in latitud varchar(255),in longitud varchar(255),in ipLocal varchar(100),in estatus int)
BEGIN
VALUES (user,pass,usuario,tipo,ip,pais,ciudad,region,latitud,longitud,NOW(),estatus,ipLocal,now());
END
;;
delimiter ;

SET FOREIGN_KEY_CHECKS = 1;
