INSERT INTO `minutas` VALUES (1, 10, 'SALA DE JUNTAS ', '2021-07-20', 'nmendoza@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Norma Mendoza', 'Se realizara un filtrado para la reuniones con los proveedores de medicamentos y hospitales con las cuales tendremos el numero de servicios por proveedor.', '', '', '', 'AT, NR, NM.', 2, '2021-07-20 12:46:11', 5);
INSERT INTO `minutas` VALUES (2, 10, 'ZOOM', '2021-07-20', 'fridatirado@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Frida Tirado', 'ACUERDOS', 'ASUNTOS', 'ANUNCIOS', '', 'CM,EM,TD', 1, '2021-07-20 14:57:00', 5);
INSERT INTO `minutas` VALUES (3, 10, 'SALA DE JUNTAS', '2021-07-20', 'fridatirado@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Frida Tirado', 'Se realizara un filtrado para la reuniones con los proveedores de medicamentos y hospitales con las cuales tendremos el numero de\r\nservicios por proveedor.', '', '', '', 'AT, NR, NM', 2, '2021-07-20 15:29:32', 5);
INSERT INTO `minutas` VALUES (4, 6, 'Videoconferencia - https://meet.google.com/gxm-wfhg-qhe', '2021-07-21', 'nmendoza@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Norma Mendoza', '1.	Se versa sobre el número de operaciones, montos autorizados, liquidación de servicios y descuentos aplicables directos a facturación. \r\n2.	Se reenviará guía operativa de cliente OCEAS donde encontraran los tiempos para procesos de gestión y pago de servicios.\r\n3.	Se invita a proveedor a realizar segunda conciliación operativa de facturas del periodo 2020 a fin de que se coteje ninguna se encuentre pendiente de pago antes del mes de octubre de 2021. \r\n4.	La prescripción de compromiso de pagos por servicios 2020 comenzará en 2022. La notificación se realiza con seis meses de anticipación pues después de este periodo no podrán ser liquidadas las facturas no emitidas, no refacturadas por aclaración aplicable o casos pendientes de información. \r\n5.	El proveedor deberá enviar el número de servicio (ejemplo OCE21001010) y folio fiscal UUID (código alfanumérico de 32 posiciones) para poder rastrear facturas pendientes de pago.\r\n6.	Una vez recibida la conciliación adicional, si alguna factura estuviese pendiente de liquidación, al término de 10 días hábiles liquidará el monto total por los servicios otorgados aplicables a la fecha. O bien, se notificará la causa de no procedencia. \r\n7.	Con relación al descuento del dos por ciento aplicable directo a facturación, el proveedor revisará el (los) servicio(s) y o la(s) factura(s) en las cuales se aplicará en monto total de descuento resultante de los servicios del periodo de 01 de enero de 2021 al 31 de julio de 2021.\r\n8.	Se solicita a proveedor revisar la posibilidad de un aumento en el descuento ya que actualmente cuentan con un volumen alto de servicios asignados.\r\n9.	Para el mes de octubre estaría liquidados los servicios otorgados de tal forma que el crédito con proveedor se encuentre en ceros y se pueda hacer uso de este para las gestiones de 4 meses (Octubre – Enero). \r\n10.	Proveedor nos hará llegar su directorio actualizado.', '- Guía operativa.\r\n- Información de facturas donde se aplicara descuento.\r\n- Directorio actualizado de proveedor.', '', '', 'AT, PC, IZ, NM, FH, BC.', 2, '2021-07-23 00:35:23', 1);
INSERT INTO `minutas` VALUES (5, 5, 'Videoconferencia - https://meet.google.com/teh-kuvj-mvc', '2021-07-21', 'nmendoza@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Norma Mendoza', '1. Se seguiran manteniendo los 10 días habiles para pago una vez recibia la factura.\r\n2. Proveedor se compromete a continuar con el buen flujo de información y tiempos del proceso.\r\n3. Así mismo se comprometen a estar abiertos para puntos de mejora en el servicio.\r\n4. Nos seguiran otorgando el 5% de descuento sobre factura.\r\n5. Quedaremos pendientes a las facturas que aun no son recibidas. \r\n6. Si cuentan con facturas pendientes de pago, nos enviarán el numero de servicio (ejm. OCE21001010) y folio fiscal UUID (32 dígitos) para poder rastrear facturas pendientes de pago.\r\n7. Se notifica sobre la prescripción por 2 años para los servicios de esta mutual (2020 - 2022)\r\n8. Así mismo se estará notificando nuevamente con 6 meses de anticipación sobre la misma prescripción; ya que posterior a este periodo no podrán ser liquidadas las facturas no emitidas.\r\n9. Para el mes de octubre estaría liquidados los servicios otorgados de tal forma que el crédito con proveedor se encuentre en ceros y se pueda hacer uso de este para las gestiones de 4 meses (Octubre - Enero).\r\n10. Se deberá refacturar los servicios emitidos en el periodo de Octubre - Diciembre para enero 2022.', '', '', '', 'AT, PC, IZ, NM, GR, DG, AO.', 2, '2021-07-23 09:07:27', 5);
INSERT INTO `minutas` VALUES (6, 10, 'MEET', '0000-00-00', 'nmendoza@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Norma Mendoza', ' Para el mes de octubre estaría liquidados los servicios otorgados de tal forma que el crédito con proveedor se encuentre en ceros y se pueda hacer uso de este para las gestiones de 4 meses (Octubre - Enero).\r\n10. Se deberá refacturar los servicios emitidos en el periodo de Octubre - Diciembre para enero 2022.\r\n\r\n- Facturas\r\n', '', '', '', 'AT, PC, NM.', 2, '2021-07-23 09:21:06', 5);
INSERT INTO `minutas` VALUES (7, 5, 'Videoconferencia -  https://meet.google.com/teh-kuvj-mvc', '2021-07-21', 'nmendoza@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Norma Mendoza', '1.	Se versa sobre el número de operaciones, montos autorizados, liquidación de servicios y descuentos aplicables directos a facturación. \r\n2.	El Proveedor se compromete a continuar con el buen flujo de información y tiempos del proceso. Así mismo se comprometen a estar abiertos para puntos de mejora en el servicio.\r\n3.	Se seguirán manteniendo los 10 días hábiles para pago una vez recibida la factura.\r\n4.	Nos seguirán otorgando el 5% de descuento sobre facturación en las líneas establecidas de medicamentos.\r\n5.	Se invita a proveedor a realizar segunda conciliación operativa de facturas del periodo 2020 a fin de que se coteje ninguna se encuentre pendiente de pago antes del mes de octubre de 2021. \r\n6.	La prescripción de compromiso de pagos por servicios 2020 comenzará en 2022. La notificación se realiza con seis meses de anticipación pues después de este periodo no podrán ser liquidadas las facturas no emitidas, no refacturadas por aclaración aplicable o casos pendientes de información.\r\n7.	El proveedor deberá enviar el número de servicio (ejemplo OCE21001010) y folio fiscal UUID (código alfanumérico de 32 posiciones) para poder rastrear facturas pendientes de pago. \r\n8.	Una vez recibida la conciliación adicional, si alguna factura estuviese pendiente de liquidación, al término de 10 días hábiles liquidará el monto total por los servicios otorgados aplicables a la fecha. O bien, se notificará la causa de no procedencia.\r\n9.	Para el mes de octubre estaría liquidados los servicios otorgados de tal forma que el crédito con proveedor se encuentre en ceros y se pueda hacer uso de este para las gestiones de 4 meses (Octubre – Enero). \r\n10.	En diciembre de 2021 se hará uso del crédito para que la facturación y liquidación de estos servicios se realice en enero de 2022.', '', '', '', 'AT, PC, IZ, NM, GR, DG, AO.', 2, '2021-07-24 19:16:47', 1);
INSERT INTO `minutas` VALUES (8, 8, 'Videoconferencia - https://meet.google.com/bwg-prei-pgw', '2021-07-21', 'nmendoza@empoderasalud.mx', 'francisco.navarro@starlightmc.com', 'Norma Mendoza', '1.	Se versa sobre el número de operaciones, montos autorizados, liquidación de servicios y cartera de servicios.\r\n2.	Con relación al otorgamiento de medicamentos controlados y conciliación de recetas se buscará una propuesta y actualización del mecanismo aplicable para el periodo 2022.\r\n1.	Con relación a los servicios de enfermería y rehabilitación, el Lic. Navarro hará el envío de documentación de los servicios de enfermería (cotización, valoración, reportes, bitácora, asistencia, calidad del servicio evaluada por el beneficiario).\r\n3.	En caso de discrepancias referidas por el beneficiario, la Lic. Mendoza dará seguimiento de manera interna y posteriormente notificará a los proveedores para conocer de ellos su respuesta al caso y propuesta de solución si aplica.\r\n4.	Se invita a proveedor a realizar segunda conciliación operativa de facturas del periodo 2020 a fin de que se coteje ninguna se encuentre pendiente de pago antes del mes de octubre de 2021. \r\n5.	La prescripción de compromiso de pagos por servicios 2020 comenzará en 2022. La notificación se realiza con seis meses de anticipación pues después de este periodo no podrán ser liquidadas las facturas no emitidas, no refacturadas por aclaración aplicable o casos pendientes de información.\r\n6.	El proveedor deberá enviar el número de servicio (ejemplo OCE21001010) y folio fiscal UUID (código alfanumérico de 32 posiciones) para poder rastrear facturas pendientes de pago. \r\n7.	Una vez recibida la conciliación adicional, si alguna factura estuviese pendiente de liquidación, al término de 10 días hábiles liquidará el monto total por los servicios otorgados aplicables a la fecha. O bien, se notificará la causa de no procedencia.\r\n8.	Al termino de noviembre de 2021 será el cierre fiscal de OCEAS. En diciembre de 2021 se hará uso del crédito para que la facturación y liquidación estos servicios de este periodo se realice en enero de 2022. ', '', 'Se solicita envío de cartera de servicios actualizada del proveedor.', '', 'AT, PC, IZ, NM, BC, FN.', 2, '2021-07-24 20:11:26', 1);
INSERT INTO `minutas` VALUES (9, 4, 'Videoconferencia - https://meet.google.com/pkj-emhc-wwm', '2021-07-21', 'nmendoza@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Norma Mendoza', '1.	Se versa sobre el número de operaciones, montos autorizados, liquidación de servicios, y descuentos aplicables a facturación.\r\n2.	Compartiremos guía operativa donde encontraran los tiempos para procesos de gestión y pago de servicios. Las gestiones parta entrega en mostrador solicitamos las entregas se cubran dentro de un periodo de 24 a 48 horas. El resto de los tiempos de gestión y entrega de acuses se mantiene cada 72 horas de acuerdo con la guía operativa.\r\n3.	Se solicita ampliar las zonas de entrega de medicamentos. \r\n4.	Con relación al otorgamiento de medicamentos controlados y conciliación de recetas se buscará una propuesta y actualización del mecanismo aplicable para el periodo 2022. \r\n5.	Proveedor revisará el otorgarnos el 2% de descuento sobre factura y nos darán respuesta. \r\n6.	Se invita a proveedor a realizar segunda conciliación operativa de facturas del periodo 2020 a fin de que se coteje ninguna se encuentre pendiente de pago antes del mes de octubre de 2021. \r\n7.	La prescripción de compromiso de pagos por servicios 2020 comenzará en 2022. La notificación se realiza con seis meses de anticipación pues después de este periodo no podrán ser liquidadas las facturas no emitidas, no refacturadas por aclaración aplicable o casos pendientes de información.\r\n8.	El proveedor deberá enviar el número de servicio (ejemplo OCE21001010) y folio fiscal UUID (código alfanumérico de 32 posiciones) para poder rastrear facturas pendientes de pago. \r\n9.	Una vez recibida la conciliación adicional, si alguna factura estuviese pendiente de liquidación, al término de 10 días hábiles liquidará el monto total por los servicios otorgados aplicables a la fecha. O bien, se notificará la causa de no procedencia.\r\n10.	Proveedor nos hará llegar su directorio y matriz de escalamiento actualizado.', '- Guía operativa.\r\n- Propuesta y proceso administrativo para realizar el contrato-\r\n- Información de facturas donde se aplicará descuento.\r\n- Directorio actualizado de proveedor.\r\n', 'Se realizarán dos reuniones adicionales en el mes de octubre para gestiones del periodo de octubre - enero y noviembre por cierre fiscal y validar el crédito se encuentre en ceros.', '', 'AT, PC, IZ, NM, MH, GR, FG.', 2, '2021-07-24 23:23:48', 1);
INSERT INTO `minutas` VALUES (10, 1, 'Videoconferencia - https://meet.google.com/mmf-pqza-hdq', '2021-07-21', 'nmendoza@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Norma Mendoza', '1.	Se versa sobre el número de operaciones, montos autorizados, liquidación de servicios, y descuentos aplicables a facturación.\r\n2.	Se reafirma que el proceso para gestión de medicamentos se evalúa de acuerdo con los criterios de costo, existencia y oportunidad. El proveedor mantiene un criterio de oportunidad basto (por la pronta entrega). Pero, persisten costos por encima de la media por lo que la asignación de servicios es limitada. Se puntualiza esta área de oportunidad para mejorar la relación comercial vigente. El proveedor mantendrá el descuento aplicable a facturación. \r\n3.	Con relación al listado de medicamentos con bajo costo que compartió proveedor, se le informa que dado que las fechas de caducidad de estos productos son próximas NO es susceptible aceptarlos. Como administradora de salud una de nuestras obligaciones es la salvaguarda del beneficiario particularmente por tratarse de adultos mayores. \r\n4.	Con relación a los medicamentos de patente o genéricos se confirma al proveedor que se debe mantener la línea de suministro por sustancia y/o patente de acuerdo con la prescripción de médico tratante. \r\n5.	Con relación a la situación de escases de algunos medicamentos que ha generado pandemia, la administradora notificará al beneficiario y validará con éste en cada caso la viabilidad de ajuste a tratamiento.\r\n6.	Se invita a proveedor a realizar segunda conciliación operativa de facturas del periodo 2020 a fin de que se coteje ninguna se encuentre pendiente de pago antes del mes de octubre de 2021. \r\n7.	El proveedor deberá enviar el número de servicio (ejemplo OCE21001010) y folio fiscal UUID (código alfanumérico de 32 posiciones) para poder rastrear facturas pendientes de pago. \r\n8.	Una vez recibida la conciliación adicional, si alguna factura estuviese pendiente de liquidación, al término de 10 días hábiles liquidará el monto total por los servicios otorgados aplicables a la fecha. O bien, se notificará la causa de no procedencia.', 'Se retomarán los acuerdos comerciales proveedor - administrador.\r\n', 'La prescripción de compromiso de pagos por servicios 2020 comenzará en 2022. La notificación se realiza con seis meses de anticipación pues después de este periodo no podrán ser liquidadas las facturas no emitidas, no refacturadas por aclaración aplicable o casos pendientes de información.', '', 'AT, PC, IZ, NM, AO.', 2, '2021-07-24 23:58:02', 1);
INSERT INTO `minutas` VALUES (11, 2, 'Videoconferencia - https://meet.google.com/axc-drrd-dxj', '2021-07-21', 'nmendoza@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Norma Mendoza', '1.	Se versa sobre el número de operaciones, montos autorizados, liquidación de servicios, y método de revisión de incidencias e índice de calidad en el servicio. \r\n2.	Reenviaremos guía operativa donde encontraran los tiempos para procesos de gestión y pago de servicios.\r\n3.	Se solicita respeten los tiempos establecidos del proceso; cotización, confirmación de entrega, envío de paquetería, entrega de acuses y facturación. Los retrasos en los primero cada segmento afecta a la entrega efectiva de medicamentos al beneficiario. Las segundas dos acumulan carga operativa y limitan la oportunidad del pronto pago. \r\n4.	Proveedor revisara de manera interna si es posible apagarse al proceso que se solicita y de no ser posible nos informarán.\r\n5.	Se invita a proveedor a realizar segunda conciliación operativa de facturas del periodo 2020 a fin de que se coteje ninguna se encuentre pendiente de pago antes del mes de octubre de 2021. \r\n6.	El proveedor deberá enviar el número de servicio (ejemplo OCE21001010) y folio fiscal UUID (código alfanumérico de 32 posiciones) para poder rastrear facturas pendientes de pago. \r\n7.	Una vez recibida la conciliación adicional, si alguna factura estuviese pendiente de liquidación, al término de 10 días hábiles liquidará el monto total por los servicios otorgados aplicables a la fecha. O bien, se notificará la causa de no procedencia.\r\n', '- Guía operativa', '', '', 'AT, PC, IZ, NM, HD, AH.', 2, '2021-07-25 01:25:22', 1);
INSERT INTO `minutas` VALUES (12, 3, 'Videoconferencia - https://meet.google.com/ktv-kttt-xyr', '2021-07-21', 'nmendoza@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Norma Mendoza', '1.	Se versa sobre el número de operaciones, montos autorizados, liquidación de servicios, y criterios de selección y permanencia de proveedor.\r\n2.	Reenviaremos guía operativa donde encontrarán los tiempos para procesos de gestión y pago de servicios.\r\n3.	Se refuerza que, como administradora de salud, una de nuestras obligaciones es la salvaguarda del beneficiario particularmente por tratarse de adultos mayores por lo cual las decisiones en torno a la situación de escases de algunos medicamentos que ha generado pandemia, la administradora realizará las gestiones necesarias para el otorgamiento efectivo de medicamentos haciendo uso de la red de proveedores nacionales y locales con los que cuenta por lo que el proveedores debe transparentar las situaciones que afecten la entrega efectiva en los plazos establecidos.  \r\n4.	Se solicita respeten los tiempos establecidos del proceso; cotización, confirmación de entrega, envío de paquetería, entrega de acuses y facturación. Los retrasos en los primero cada segmento afecta a la entrega efectiva de medicamentos al beneficiario. Las segundas dos acumulan carga operativa y limitan la oportunidad del pronto pago. \r\n5.	Proveedor se compromete a respetar los tiempos establecidos del proceso y trasparentar información de estos por los canales oficiales, con énfasis en la comunicación vía correo electrónico.\r\n6.	Se informa que la suspensión temporal de gestiones se debió a la falta de cumplimiento de los tiempos de respuesta y características del servicio.\r\n7.	Proveedor acepta y se muestra accesible para otorgar puntos de mejora en el servicio. Se retomarán servicios el 2 de agosto del presente año.\r\n8.	Se establece que la revisión de casos será periódica. En octubre de 2021 se tendrá una reunión en el cual se revisará de manera sistemática el número de operaciones y características del servicio y oportuna liquidación de los compromisos adquiridos.\r\n9.	Proveedor reenviará datos de contacto y matriz de escalamiento. ', '- Guía operativa.', '', '', 'AT, PC, IZ, NM, JE, JV.', 2, '2021-07-25 02:38:18', 1);
INSERT INTO `minutas` VALUES (13, 11, 'VIDEOCONFERENCIA', '2021-07-26', 'nataliaruiz@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Natalia Ruiz ', 'Se hace un total acuerdo entre ambas partes para que las facturas que están pendientes de pago se liquiden antes de que concluya el mes acorde al 30 de julio de 2021.\r\nEn caso de encontrar facturas en las que no se haya recibido comprobante de pago o que están pendientes de liquidar, se hará llegar en un listado por parte del Hospital en donde se colocará el numero de folio de la OCE y el numero de folio fiscal UUID con la finalidad de que se pueda hacer la conciliación de la factura. \r\nSe mantendrán los adecuados costos que se han brindado y eventualmente se pide considerar durante el transcurso del año se pueda acceder a descuentos directos sobre facturación, toda vez que nuestro compromiso de pago sea mantenido, el flujo de operaciones sea mantenido y que los objetivos administrativos den el cumplimiento de los tiempos de entrega.  Se verificará el descuento que nos puedan otorgar entre el 2% y el 5% del cual se hará la revisión de los números para que nos puedan brindar respuesta. El descuento deseamos que sea en enero de 2021 a julio de 2021 sobre este año. \r\n\r\n\r\n', '', 'La próxima reunión se realizará en el mes de octubre. ', '', '(AT) (PC) (AR) (MR)', 2, '2021-07-26 17:49:02', 5);
INSERT INTO `minutas` VALUES (14, 25, 'VIDEOCONFERENCIA meet.google.com/dox-ieor-zct ', '2021-07-22', 'nataliaruiz@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Natalia Ruiz ', '1.	Se versa sobre el número de operaciones, montos autorizados, liquidación de servicios y descuentos aplicables directos en facturación.\r\n2.	Se refuerzan las líneas de comunicación para la gestión de servicios de OCEAS. La unidad de administración de salud Empodera realiza las gestiones con la unidad requiriendo información en tiempo y forma para tener vista de la salud del beneficiario y conocer los montos que se generan por su atención. \r\n3.	Se refuerza que las facturas en pdf y xml, acompañadas de la carta autorización por la cual desean tramitar el pago, debe llegar al correo proveedores@oceas.org.mx  para que el pago de estas facturas se realice en forma. \r\n4.	Se notifica que OCEAS es una mutual sacerdotal y sus servicios de atención prescriben a los 2 años. La prescripción por servicios 2020 comenzará en 2022. \r\n5.	La notificación se realiza con seis meses de anticipación pues después de este periodo no podrán ser liquidadas las facturas no emitidas, no refacturadas por aclaración aplicable o en los casos pendientes de información.\r\n6.	Se invita a proveedor a realizar segunda conciliación operativa de facturas del periodo 2020 a fin de que se coteje ninguna se encuentre pendiente de pago antes del mes de octubre de 2021. \r\n7.	El proveedor deberá enviar el número de servicio (ejemplo OCE21001010) y folio fiscal UUID (código alfanumérico de 32 posiciones) para poder rastrear facturas pendientes de pago. \r\n8.	Una vez recibida la conciliación adicional, si alguna factura estuviese pendiente de pago al término de 10 días hábiles liquidará el monto total por los servicios otorgados aplicables a la fecha; se entregará el comprobante de pago; o bien, se notificará la causa de no procedencia.\r\n9.	El cierre para el envío de facturas correspondiente al año fiscal 2021 ocurrirá en noviembre de 2021.\r\n10.	Para los servicios de diciembre de 2021 se hará uso del crédito establecido por la relación comercial para que las facturas y liquidaciones se generen en enero de 2022.', '', 'Se mantiene el descuento directo sobre facturación.\r\nLos canales para notificación para servicios programados, hospitalización y facturacion-pagos de OCEAS son: programacion@oceas.org.mx, hospitalizacion@oceas.org.mx y proveedores@oceas.org.mx respectivamente. \r\n', '', '(AT) (PC) (DM) (GG) (LC)', 2, '2021-07-27 17:30:36', 1);
INSERT INTO `minutas` VALUES (15, 11, 'VIDEOCONFERENCIA', '2021-07-21', 'nataliaruiz@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Natalia Ruiz ', '1.	Se versa sobre el número de operaciones, montos autorizados, liquidación de servicios y descuentos aplicables directos en facturación.\r\n2.	Se refrenda que la unidad de administración de salud Empodera realiza gestiones para la salvaguarda de la salud de los beneficiarios de OCEAS. Por ello, se requiere acceso a la información en tiempo y forma para tener acceso a los reportes del estado de salud del beneficiario y conocer los montos que se generan por su atención. \r\n3.	Se mantendrán los adecuados costos que se han brindado durante el primer semestre del 2021. Se solicita que durante el transcurso del segundo semestre se otorgue un descuento del dos al cinco por ciento directo sobre facturación. La solicitud se realiza toda vez que el flujo de operaciones es adecuado y que nuestro compromiso para el pronto pago se ha mantenido y existe una adecuada comunicación administrativa. \r\n4.	Se invita a proveedor a realizar segunda conciliación operativa de facturas del periodo 2020 a fin de que se coteje ninguna se encuentre pendiente de pago antes del mes de octubre de 2021. \r\n5.	El proveedor deberá enviar el número de servicio (ejemplo OCE21001010) y folio fiscal UUID (código alfanumérico de 32 posiciones) para poder rastrear facturas pendientes de pago. \r\n6.	Una vez recibida la conciliación adicional, si alguna factura estuviese pendiente de pago al término de 10 días hábiles liquidará el monto total por los servicios otorgados aplicables a la fecha; se entregará el comprobante de pago; o bien, se notificará la causa de no procedencia.\r\n7.	El cierre para el envío de facturas correspondiente al año fiscal 2021 ocurrirá en noviembre de 2021. \r\n8.	Para los servicios de diciembre de 2021 se hará uso del crédito establecido por la relación comercial para que las facturas y liquidaciones se generen en enero de 2022.', 'La conciliación adicional deberá ocurrir a partir del 01 de agosto de 2021 y ates de la reunión en el mes de octubre para cotejar que nuestros pagos se realizaron en tiempo y forma.', 'Se verificará el porcentaje descuento que nos puedan otorgar sea entre el 2% y el 5% del cual se hará la revisión de los casos y montos para que el proveedor nos puedan brindar respuesta. El descuento deseamos sea aplicable con base en los servicios ya asignados de enero de 2021 a julio de 2021.', 'La próxima reunión se realizará en el mes de octubre. ', '(AT)(PC) (AR) (MR)', 2, '2021-07-27 17:45:03', 1);
INSERT INTO `minutas` VALUES (16, 19, 'VIDEOCONFERENCIA', '2021-07-22', 'nataliaruiz@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Natalia Ruiz ', 'Se tiene en común acuerdo que no se encuentra ningún pago detenido hasta el momento, de surgir alguno se solicita nos compartan una lista que contenga folio OCE y folio fiscal UUID para que el pago pendiente pueda ser llevado a cabo antes de dia 30 de julio 2021.\r\nSe compartirá Guía Operativa a las unidades para poder conocer procesos asi como agilizar respuestas en tiempo y forma, asi mismo para poder evitar negativas de servicios. \r\n', '', 'Queda en común acuerdo que OCEAS es una mutual sacerdotal y sus servicios de atención prescriben a los 2 años es decir a partir de enero de 2022 los servicios que hayan sido otorgados en 2020 caerán en prescripción es decir quedaran sin pago. \r\n\r\nEn caso de encontrar facturas en las que no se haya recibido comprobante de pago o que están pendientes de liquidar, se hará llegar en un listado por parte del Hospital en donde se colocará el numero de folio de la OCE y el numero de folio fiscal UUID c', 'Se realizará una segunda convocatoria en la cual se dará aviso de esta. ', '(AT) (PC) (DP) (ET)', 2, '2021-07-28 10:17:35', 1);
