2021 ocurrirá en noviembre de 2021.\r\n10.	Para los servicios de diciembre de 2021 se hará uso del crédito establecido por la relación comercial para que las facturas y liquidaciones se generen en enero de 2022.', '', 'Se mantiene el descuento directo sobre facturación. Los canales para notificación para servicios programados, hospitalización y facturación-pagos de OCEAS son: programacion@oceas.org.mx, hospitalizacion@oceas.org.mx y proveedores@oceas.org.mx respectivamente. ', 'La próxima reunión se realizará en el mes de octubre para cotejar que nuestros pagos se realizaron en tiempo y forma   ', '(AT) (PC) (DM) (JL) (CE)', 2, '2021-07-28 10:40:48', 1);
INSERT INTO `minutas` VALUES (18, 27, 'VIDEOCONFERENCIA', '2021-07-22', 'nataliaruiz@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Natalia Ruiz ', '1.	Se versa sobre el número de operaciones, montos autorizados, liquidación de servicios y descuentos aplicables directos en facturación.\r\n2.	Se refuerzan las líneas de comunicación para la gestión de servicios de OCEAS. La unidad de administración de salud Empodera realiza las gestiones con la unidad requiriendo información en tiempo y forma para tener vista de la salud del beneficiario y conocer los montos que se generan por su atención. \r\n3.	Se refuerza que las facturas en pdf y xml, acompañadas de la carta autorización por la cual desean tramitar el pago, debe llegar al correo proveedores@oceas.org.mx  para que el pago de estas facturas se realice en forma. \r\n4.	Se notifica que OCEAS es una mutual sacerdotal y sus servicios de atención prescriben a los 2 años. La prescripción por servicios 2020 comenzará en 2022. \r\n5.	La notificación se realiza con seis meses de anticipación pues después de este periodo no podrán ser liquidadas las facturas no emitidas, no refacturadas por aclaración aplicable o en los casos pendientes de información.\r\n6.	Se invita a proveedor a realizar segunda conciliación operativa de facturas del periodo 2020 a fin de que se coteje ninguna se encuentre pendiente de pago antes del mes de octubre de 2021. \r\n7.	El proveedor deberá enviar el número de servicio (ejemplo OCE21001010) y folio fiscal UUID (código alfanumérico de 32 posiciones) para poder rastrear facturas pendientes de pago. \r\n8.	Una vez recibida la conciliación adicional, si alguna factura estuviese pendiente de pago al término de 10 días hábiles liquidará el monto total por los servicios otorgados aplicables a la fecha; se entregará el comprobante de pago; o bien, se notificará la causa de no procedencia.\r\n9.	El cierre para el envío de facturas correspondiente al año fiscal 2021 ocurrirá en noviembre de 2021.\r\n10.	Para los servicios de diciembre de 2021 se hará uso del crédito establecido por la relación comercial para que las facturas y liquidaciones se generen en enero de 2022.', '', 'Se mantiene el descuento directo sobre facturación. Los canales para notificación para servicios programados, hospitalización y facturación-pagos de OCEAS son: programacion@oceas.org.mx, hospitalizacion@oceas.org.mx y proveedores@oceas.org.mx respectivamente.', 'La conciliación adicional deberá ocurrir a partir del 01 de agosto de 2021 y ates de la reunión en el mes de octubre para cotejar que nuestros pagos se realizaron en tiempo y forma.', '(AT) (PC) (DM)', 2, '2021-07-28 11:01:30', 1);
INSERT INTO `minutas` VALUES (19, 28, 'VIDEOCONFERENCIA', '2021-07-22', 'nataliaruiz@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Natalia Ruiz ', '1.	Se versa sobre el número de operaciones, montos autorizados, liquidación de servicios y descuentos aplicables directos en facturación.\r\n2.	Se refuerzan las líneas de comunicación para la gestión de servicios de OCEAS. La unidad de administración de salud Empodera realiza las gestiones con la unidad requiriendo información en tiempo y forma para tener vista de la salud del beneficiario y conocer los montos que se generan por su atención. \r\n3.	Se refuerza que las facturas en pdf y xml, acompañadas de la carta autorización por la cual desean tramitar el pago, debe llegar al correo proveedores@oceas.org.mx  para que el pago de estas facturas se realice en forma. \r\n4.	Se notifica que OCEAS es una mutual sacerdotal y sus servicios de atención prescriben a los 2 años. La prescripción por servicios 2020 comenzará en 2022. \r\n5.	La notificación se realiza con seis meses de anticipación pues después de este periodo no podrán ser liquidadas las facturas no emitidas, no refacturadas por aclaración aplicable o en los casos pendientes de información.\r\n6.	Se invita a proveedor a realizar segunda conciliación operativa de facturas del periodo 2020 a fin de que se coteje ninguna se encuentre pendiente de pago antes del mes de octubre de 2021. \r\n7.	El proveedor deberá enviar el número de servicio (ejemplo OCE21001010) y folio fiscal UUID (código alfanumérico de 32 posiciones) para poder rastrear facturas pendientes de pago. \r\n8.	Una vez recibida la conciliación adicional, si alguna factura estuviese pendiente de pago al término de 10 días hábiles liquidará el monto total por los servicios otorgados aplicables a la fecha; se entregará el comprobante de pago; o bien, se notificará la causa de no procedencia.\r\n9.	El cierre para el envío de facturas correspondiente al año fiscal 2021 ocurrirá en noviembre de 2021.\r\n10.	Para los servicios de diciembre de 2021 se hará uso del crédito establecido por la relación comercial para que las facturas y liquidaciones se generen en enero de 2022.', '', 'Se mantiene el descuento directo sobre facturación. Los canales para notificación para servicios programados, hospitalización y\r\nfacturación-pagos de OCEAS son: programacion@oceas.org.mx, hospitalizacion@oceas.org.mx y proveedores@oceas.org.mx\r\nrespectivamente.', 'La conciliación adicional deberá ocurrir a partir del 01 de agosto de 2021 y ates de la reunión en el mes de octubre para cotejar que nuestros pagos se realizaron en tiempo y forma.', '(AT) (PC) (DM)', 2, '2021-07-28 11:18:56', 1);
INSERT INTO `minutas` VALUES (20, 29, 'VIODECONFERENCIA', '2021-07-22', 'nataliaruiz@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Natalia Ruiz ', '1.	Se versa sobre el número de operaciones, montos autorizados, liquidación de servicios y descuentos aplicables directos en facturación.\r\n2.	El proveedor informa que no tiene identificadas facturas pendientes de pago. \r\n3.	Actualmente se cuenta con un descuento general en servicios del diez por ciento. No obstante, con base en el número de operaciones, volumen por servicio y pagos ya realizados, se presenta al proveedor una solicitud de descuento directo sobre facturación. Este descuento se busca sobre el 2% (dos por ciento). El proveedor se compromete a revisarlo e informar de la decisión. \r\n4.	Se notifica que OCEAS es una mutual sacerdotal y sus servicios de atención prescriben a los 2 años. La prescripción por servicios 2020 comenzará en 2022. Se invita a proveedor a realizar segunda conciliación operativa de facturas del periodo 2020 a fin de que se coteje ninguna se encuentre pendiente de pago antes del mes de octubre de 2021. \r\n5.	La notificación se realiza con seis meses de anticipación pues después de este periodo no podrán ser liquidadas las facturas no emitidas, no refacturadas por aclaración aplicable o en los casos pendientes de información.\r\n6.	El proveedor deberá enviar el número de servicio (ejemplo OCE21001010) y folio fiscal UUID (código alfanumérico de 32 posiciones) para poder rastrear facturas pendientes de pago. \r\n7.	Una vez recibida la conciliación adicional, si alguna factura estuviese pendiente de liquidación, al término de 10 días hábiles liquidará el monto total por los servicios otorgados aplicables a la fecha. O bien, se notificará la causa de no procedencia.\r\n8.	El cierre para el envío de facturas correspondiente al año fiscal 2021 ocurrirá en noviembre de 2021.\r\n9.	Para los servicios de diciembre de 2021 se hará uso del crédito establecido por la relación comercial para que las facturas y liquidaciones se generen en enero de 2022.', 'El descuento estará en revisión. ', 'Los canales para notificación para servicios programados, hospitalización y facturacion-pagos de OCEAS son: programacion@oceas.org.mx, hospitalizacion@oceas.org.mx y proveedores@oceas.org.mx respectivamente. \r\n\r\nLa conciliación adicional deberá ocurrir a partir del 01 de agosto de 2021 y antes de la reunión en el mes de octubre para cotejar que los pagos se han realizado de manera efectiva.', 'En la reunión del mes de octubre se valorará el descuento para saber si es otorgado. ', '(AT) (PC) (ES)', 2, '2021-07-28 11:42:55', 1);
INSERT INTO `minutas` VALUES (21, 38, 'VIDEOCONFERENCIA ', '2021-07-22', 'nataliaruiz@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Natalia Ruiz ', '1.	Se versa sobre el número de operaciones, montos autorizados, liquidación de servicios y descuentos aplicables directos en facturación. \r\n2.	La comunicación con la unidad no ha sido optima y se perciben retrasos en la comunicación. Se refuerza que bajo la actual administración el objetivo de las gestiones es la salvaguarda de la salud de los beneficiarios de OCEAS, pasando de unidad de pago a unidad de administración de servicios de salud, se requiere acceso a la información médica y administrativa en los plazos establecidos (al momento del ingreso, cada 24 horas durante la estancia y previo al egreso). Esto con el fin de tener acceso a los reportes del estado de salud del beneficiario y conocer los montos que se generan por su atención.\r\n3.	Se notifica que OCEAS es una mutual sacerdotal y sus servicios de atención prescriben a los 2 años. La prescripción por servicios 2020 comenzará en 2022. Se invita a proveedor a realizar segunda conciliación operativa de facturas del periodo 2020 a fin de que se coteje ninguna se encuentre pendiente de pago antes del mes de octubre de 2021. \r\n4.	La notificación se realiza con seis meses de anticipación pues después de este periodo no podrán ser liquidadas las facturas no emitidas, no refacturadas por aclaración aplicable o en los casos pendientes de información.\r\n5.	El proveedor deberá enviar el número de servicio (ejemplo OCE21001010) y folio fiscal UUID (código alfanumérico de 32 posiciones) para poder rastrear facturas pendientes de pago. \r\n6.	Una vez recibida la conciliación adicional, si alguna factura estuviese pendiente de liquidación, al término de 10 días hábiles liquidará el monto total por los servicios otorgados aplicables a la fecha. O bien, se notificará la causa de no procedencia.\r\n7.	Se mantienen los descuentos acordados en reuniones previas. \r\n', 'La conciliación adicional deberá ocurrir a partir del 01 de agosto de 2021 y antes de la reunión en el mes de octubre para cotejar que los pagos se han realizado de manera efectiva. Mejorar el flujo de información y el flujo de servicios para fortalecer la relación.', 'Los canales para notificación para servicios programados, hospitalización y facturacin-pagos de OCEAS son: programacion@oceas.org.mx, hospitalizacion@oceas.org.mx y proveedores@oceas.org.mx respectivamente. Línea de atención telefónica (Late) 55 4160 2780. \r\nEl cierre para el envío de facturas correspondiente al año fiscal 2021 ocurrirá en noviembre de 2021. Para los servicios de diciembre de 2021 se hará uso del crédito establecido por la relación comercial para que las facturas y liquidaciones se generen en enero de 2022.', 'Reunión en el mes de octubre con la finalidad de cotejar que los servicios estén liquidados ', '(AT) (PC) (SC) (SE)', 2, '2021-07-29 12:08:32', 1);
