cido por la relación comercial para que las facturas y liquidaciones se generen en enero de 2022.', '', 'Los canales para notificación para servicios programados, hospitalización y facturacion-pagos de OCEAS son: programacion@oceas.org.mx, hospitalizacion@oceas.org.mx y proveedores@oceas.org.mx respectivamente. Línea de atención telefónica (Late) 55 4160 2780. \r\n\r\nLa conciliación adicional deberá ocurrir a partir del 01 de agosto de 2021 y antes de la reunión en el mes de octubre para cotejar que los pagos se han realizado de manera efectiva.', 'Se plantea reunión en el mes de agosto con la finalidad de corroborar cuales son las facturas que están pendientes del ciclo 2020 como 2021.', '(AT) (PC) (ME) (AM) (JL)', 2, '2021-07-29 12:33:42', 1);
INSERT INTO `minutas` VALUES (23, 30, 'VIDEOCONFERENCIA ', '2021-07-22', 'nataliaruiz@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Natalia Ruiz ', '1.	Se versa sobre el número de operaciones, montos autorizados, liquidación de servicios y descuentos aplicables directos en facturación.\r\n2.	La comunicación con la unidad ha sido aceptable. No obstante, dado que bajo la actual administración el objetivo de las gestiones es la salvaguarda de la salud de los beneficiarios de OCEAS, pasando de unidad de pago a unidad de administración de servicios de salud, se requiere acceso a la información médica y administrativa en los plazos establecidos (al momento del ingreso, cada 24 horas durante la estancia y previo al egreso). Esto con el fin de tener acceso a los reportes del estado de salud del beneficiario y conocer los montos que se generan por su atención.\r\n3.	Se notifica que OCEAS es una mutual sacerdotal y sus servicios de atención prescriben a los 2 años. La prescripción por servicios 2020 comenzará en 2022. Se invita a proveedor a realizar segunda conciliación operativa de facturas del periodo 2020 a fin de que se coteje ninguna se encuentre pendiente de pago antes del mes de octubre de 2021. \r\n4.	La notificación se realiza con seis meses de anticipación pues después de este periodo no podrán ser liquidadas las facturas no emitidas, no refacturadas por aclaración aplicable o en los casos pendientes de información.\r\n5.	El proveedor deberá enviar el número de servicio (ejemplo OCE21001010) y folio fiscal UUID (código alfanumérico de 32 posiciones) para poder rastrear facturas pendientes de pago. ', 'La conciliación adicional deberá ocurrir a partir del 01 de agosto de 2021 y antes de la reunión en el mes de octubre para cotejar que los pagos se han realizado de manera efectiva. Una vez recibida la conciliación adicional, si alguna factura estuviese pendiente de liquidación, al término de 10 días hábiles liquidará el monto total por los servicios otorgados aplicables a la fecha. O bien, se notificará la causa de no procedencia. Se plantea reunión en el mes de octubre con la finalidad de cotejar que los servicios estén liquidados  para poder obtener la Carta No Adeudo', 'Los canales para notificación para servicios programados, hospitalización y facturacion-pagos de OCEAS son: programacion@oceas.org.mx, hospitalizacion@oceas.org.mx y proveedores@oceas.org.mx respectivamente. Línea de atención telefónica (Late) 55 4160 2780. ', '', '(AT) (PC) (EC) (AO) (MS)', 2, '2021-07-29 15:08:24', 1);
