ctivamente. Línea de atención telefónica (Late) 55 4160 2780. ', 'Se plantea reunión en el mes de agosto con la finalidad de corroborar cuales son las facturas que están pendientes del ciclo 2020 como 2021.', '(AT) (PC)', 2, '2021-07-29 17:05:51', 1);
INSERT INTO `minutas` VALUES (25, 34, 'VIDEOCONFERENCIA ', '2021-07-22', 'nataliaruiz@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Natalia Ruiz ', '1. Se versaría sobre el número de operaciones, montos autorizados, liquidación de servicios y descuentos aplicables directos en\r\nfacturación. 2. Se notificaría que OCEAS es una mutual sacerdotal y sus servicios de atención prescriben a los 2 años. La prescripción por\r\nservicios 2020 comenzará en 2022. Se invita a proveedor a realizar segunda conciliación operativa de facturas del periodo 2020 a fin de\r\nque se coteje ninguna se encuentre pendiente de pago antes del mes de octubre de 2021. 3. La notificación se realizaría con seis meses de\r\nanticipación pues después de este periodo no podrán ser liquidadas las facturas no emitidas, no refacturadas por aclaración aplicable o en\r\nlos casos pendientes de información. 4. El proveedor deberá enviar el número de servicio (ejemplo OCE21001010) y folio fiscal UUID\r\n(código alfanumérico de 32 posiciones) para poder rastrear facturas pendientes de pago. 5. Una vez recibida la conciliación adicional, si\r\nalguna factura estuviese pendiente de liquidación, al término de 10 días hábiles liquidaría el monto total por los servicios otorgados\r\naplicables a la fecha. O bien, se notificará la causa de no procedencia. 6. El cierre para el envío de facturas correspondiente al año fiscal\r\n2021 ocurrirá en noviembre de 2021. 7. Para los servicios de diciembre de 2021 se hará uso del crédito establecido por la relación\r\ncomercial para que las facturas y liquidaciones se generen en enero de 2022.', 'La conciliación adicional debería ocurrir a partir del 01 de agosto de 2021 y antes de la reunión en el mes de octubre para cotejar que los\r\npagos se han realizado de manera efectiva.', 'Los canales para notificación para servicios programados, hospitalización y facturacion-pagos de OCEAS son:\r\nprogramacion@oceas.org.mx, hospitalizacion@oceas.org.mx y proveedores@oceas.org.mx respectivamente. Línea de atención telefónica\r\n(Late) 55 4160 2780. ', 'Se plantea una reunión en el mes de octubre para revisión de montos , servicios y facturas que estén pendientes por lo cual esperamos contar con su presencia. ', '(AT) (PC)', 2, '2021-07-29 17:23:55', 1);
INSERT INTO `minutas` VALUES (26, 5, 'PLATAFORMA', '2021-08-24', 'nmendoza@empoderasalud.mx', 'nmendoza@empoderasalud.mx', 'Norma Mendoza', '1.	Se versa sobre los tiempos de respuesta de acuerdo a proceso para cotizaciones, entrega de acuses, facturación y pagos. \r\n2.	Se específica que, además del acuse de paquetería, dentro de la caja de los medicamentos debe ir el listado de medicamentos que se entregan y se compartirá confirmación de medicamentos recibidos (fotografía) con acuse de entrega. Esto con el objetivo de cotejar plenamente lo que se envía por el proveedor y se recibe por el beneficiario. Esto permitirá realizar las aclaraciones en caso de discrepancia y mantener el apego a procesos.\r\n3.	Se refuerza el evitar demoras en la entrega de cotizaciones, acuses y entrega de medicamentos pues generan retrasos administrativos, reprocesos y eventualmente afectación directa a los beneficiarios.\r\n4.	El proveedor expone los casos de retrasos debidos a los servicios de paquetería, secundarios a afectaciones climáticas y por pandemia.\r\n5.	Se solicita a proveedor dar cumplimiento a los tiempos de respuesta de acuerdo con procesos y mejorar comunicación con paquetería.\r\n6.	El proveedor notificará a OCEAS todo problema relacionado a una entrega de medicamento, incluyendo dificultades para comunicación con los beneficiarios para confirmación de arribo de paquetería. Se debe tener constancia de la búsqueda de confirmación de los medicamentos entregados. El acuse de entrega y/o la evidencia de búsqueda de respuesta del beneficiario para confirmación de medicamentos entregados se deberá realizar a las 72 horas.\r\n7.	Se confirma horario de servicio del proveedor de lunes a viernes de 09:00 - 18:00 h\r\n', 'Se realizará otra reunión en el mes de octubre para revisión de los acuerdos establecidos. ', 'El cierre para el envío de facturas correspondiente al año fiscal 2021 ocurrirá en noviembre de 2021. \r\nPara los servicios de diciembre de 2021 se hará uso del crédito establecido por la relación comercial para que las facturas y liquidaciones se generen en enero de 2022.\r\n', '', 'AT, PC, IZ, NM, GR, DG, AO.', 2, '2021-08-04 12:21:40', 1);
INSERT INTO `minutas` VALUES (27, 54, 'VIDEOCONFERENCIA meet.google.com/xsw-zfwu-izr', '2021-07-26', 'nataliaruiz@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Natalia Ruiz ', '1. Se versaría sobre el número de operaciones, montos autorizados, liquidación de servicios y descuentos aplicables directos enfacturación.\r\n2. Se notificaría que OCEAS es una mutual sacerdotal y sus servicios de atención prescriben a los 2 años. La prescripción porservicios\r\n2020 comenzará en 2022. Se invita a proveedor a realizar segunda conciliación operativa de facturas del periodo 2020 a fin deque se coteje\r\nninguna se encuentre pendiente de pago antes del mes de octubre de 2021. 3. La notificación se realizaría con seis meses deanticipación\r\npues después de este periodo no podrán ser liquidadas las facturas no emitidas, no refacturadas por aclaración aplicable o enlos casos\r\npendientes de información. 4. El proveedor deberá enviar el número de servicio (ejemplo OCE21001010) y folio fiscal UUID(código\r\nalfanumérico de 32 posiciones) para poder rastrear facturas pendientes de pago. 5. Una vez recibida la conciliación adicional, sialguna\r\nfactura estuviese pendiente de liquidación, al término de 10 días hábiles liquidaría el monto total por los servicios otorgadosaplicables a la\r\nfecha. O bien, se notificará la causa de no procedencia. 6. El cierre para el envío de facturas correspondiente al año fiscal2021 ocurrirá en\r\nnoviembre de 2021.', 'La conciliación adicional debería ocurrir a partir del 01 de agosto de 2021 y antes de la reunión en el mes de octubre para cotejar que los\r\npagos se han realizado de manera efectiva.', 'Los canales para notificación para servicios programados, hospitalización y facturacion-pagos de OCEAS son:\r\nprogramacion@oceas.org.mx, hospitalizacion@oceas.org.mx y proveedores@oceas.org.mx respectivamente. Línea de atención telefónica\r\n(Late) 55 4160 2780.\r\n', 'Los canales para notificación para servicios programados, hospitalización y facturacion-pagos de OCEAS son:\r\nprogramacion@oceas.org.mx, hospitalizacion@oceas.org.mx y proveedores@oceas.org.mx respectivamente. Línea de atención telefónica\r\n(Late) 55 4160 2780.\r\n', '(AT) (PC)', 2, '2021-08-04 16:38:48', 1);
INSERT INTO `minutas` VALUES (28, 60, 'VIDEOCONFERENCIA ', '2021-07-26', 'nataliaruiz@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Natalia Ruiz ', 'OCEAS es una mutual sacerdotal y sus servicios de atención prescriben a los 2 años es decir a partir de enero de 2022 los servicios que hayan sido otorgados en 2020 caerán en prescripción es decir quedaran sin pago. \r\n \r\nSe valida que las facturas lleguen al correo indicado que es proveedores@oceas.org.mx  para que el pago de estas facturas se realice en forma. Si nosotros no tenemos vista a operaciones que hayan ocurrido en enero de 2020 y queden sin ser tramitadas para pago, OCEAS se queda sin responsabilidad de pago de ese servicio ya que el compromiso de pago ha prescrito.  Se acuerda entre ambas partes que se refuercen los canales de comunicación y dejar sentado que 6 meses antes de que ocurra la prescripción estamos notificando para el tema de cobro. \r\n\r\nEn caso de encontrar facturas en las que no se haya recibido comprobante de pago o que están pendientes de liquidar, se hará llegar en un listado por parte del Hospital en donde se colocará el número de folio de la OCE y el número de folio fiscal UUID con la finalidad de que se pueda hacer la conciliación de los pagos. \r\n', '', 'SE TIENE PLANTEADA REUNION EN AGOSTO , POR LO QUE AGRADEMOS SU PRESENCIA. ', '', '(AT) (PC)', 2, '2021-08-04 16:56:37', 1);
INSERT INTO `minutas` VALUES (29, 35, 'VIDEOCONFERENCIA meet.google.com/nok-xjty-unr', '2021-07-22', 'irvingzuniga@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Irving Zúñiga', '1.	Se versa sobre el número de operaciones, montos autorizados, liquidación de servicios y descuentos aplicables directos en facturación.\r\n2.	La comunicación con la unidad ha sido aceptable. No obstante, dado que bajo la actual administración el objetivo de las gestiones es la salvaguarda de la salud de los beneficiarios de OCEAS, pasando de unidad de pago a unidad de administración de servicios de salud, se requiere acceso a la información médica y administrativa en los plazos establecidos (al momento del ingreso, cada 24 horas durante la estancia y previo al egreso). Esto con el fin de tener acceso a los reportes del estado de salud del beneficiario y conocer los montos que se generan por su atención.\r\n3.	Proveedor solicita capacitación para las personas que son de reciente ingreso. Así mismo se comparte una Guía Operativa de Servicios con el fin de reforzar los procesos de acuerdo con los servicios otorgados a los beneficiarios. El tiempo, el tiempo enviará actualización del directorio operativo de las unidades de SAN ANGEL INN para comunicación efectiva. \r\n4.	Se notifica que OCEAS es una mutual sacerdotal y sus servicios de atención prescriben a los 2 años. La prescripción por servicios 2020 comenzará en 2022. Se invita a proveedor a realizar segunda conciliación operativa de facturas del periodo 2020 a fin de que se coteje ninguna se encuentre pendiente de pago antes del mes de octubre de 2021. \r\n5.	La notificación se realiza con seis meses de anticipación pues después de este periodo no podrán ser liquidadas las facturas no emitidas, no refacturadas por aclaración aplicable o en los casos pendientes de información.\r\n6.	El proveedor deberá enviar el número de servicio (ejemplo OCE21001010) y folio fiscal UUID (código alfanumérico de 32 posiciones) para poder rastrear facturas pendientes de pago. ', 'La conciliación adicional deberá ocurrir a partir del 01 de agosto de 2021 y antes de la reunión en el mes de octubre para cotejar que los pagos se han realizado de manera efectiva. Una vez recibida la conciliación adicional, si alguna factura estuviese pendiente de liquidación, al término de 10 días hábiles liquidará el monto total por los servicios otorgados aplicables a la fecha. O bien, se notificará la causa de no procedencia.', 'Los canales para notificación para servicios programados, hospitalización y facturacion-pagos de OCEAS son: programacion@oceas.org.mx, hospitalizacion@oceas.org.mx y proveedores@oceas.org.mx respectivamente. Línea de atención telefónica (Late) 55 4160 2780. ', 'Reunión en el mes de octubre con la finalidad de cotejar que los servicios de 2020 y 2021  estén liquidados para que nos puedan otorgar la Carta No Adeudo . ', '(AT) (PC) (DR) (MM) (M)', 2, '2021-08-06 10:48:48', 1);
INSERT INTO `minutas` VALUES (30, 36, 'VIDEOCONFERENCIA  meet.google.com/bzq-djzm-gdk', '2021-07-22', 'nataliaruiz@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Natalia Ruiz ', '1.	Se versa sobre el número de operaciones, montos autorizados, liquidación de servicios y descuentos aplicables directos en facturación. \r\n2.	El proveedor notifica que no se encuentra algún caso en trámite o pendiente de pago al momento.\r\n3.	Se notifica que OCEAS es una mutual sacerdotal y sus servicios de atención prescriben a los 2 años. La prescripción por servicios 2020 comenzará en 2022. Se invita a proveedor a realizar segunda conciliación operativa de facturas del periodo 2020 a fin de que se coteje ninguna se encuentre pendiente de pago antes del mes de octubre de 2021. \r\n4.	La notificación se realiza con seis meses de anticipación pues después de este periodo no podrán ser liquidadas las facturas no emitidas, no refacturadas por aclaración aplicable o en los casos pendientes de información.\r\n5.	El proveedor deberá enviar el número de servicio (ejemplo OCE21001010) y folio fiscal UUID (código alfanumérico de 32 posiciones) para poder rastrear facturas pendientes de pago. \r\n6.	Una vez recibida la conciliación adicional, si alguna factura estuviese pendiente de liquidación, al término de 10 días hábiles liquidará el monto total por los servicios otorgados aplicables a la fecha. O bien, se notificará la causa de no procedencia.\r\n7.	El cierre para el envío de facturas correspondiente al año fiscal 2021 ocurrirá en noviembre de 2021.\r\n8.	Para los servicios de diciembre de 2021 se hará uso del crédito establecido por la relación comercial para que las facturas y liquidaciones se generen en enero de 2022.\r\n', 'La conciliación adicional deberá ocurrir a partir del 01 de agosto de 2021 y antes de la reunión en el mes de octubre para cotejar que los pagos se han realizado de manera efectiva. ', 'Los canales para notificación para servicios programados, hospitalización y facturacin-pagos de OCEAS son: programacion@oceas.org.mx, hospitalizacion@oceas.org.mx y proveedores@oceas.org.mx respectivamente. Línea de atención telefónica (Late) 55 4160 2780. ', 'Reunión en el mes de octubre con la finalidad de cotejar que los servicios del año 2020 y 2021  estén liquidados para poder emitir la Carta No Adeudo. ', '(AT) (PC)  (EV) (MD)', 2, '2021-08-06 11:29:12', 1);
