 fecha. O bien, se notificará la causa de no procedencia.', 'La conciliación adicional deberá ocurrir a partir del 01 de agosto de 2021 y antes de la reunión en el mes de octubre para cotejar que los pagos se han realizado de manera efectiva. ', 'Los canales para notificación para servicios programados, hospitalización y facturacin-pagos de OCEAS son: programacion@oceas.org.mx, hospitalizacion@oceas.org.mx y proveedores@oceas.org.mx respectivamente. Línea de atención telefónica (Late) 55 4160 2780. \r\n\r\nEl cierre para el envío de facturas correspondiente al año fiscal 2021 ocurrirá en noviembre de 2021. Para los servicios de diciembre de 2021 se hará uso del crédito establecido por la relación comercial para que las facturas y liquidaciones se generen en enero de 2022.\r\n', 'Se plantea reunión en el mes de octubre con la finalidad de cotejar que los servicios del año 2020 y 2021  estén liquidados  para poder obtener la Carta No Adeudo. ', '(AT) (PC) (GV)', 2, '2021-08-06 13:00:08', 1);
