nión en el mes de octubre para cotejar que los pagos se han realizado de manera efectiva. ', 'Los canales para notificación para servicios programados, hospitalización y facturacin-pagos de OCEAS son: programacion@oceas.org.mx, hospitalizacion@oceas.org.mx y proveedores@oceas.org.mx respectivamente. Línea de atención telefónica (Late) 55 4160 2780. ', 'Se plantea reunión en el mes de octubre con la finalidad de cotejar que los servicios del año 2020 y 2021 estén liquidados para poder obtener la Carta No Adeudo de cada año.', '(AT) (PC (PV) (CG)', 2, '2021-08-06 13:42:20', 1);
INSERT INTO `minutas` VALUES (37, 43, 'VIDEOCONFERENCIA ', '2021-07-23', 'nataliaruiz@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'NATALIA RUIZ ', '1. Se versa sobre el número de operaciones, montos autorizados, liquidación de servicios y descuentos aplicables directos en facturación. 2. Se refuerzan las líneas de comunicación para la gestión de servicios de OCEAS. La unidad de administración de salud Empodera realiza las gestiones con la unidad requiriendo información en tiempo y forma para tener vista de la salud del beneficiario y conocer los montos que se generan por su atención. 3. Se refuerza que las facturas en PDF y XML , acompañadas de la carta autorización por la cual desean tramitar el pago, debe llegar al correo proveedores@oceas.org.mx para que el pago de estas facturas se realice en forma. 4. Se notifica que OCEAS es una mutual sacerdotal y sus servicios de atención prescriben a los 2 años. La prescripción por servicios 2020 comenzará en 2022. 5. La notificación se realiza con seis meses de anticipación pues después de este periodo no podrán ser liquidadas las facturas no emitidas, no refacturadas por aclaración aplicable o en los casos pendientes de información. 6. Se invita a proveedor a realizar segunda conciliación operativa de facturas del periodo 2020 a fin de que se coteje ninguna se encuentre pendiente de pago antes del mes de octubre de 2021. 7. El proveedor deberá enviar el número de servicio (ejemplo OCE21001010) y folio fiscal UUID (código alfanumérico de 32 posiciones) para poder rastrear facturas pendientes de pago. 8. Una vez recibida la conciliación adicional, si alguna factura estuviese pendiente de pago al término de 10 días hábiles liquidará el monto total por los servicios otorgados aplicables a la fecha; se entregará el comprobante de pago; o bien, se notificará la causa de no procedencia. 9. El cierre para el envío de facturas correspondiente al año fiscal 2021 ocurrirá en noviembre de 2021. 10. Para los servicios de diciembre de 2021 se hará uso del crédito establecido por la relación comercial para que las facturas y liquidaciones se generen en enero de 2022.', 'La conciliación adicional deberá ocurrir a partir del 01 de agosto de 2021 y antes de la reunión en el mes de octubre para cotejar que los pagos se han realizado de manera efectiva. ', 'Los canales para notificación para servicios programados, hospitalización y facturación pagos de OCEAS son: programacion@oceas.org.mx, hospitalizacion@oceas.org.mx y proveedores@oceas.org.mxrespectivamente', 'La próxima reunión se realizará en el mes de octubre para cotejar que nuestros pagos se realizaron en tiempo y forma.', '(AT) (PC) (IZ) (NR) (CC)', 2, '2021-08-09 14:57:47', 1);
