cturas que estén pendientes por lo cual esperamos contar con su presencia.', '(AT) (PC) (IZ) (NR) (VM)', 2, '2021-08-14 20:43:19', 1);
INSERT INTO `minutas` VALUES (46, 52, 'VIDEOCONFERENCIA meet.google.com/cay-dfxg-sgg', '2021-07-26', 'nataliaruiz@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Natalia Ruiz ', '1. Se versaría sobre el número de operaciones, montos autorizados, liquidación de servicios y descuentos aplicables directos enfacturación.\r\n2. Se notificaría que OCEAS es una mutual sacerdotal y sus servicios de atención prescriben a los 2 años. La prescripción porservicios\r\n2020 comenzará en 2022. Se invita a proveedor a realizar segunda conciliación operativa de facturas del periodo 2020 a fin deque se coteje\r\nninguna se encuentre pendiente de pago antes del mes de octubre de 2021. 3. La notificación se realizaría con seis meses deanticipación\r\npues después de este periodo no podrán ser liquidadas las facturas no emitidas, no refacturadas por aclaración aplicable o enlos casos\r\npendientes de información. 4. El proveedor deberá enviar el número de servicio (ejemplo OCE21001010) y folio fiscal UUID(código\r\nalfanumérico de 32 posiciones) para poder rastrear facturas pendientes de pago. 5. Una vez recibida la conciliación adicional, sialguna\r\nfactura estuviese pendiente de liquidación, al término de 10 días hábiles liquidaría el monto total por los servicios otorgadosaplicables a la\r\nfecha. O bien, se notificará la causa de no procedencia. 6. El cierre para el envío de facturas correspondiente al año fiscal2021 ocurrirá en\r\nnoviembre de 2021.', 'La conciliación adicional debería ocurrir a partir del 01 de agosto de 2021 y antes de la reunión en el mes de octubre para cotejar que los\r\npagos se han realizado de manera efectiva.', 'Los canales para notificación para servicios programados, hospitalización y facturación pagos de OCEAS son: programacion@oceas.org.mx, hospitalizacion@oceas.org.mx y proveedores@oceas.org.mxrespectivamente', 'La próxima reunión se realizará en el mes de agosto para cotejar que nuestros pagos se realizaron en tiempo y forma', '(AT) (PC) (IZ) (NR)', 2, '2021-08-14 20:59:59', 1);
INSERT INTO `minutas` VALUES (47, 53, 'VIDEOCONFERENCIA meet.google.com/uiw-pabn-nku', '2021-07-26', 'nataliaruiz@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Natalia Ruiz ', '1.	Se versa sobre el número de operaciones, montos autorizados, liquidación de servicios y descuentos aplicables directos en facturación. \r\n2.	La comunicación con la unidad ha sido adecuada. No obstante, se fortalece el tema de que la comunicación se tiene que dar antes, durante y después de la instancia. Antes, porque nosotros notificamos que el beneficiario va a llegar o por parte de la unidad nos notifican previo al ingreso de los beneficiarios a hospitalización. Durante, debido que necesitamos estar en contante comunicación cada 24 horas para que realicen el envío de notas médicas y el detalle de gastos que se generen por la atención y después para el tema de conciliar los procesos de operación y pagos.\r\n3.	Se refuerzan las líneas de comunicación para la gestión de servicios de OCEAS. La unidad de administración de salud Empodera realiza las gestiones con la unidad requiriendo información en tiempo y forma para tener vista de la salud del beneficiario y conocer los montos que se generan por su atención. \r\n4.	Se refuerza que las facturas en PDF y XML, acompañadas de la carta autorización por la cual desean tramitar el pago, debe llegar al correo proveedores@oceas.org.mx para que el pago de estas facturas se realice en forma. \r\n5.	Se mantendrán los adecuados costos que se han brindado durante el primer semestre del 2021. Se solicita que durante el transcurso del segundo semestre se otorgue un descuento del dos al cinco por ciento directo sobre facturación. La solicitud se realiza toda vez que el flujo de operaciones es adecuado y que nuestro compromiso para el pronto pago se ha mantenido y existe una adecuada comunicación administrativa.\r\n6.	Se notifica que OCEAS es una mutual sacerdotal y sus servicios de atención prescriben a los 2 años. La prescripción por servicios 2020 comenzará en 2022. Se invita a proveedor a realizar segunda conciliación operativa de facturas del periodo 2020 a fin de que se coteje ninguna se encuentre pendiente de pago antes de octubre de 2021. ', 'a)	La conciliación adicional deberá ocurrir a partir del 01 de agosto de 2021 y antes de la reunión en el mes de octubre para cotejar que los pagos se han realizado de manera efectiva. La notificación se realiza con seis meses de anticipación pues después de este periodo no podrán ser liquidadas las facturas no emitidas, no refacturadas por aclaración aplicable o en los casos pendientes de información. \r\nb)	El proveedor deberá enviar el número de servicio (ejemplo OCE21001010) y folio fiscal UUID (código alfanumérico de 32 posiciones) para poder rastrear facturas pendientes de pago. \r\nc)	Una vez recibida la conciliación adicional, si alguna factura estuviese pendiente de liquidación, al término de 10 días hábiles liquidará el monto total por los servicios otorgados aplicables a la fecha. O bien, se notificará la causa de no procedencia\r\nd)	Se verificará el porcentaje descuento que nos puedan otorgar sea entre el 2% y el 5% del cual se hará la revisión de los casos y montos para que el proveedor nos puedan brindar respuesta. El descuento deseamos sea aplicable con base en los servicios ya asignados de enero de 2021 a julio de 2021.', 'Los canales para notificación para servicios programados, hospitalización y facturación pagos de OCEAS son: programacion@oceas.org.mx, hospitalizacion@oceas.org.mx y proveedores@oceas.org.mx respectivamente.', 'La próxima reunión se realizará en el mes de octubre para cotejar que nuestros pagos se realizaron en tiempo y forma', '(AT) (PC) (IZ) (NR) (SP)', 2, '2021-08-14 21:07:58', 1);
INSERT INTO `minutas` VALUES (48, 54, 'VIDEOCONFERENCIA ', '2021-07-26', 'nataliaruiz@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Natalia Ruiz ', '1. Se versa sobre el número de operaciones, montos autorizados, liquidación de servicios y descuentos aplicables directos en facturación. 2. Se refuerzan las líneas de comunicación para la gestión de servicios de OCEAS. La unidad de administración de salud Empodera realiza las gestiones con la unidad requiriendo información en tiempo y forma para tener vista de la salud del beneficiario y conocer los montos que se generan por su atención. 3. Se refuerza que las facturas en PDF y XML , acompañadas de la carta autorización por la cual desean tramitar el pago, debe llegar al correo proveedores@oceas.org.mx para que el pago de estas facturas se realice en forma. 4. Se notifica que OCEAS es una mutual sacerdotal y sus servicios de atención prescriben a los 2 años. La prescripción por servicios 2020 comenzará en 2022. 5. La notificación se realiza con seis meses de anticipación pues después de este periodo no podrán ser liquidadas las facturas no emitidas, no refacturadas por aclaración aplicable o en los casos pendientes de información. 6. Se invita a proveedor a realizar segunda conciliación operativa de facturas del periodo 2020 a fin de que se coteje ninguna se encuentre pendiente de pago antes del mes de octubre de 2021. 7. El proveedor deberá enviar el número de servicio (ejemplo OCE21001010) y folio fiscal UUID (código alfanumérico de 32 posiciones) para poder rastrear facturas pendientes de pago. 8. Una vez recibida la conciliación adicional, si alguna factura estuviese pendiente de pago al término de 10 días hábiles liquidará el monto total por los servicios otorgados aplicables a la fecha; se entregará el comprobante de pago; o bien, se notificará la causa de no procedencia. 9. El cierre para el envío de facturas correspondiente al año fiscal 2021 ocurrirá en noviembre de 2021. 10. Para los servicios de diciembre de 2021 se hará uso del crédito establecido por la relación comercial para que las facturas y liquidaciones se generen en enero de 2022.11.Se busca que proveedor nos otorgue un descuento de alrededor del 2% directo sobre facturación.', '', 'Los canales para notificación para servicios programados, hospitalización y facturación pagos de OCEAS son: programacion@oceas.org.mx, hospitalizacion@oceas.org.mx y proveedores@oceas.org.mxrespectivamente', 'La próxima reunión se realizará en el mes de agosto para cotejar que nuestros pagos se realizaron en tiempo y forma', '(AT) (PC) (IZ) (NR)', 2, '2021-08-14 21:15:12', 5);
