formación.\r\n7.	El proveedor deberá enviar el número de servicio (ejemplo OCE21001010) y folio fiscal UUID (código alfanumérico de 32 posiciones) para poder rastrear facturas pendientes de pago. ', 'A) Una vez recibida la conciliación adicional, si alguna factura estuviese pendiente de liquidación, al término de 10 días hábiles liquidará el monto total por los servicios otorgados aplicables a la fecha. O bien, se notificará la causa de no procedencia.\r\n\r\nB) El cierre para el envío de facturas correspondiente al año fiscal 2021 ocurrirá en noviembre de 2021.\r\nC) Para los servicios de diciembre de 2021 se hará uso del crédito establecido por la relación comercial para que las facturas y liquidaciones se generen en enero de 2022.\r\n', 'Los canales para notificación para servicios programados, hospitalización y facturación pagos de OCEAS son: programacion@oceas.org.mx, hospitalizacion@oceas.org.mx y proveedores@oceas.org.mx respectivamente', 'La próxima reunión se realizará en el mes de octubre para cotejar que nuestros pagos se realizaron en tiempo y forma', '(AT) (PC) (IZ) (NR) (LG)', 2, '2021-08-14 21:30:47', 1);
