INSERT INTO `minutas` VALUES (52, 12, 'VIDEOCONFERENCIA meet.google.com/rqt-utsr-gtu', '2021-07-21', 'irvingzuniga@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Irving Zúñiga', '1.	Se versa sobre el número de operaciones, montos autorizados, liquidación de servicios y descuentos aplicables directos en facturación.\r\n2.	Se refrenda que la unidad de administración de salud Empodera realiza gestiones para la salvaguarda de la salud de los beneficiarios de OCEAS. Por ello, se requiere acceso a la información en tiempo y forma para tener acceso a los reportes del estado de salud del beneficiario y conocer los montos que se generan por su atención. \r\n3.	Se mantendrán los adecuados costos que se han brindado durante el primer semestre del 2021. Se solicita que durante el transcurso del segundo semestre se otorgue un descuento del dos al cinco por ciento directo sobre facturación. La solicitud se realiza toda vez que el flujo de operaciones es adecuado y que nuestro compromiso para el pronto pago se ha mantenido y existe una adecuada comunicación administrativa. \r\n4.	Se invita a proveedor a realizar segunda conciliación operativa de facturas del periodo 2020 a fin de que se coteje ninguna se encuentre pendiente de pago antes del mes de octubre de 2021. \r\n5.	El proveedor deberá enviar el número de servicio (ejemplo OCE21001010) y folio fiscal UUID (código alfanumérico de 32 posiciones) para poder rastrear facturas pendientes de pago. \r\n6.	Una vez recibida la conciliación adicional, si alguna factura estuviese pendiente de pago al término de 10 días hábiles liquidará el monto total por los servicios otorgados aplicables a la fecha; se entregará el comprobante de pago; o bien, se notificará la causa de no procedencia.\r\n7.	El cierre para el envío de facturas correspondiente al año fiscal 2021 ocurrirá en noviembre de 2021. \r\n8.	Para los servicios de diciembre de 2021 se hará uso del crédito establecido por la relación comercial para que las facturas y liquidaciones se generen en enero de 2022.', 'La conciliación adicional deberá ocurrir a partir del 01 de agosto de 2021 y ates de la reunión en el mes de octubre para cotejar que\r\nnuestros pagos se realizaron en tiempo y forma', 'Se verificará el porcentaje descuento que nos puedan otorgar sea entre el 2% y el 5% del cual se hará la revisión de los casos y montos\r\npara que el proveedor nos puedan brindar respuesta. El descuento deseamos sea aplicable con base en los servicios ya asignados de enero\r\nde 2021 a julio de 2021.', 'La próxima reunión se realizará en el mes de octubre. ', '(AT)(PC) (AR) (MR)', 2, '2021-08-16 12:47:24', 1);
INSERT INTO `minutas` VALUES (53, 14, 'VIDEOCONFERENCIA meet.google.com/rqt-utsr-gtu', '2021-07-21', 'irvingzuniga@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Irving Zúñiga', '1. Se versa sobre el número de operaciones, montos autorizados, liquidación de servicios y descuentos aplicables directos en facturación.2.\r\nSe refrenda que la unidad de administración de salud Empodera realiza gestiones para la salvaguarda de la salud de los beneficiarios de\r\nOCEAS. Por ello, se requiere acceso a la información en tiempo y forma para tener acceso a los reportes del estado de salud del\r\nbeneficiario y conocer los montos que se generan por su atención. 3. Se mantendrán los adecuados costos que se han brindado durante el\r\nprimer semestre del 2021. Se solicita que durante el transcurso del segundo semestre se otorgue un descuento del dos al cinco por ciento\r\ndirecto sobre facturación. La solicitud se realiza toda vez que el flujo de operaciones es adecuado y que nuestro compromiso para el pronto\r\npago se ha mantenido y existe una adecuada comunicación administrativa. 4. Se invita a proveedor a realizar segunda conciliación\r\noperativa de facturas del periodo 2020 a fin de que se coteje ninguna se encuentre pendiente de pago antes del mes de octubre de 2021. 5.\r\nEl proveedor deberá enviar el número de servicio (ejemplo OCE21001010) y folio fiscal UUID (código alfanumérico de 32 posiciones)\r\npara poder rastrear facturas pendientes de pago. 6. Una vez recibida la conciliación adicional, si alguna factura estuviese pendiente de pago\r\nal término de 10 días hábiles liquidará el monto total por los servicios otorgados aplicables a la fecha; se entregará el comprobante depago;\r\no bien, se notificará la causa de no procedencia. 7. El cierre para el envío de facturas correspondiente al año fiscal 2021 ocurrirá en\r\nnoviembre de 2021. 8. Para los servicios de diciembre de 2021 se hará uso del crédito establecido por la relación comercial para que las\r\nfacturas y liquidaciones se generen en enero de 2022.', 'La conciliación adicional deberá ocurrir a partir del 01 de agosto de 2021 y ates de la reunión en el mes de octubre para cotejar que\r\nnuestros pagos se realizaron en tiempo y forma.\r\n', 'Se verificará el porcentaje descuento que nos puedan otorgar sea entre el 2% y el 5% del cual se hará la revisión de los casos y montos\r\npara que el proveedor nos puedan brindar respuesta. El descuento deseamos sea aplicable con base en los servicios ya asignados de enero de 2021 a julio de 2021.\r\n', 'La próxima reunión se realizará en el mes de octubre. ', '(AT)(PC) (AR) (MR)', 2, '2021-08-16 13:21:48', 1);
INSERT INTO `minutas` VALUES (54, 13, 'VIDEOCONFERENCIA meet.google.com/rqt-utsr-gtu', '2021-07-21', 'irvingzuniga@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Irving Zúñiga', '1. Se versa sobre el número de operaciones, montos autorizados, liquidación de servicios y descuentos aplicables directos en facturación. 2.Se refrenda que la unidad de administración de salud Empodera realiza gestiones para la salvaguarda de la salud de los beneficiarios de OCEAS. Por ello, se requiere acceso a la información en tiempo y forma para tener acceso a los reportes del estado de salud del beneficiario y conocer los montos que se generan por su atención. 3. Se mantendrán los adecuados costos que se han brindado durante el primer semestre del 2021. Se solicita que durante el transcurso del segundo semestre se otorgue un descuento del dos al cinco por ciento\r\ndirecto sobre facturación. La solicitud se realiza toda vez que el flujo de operaciones es adecuado y que nuestro compromiso para el pronto\r\npago se ha mantenido y existe una adecuada comunicación administrativa. 4. Se invita a proveedor a realizar segunda conciliación\r\noperativa de facturas del periodo 2020 a fin de que se coteje ninguna se encuentre pendiente de pago antes del mes de octubre de 2021. 5.\r\nEl proveedor deberá enviar el número de servicio (ejemplo OCE21001010) y folio fiscal UUID (código alfanumérico de 32 posiciones) para poder rastrear facturas pendientes de pago. 6. Una vez recibida la conciliación adicional, si alguna factura estuviese pendiente de pago al término de 10 días hábiles liquidará el monto total por los servicios otorgados aplicables a la fecha; se entregará el comprobante depago; o bien, se notificará la causa de no procedencia. 7. El cierre para el envío de facturas correspondiente al año fiscal 2021 ocurrirá en noviembre de 2021. 8. Para los servicios de diciembre de 2021 se hará uso del crédito establecido por la relación comercial para que las facturas y liquidaciones se generen en enero de 2022.', 'La conciliación adicional deberá ocurrir a partir del 01 de agosto de 2021 y ates de la reunión en el mes de octubre para cotejar que\r\nnuestros pagos se realizaron en tiempo y forma.', 'Se verificará el porcentaje descuento que nos puedan otorgar sea entre el 2% y el 5% del cual se hará la revisión de los casos y montos\r\npara que el proveedor nos puedan brindar respuesta. El descuento deseamos sea aplicable con base en los servicios ya asignados de enero de 2021 a julio de 2021.\r\n', 'La próxima reunión se realizará en el mes de octubre.', '(AT)(PC) (AR) (MR)', 2, '2021-08-16 13:43:31', 1);
INSERT INTO `minutas` VALUES (55, 20, 'VIDEOCONFERENCIA meet.google.com/fac-gxtb-exm', '2021-07-22', 'irvingzuniga@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Irving Zúñiga', '1.	Se versa sobre el número de operaciones, montos autorizados, liquidación de servicios y descuentos aplicables directos en facturación.\r\n2.	La unidad H.A. Tampico refiere necesaria una sesión para retroalimentación y reforzamiento de proceso con cada unidad en la que se encuentre presente SUSANA MERINO smerino@saludangeles.mx (SubDirectora de CxC Corporativa). Se buscará establecer contacto con ella para establecer un calendario de sesiones con las 24 unidades del grupo.  \r\n3.	Se refuerza que las facturas en pdf y xml, acompañadas de la carta autorización por la cual desean tramitar el pago, debe llegar al correo proveedores@oceas.org.mx para que el pago de estas facturas se realice en forma.\r\n4.	Se notifica que OCEAS es una mutual sacerdotal y sus servicios de atención prescriben a los 2 años. La prescripción por servicios 2020 comenzará en 2022. Se invita a proveedor a realizar segunda conciliación operativa de facturas del periodo 2020 a fin de que se coteje ninguna se encuentre pendiente de pago antes del mes de octubre de 2021. \r\n5.	La notificación se realiza con seis meses de anticipación pues después de este periodo no podrán ser liquidadas las facturas no emitidas, no refacturadas por aclaración aplicable o en los casos pendientes de información.\r\n6.	El proveedor deberá enviar el número de servicio (ejemplo OCE21001010) y folio fiscal UUID (código alfanumérico de 32 posiciones) para poder rastrear facturas pendientes de pago. \r\n7.	Una vez recibida la conciliación adicional, si alguna factura estuviese pendiente de liquidación, al término de 10 días hábiles liquidará el monto total por los servicios otorgados aplicables a la fecha. O bien, se notificará la causa de no procedencia.\r\n8.	El cierre para el envío de facturas correspondiente al año fiscal 2021 ocurrirá en noviembre de 2021.\r\n9.	Para los servicios de diciembre de 2021 se hará uso del crédito establecido por la relación comercial para que las facturas y liquidaciones se generen en enero de 2022.', '', 'Los canales para notificación para servicios programados, hospitalización y facturacion-pagos de OCEAS son: programacion@oceas.org.mx, hospitalizacion@oceas.org.mx y proveedores@oceas.org.mx respectivamente.', 'Reunión en el mes de octubre con la finalidad de cotejar que los servicios del año 2020 y 2021 estén liquidados para poder emitir la Carta No Adeudo. ', '(AT) (PC) (EV) (MD)', 2, '2021-08-16 14:34:31', 1);
