scal 2021 ocurrirá en noviembre de 2021. 9. Para los servicios de diciembre de 2021 se hará uso del crédito establecido por la\r\nrelación comercial para que las facturas y liquidaciones se generen en enero de 2022.\r\n', '', 'Los canales para notificación para servicios programados, hospitalización y facturacion-pagos de OCEAS son:\r\nprogramacion@oceas.org.mx, hospitalizacion@oceas.org.mx y proveedores@oceas.org.mx respectivamente.\r\n', 'Reunión en el mes de octubre con la finalidad de cotejar que los servicios del año 2020 y 2021 estén liquidados para poder emitir la Carta\r\nNo Adeudo.', '(AT) (PC) (EV) (MD)', 2, '2021-08-16 14:49:53', 1);
