INSERT INTO `minutas` VALUES (58, 7, 'VIDEOCONFERENCIA meet.google.com/vib-veuy-zcu', '2021-07-21', 'irvingzuniga@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Irving Zúñiga', '1. Se versaría sobre el número de operaciones, montos autorizados, liquidación de servicios y descuentos aplicables directos en\r\nfacturación. 2. Se notificaría que OCEAS es una mutual sacerdotal y sus servicios de atención prescriben a los 2 años. La prescripción por\r\nservicios 2020 comenzará en 2022. Se invita a proveedor a realizar segunda conciliación operativa de facturas del periodo 2020 a fin de\r\nque se coteje ninguna se encuentre pendiente de pago antes del mes de octubre de 2021. 3. La notificación se realizaría con seis meses de\r\nanticipación pues después de este periodo no podrán ser liquidadas las facturas no emitidas, no refacturadas por aclaración aplicable o en\r\nlos casos pendientes de información. 4. El proveedor deberá enviar el número de servicio (ejemplo OCE21001010) y folio fiscal UUID\r\n(código alfanumérico de 32 posiciones) para poder rastrear facturas pendientes de pago. 5. Una vez recibida la conciliación adicional, si\r\nalguna factura estuviese pendiente de liquidación, al término de 10 días hábiles liquidaría el monto total por los servicios otorgados\r\naplicables a la fecha. O bien, se notificará la causa de no procedencia. 6. El cierre para el envío de facturas correspondiente al año fiscal\r\n2021 ocurrirá en noviembre de 2021. 7. Para los servicios de diciembre de 2021 se hará uso del crédito establecido por la relación\r\ncomercial para que las facturas y liquidaciones se generen en enero de 2022.', 'La conciliación adicional debería ocurrir a partir del 01 de agosto de 2021 y antes de la reunión en el mes de octubre para cotejar que los\r\npagos se han realizado de manera efectiva.', 'Los canales para notificación para servicios programados, hospitalización y facturacion-pagos de OCEAS son:\r\nprogramacion@oceas.org.mx, hospitalizacion@oceas.org.mx y proveedores@oceas.org.mx respectivamente. Línea de atención telefónica\r\n(Late) 55 4160 2780.', 'Se plantea una reunión en el mes de octubre para revisión de montos , servicios y facturas que estén pendientes por lo cual esperamos\r\ncontar con su presencia.', '(AT) (PC)', 2, '2021-08-17 11:17:27', 1);
INSERT INTO `minutas` VALUES (59, 95, 'VIDEOCONFERENCIA meet.google.com/zgd-diqx-sqr', '2021-07-22', 'irvingzuniga@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Irving Zúñiga ', '1. Se versaría sobre el número de operaciones, montos autorizados, liquidación de servicios y descuentos aplicables directos en\r\nfacturación. 2. Se notificaría que OCEAS es una mutual sacerdotal y sus servicios de atención prescriben a los 2 años. La prescripción por\r\nservicios 2020 comenzará en 2022. Se invita a proveedor a realizar segunda conciliación operativa de facturas del periodo 2020 a fin de\r\nque se coteje ninguna se encuentre pendiente de pago antes del mes de octubre de 2021. 3. La notificación se realizaría con seis meses de\r\nanticipación pues después de este periodo no podrán ser liquidadas las facturas no emitidas, no refacturadas por aclaración aplicable o en\r\nlos casos pendientes de información. 4. El proveedor deberá enviar el número de servicio (ejemplo OCE21001010) y folio fiscal UUID\r\n(código alfanumérico de 32 posiciones) para poder rastrear facturas pendientes de pago. 5. Una vez recibida la conciliación adicional, si\r\nalguna factura estuviese pendiente de liquidación, al término de 10 días hábiles liquidaría el monto total por los servicios otorgados\r\naplicables a la fecha. O bien, se notificará la causa de no procedencia. 6. El cierre para el envío de facturas correspondiente al año fiscal\r\n2021 ocurrirá en noviembre de 2021. 7. Para los servicios de diciembre de 2021 se hará uso del crédito establecido por la relación\r\ncomercial para que las facturas y liquidaciones se generen en enero de 2022.', 'La conciliación adicional debería ocurrir a partir del 01 de agosto de 2021 y antes de la reunión en el mes de octubre para cotejar que los\r\npagos se han realizado de manera efectiva.', 'Los canales para notificación para servicios programados, hospitalización y facturacion-pagos de OCEAS son:\r\nprogramacion@oceas.org.mx, hospitalizacion@oceas.org.mx y proveedores@oceas.org.mx respectivamente. Línea de atención telefónica\r\n(Late) 55 4160 2780. ', 'Se plantea una reunión en el mes de octubre para revisión de montos , servicios y facturas que estén pendientes por lo cual esperamos\r\ncontar con su presencia.', '(AT) (PC)', 2, '2021-08-17 11:55:10', 1);
INSERT INTO `minutas` VALUES (60, 31, 'VIDEOCONFERENCIA meet.google.com/qrr-xvow-evv', '2021-07-22', 'irvingzuniga@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Irving Zúñiga ', '1. Se versa sobre el número de operaciones, montos autorizados, liquidación de servicios y descuentos aplicables directos en facturación.\r\n2. La comunicación con la unidad ha sido aceptable. No obstante, dado que bajo la actual administración el objetivo de las gestiones es la\r\nsalvaguarda de la salud de los beneficiarios de OCEAS, pasando de unidad de pago a unidad de administración de servicios de salud, se\r\nrequiere acceso a la información médica y administrativa en los plazos establecidos (al momento del ingreso, cada 24 horas durante la\r\nestancia y previo al egreso). Esto con el fin de tener acceso a los reportes del estado de salud del beneficiario y conocer los montos que se\r\ngeneran por su atención. 3. Se notifica que OCEAS es una mutual sacerdotal y sus servicios de atención prescriben a los 2 años. La\r\nprescripción por servicios 2020 comenzará en 2022. Se invita a proveedor a realizar segunda conciliación operativa de facturas del periodo\r\n2020 a fin de que se coteje ninguna se encuentre pendiente de pago antes del mes de octubre de 2021. 4. La notificación se realiza con seis\r\nmeses de anticipación pues después de este periodo no podrán ser liquidadas las facturas no emitidas, no refacturadas por aclaración\r\naplicable o en los casos pendientes de información. 5. El proveedor deberá enviar el número de servicio (ejemplo OCE21001010) y folio\r\nfiscal UUID (código alfanumérico de 32 posiciones) para poder rastrear facturas pendientes de pago.', 'La conciliación adicional deberá ocurrir a partir del 01 de agosto de 2021 y antes de la reunión en el mes de octubre para cotejar que los\r\npagos se han realizado de manera efectiva. Una vez recibida la conciliación adicional, si alguna factura estuviese pendiente de liquidación,\r\nal término de 10 días hábiles liquidará el monto total por los servicios otorgados aplicables a la fecha. O bien, se notificará la causa de no\r\nprocedencia. Se plantea reunión en el mes de octubre con la finalidad de cotejar que los servicios estén liquidados para poder obtener la\r\nCarta No Adeudo', 'Los canales para notificación para servicios programados, hospitalización y facturacion-pagos de OCEAS son:\r\nprogramacion@oceas.org.mx, hospitalizacion@oceas.org.mx y proveedores@oceas.org.mx respectivamente. Línea de atención telefónica\r\n(Late) 55 4160 2780. ', '', '(AT) (PC) (EC) (AO) (MS)', 2, '2021-08-17 16:39:51', 1);
INSERT INTO `minutas` VALUES (61, 32, 'VIDEOCONFERENCIA meet.google.com/qrr-xvow-evv', '2021-07-22', 'irvingzuniga@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Irving Zúñiga', '1. Se versa sobre el número de operaciones, montos autorizados, liquidación de servicios y descuentos aplicables directos en facturación.\r\n2. La comunicación con la unidad ha sido aceptable. No obstante, dado que bajo la actual administración el objetivo de las gestiones es la\r\nsalvaguarda de la salud de los beneficiarios de OCEAS, pasando de unidad de pago a unidad de administración de servicios de salud, se\r\nrequiere acceso a la información médica y administrativa en los plazos establecidos (al momento del ingreso, cada 24 horas durante la\r\nestancia y previo al egreso). Esto con el fin de tener acceso a los reportes del estado de salud del beneficiario y conocer los montos que se\r\ngeneran por su atención. 3. Se notifica que OCEAS es una mutual sacerdotal y sus servicios de atención prescriben a los 2 años. La\r\nprescripción por servicios 2020 comenzará en 2022. Se invita a proveedor a realizar segunda conciliación operativa de facturas del periodo\r\n2020 a fin de que se coteje ninguna se encuentre pendiente de pago antes del mes de octubre de 2021. 4. La notificación se realiza con seis\r\nmeses de anticipación pues después de este periodo no podrán ser liquidadas las facturas no emitidas, no refacturadas por aclaración\r\naplicable o en los casos pendientes de información. 5. El proveedor deberá enviar el número de servicio (ejemplo OCE21001010) y folio\r\nfiscal UUID (código alfanumérico de 32 posiciones) para poder rastrear facturas pendientes de pago.\r\n', 'La conciliación adicional deberá ocurrir a partir del 01 de agosto de 2021 y antes de la reunión en el mes de octubre para cotejar que los\r\npagos se han realizado de manera efectiva. Una vez recibida la conciliación adicional, si alguna factura estuviese pendiente de liquidación,\r\nal término de 10 días hábiles liquidará el monto total por los servicios otorgados aplicables a la fecha. O bien, se notificará la causa de no\r\nprocedencia. Se plantea reunión en el mes de octubre con la finalidad de cotejar que los servicios estén liquidados para poder obtener la\r\nCarta No Adeudo', 'Los canales para notificación para servicios programados, hospitalización y facturacion-pagos de OCEAS son:\r\nprogramacion@oceas.org.mx, hospitalizacion@oceas.org.mx y proveedores@oceas.org.mx respectivamente. Línea de atención telefónica\r\n(Late) 55 4160 2780. ', '', '(AT) (PC) (EC) (AO) (MS)', 2, '2021-08-17 16:46:43', 1);
INSERT INTO `minutas` VALUES (62, 61, 'VIDEOCONFERENCIA meet.google.com/pzh-gfnt-zrb', '2021-07-26', 'nataliaruiz@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Natalia Ruiz ', '1. Se versa sobre el número de operaciones, montos autorizados, liquidación de servicios y descuentos aplicables directos en facturación.  2. Se notificaría que OCEAS es una mutual sacerdotal y sus servicios de atención prescriben a los 2 años. La prescripción por servicios\r\n2020 comenzará en 2022. Se invita a proveedor a realizar segunda conciliación operativa de facturas del periodo 2020 a fin de que se coteje ninguna se encuentre pendiente de pago antes del mes de octubre de 2021. 3. La notificación se realizaría con seis meses de anticipación\r\npues después de este periodo no podrán ser liquidadas las facturas no emitidas, no refacturadas por aclaración aplicable o en los casos\r\npendientes de información. 4. El proveedor deberá enviar el número de servicio (ejemplo OCE21001010) y folio fiscal UUID(código\r\nalfanumérico de 32 posiciones) para poder rastrear facturas pendientes de pago. 5. Una vez recibida la conciliación adicional, si alguna factura estuviese pendiente de liquidación, al término de 10 días hábiles liquidaría el monto total por los servicios otorgados aplicables a la fecha. O bien, se notificará la causa de no procedencia. 6. El cierre para el envío de facturas correspondiente al año fiscal2021 ocurrirá en noviembre de 2021. 7. Se comparte el tabulador que se maneja de acuerdo a las especialidades de los médicos dejando asentado Médico General $500 , Sub Especialista $700 , Especialista $900 los cuales queda en común acuerdo que serán mas IVA . ', 'La conciliación adicional debería ocurrir a partir del 01 de agosto de 2021 y antes de la reunión en el mes de octubre para cotejar que los\r\npagos se han realizado de manera efectiva.', 'Los canales para notificación para servicios programados, hospitalización y facturacion-pagos de OCEAS son:\r\nprogramacion@oceas.org.mx, hospitalizacion@oceas.org.mx y proveedores@oceas.org.mx respectivamente. Línea de atención telefónica\r\n(Late) 55 4160 2780. ', '', '(AT) (PC) (YT) (KC) (EM)', 2, '2021-08-19 11:00:47', 1);
INSERT INTO `minutas` VALUES (63, 59, 'VIDEOCONFERENCIA meet.google.com/qit-ryhf-pjo', '2021-07-27', 'irvingzuniga@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Irving Alejandro', '1. Se versaría sobre el número de operaciones, montos autorizados, liquidación de servicios y descuentos aplicables directos en\r\nfacturación. 2. Se notificaría que OCEAS es una mutual sacerdotal y sus servicios de atención prescriben a los 2 años. La prescripción por\r\nservicios 2020 comenzará en 2022. Se invita a proveedor a realizar segunda conciliación operativa de facturas del periodo 2020 a fin de\r\nque se coteje ninguna se encuentre pendiente de pago antes del mes de octubre de 2021. 3. La notificación se realizaría con seis meses de\r\nanticipación pues después de este periodo no podrán ser liquidadas las facturas no emitidas, no refacturadas por aclaración aplicable o en\r\nlos casos pendientes de información. 4. El proveedor deberá enviar el número de servicio (ejemplo OCE21001010) y folio fiscal UUID\r\n(código alfanumérico de 32 posiciones) para poder rastrear facturas pendientes de pago. 5. Una vez recibida la conciliación adicional, si\r\nalguna factura estuviese pendiente de liquidación, al término de 10 días hábiles liquidaría el monto total por los servicios otorgados\r\naplicables a la fecha. O bien, se notificará la causa de no procedencia. 6. El cierre para el envío de facturas correspondiente al año fiscal\r\n2021 ocurrirá en noviembre de 2021. 7. Para los servicios de diciembre de 2021 se hará uso del crédito establecido por la relación\r\ncomercial para que las facturas y liquidaciones se generen en enero de 2022.', 'La conciliación adicional debería ocurrir a partir del 01 de agosto de 2021 y antes de la reunión en el mes de octubre para cotejar que los\r\npagos se han realizado de manera efectiva.', 'Los canales para notificación para servicios programados, hospitalización y facturacion-pagos de OCEAS son:\r\nprogramacion@oceas.org.mx, hospitalizacion@oceas.org.mx y proveedores@oceas.org.mx respectivamente. Línea de atención telefónica\r\n(Late) 55 4160 2780.', 'Se plantea reunión en el mes de agosto con la finalidad de corroborar cuales son las facturas que están pendientes del ciclo 2020 como\r\n2021.', '(AT) (PC)', 2, '2021-08-19 13:31:44', 5);
