INSERT INTO `minutas` VALUES (71, 88, 'VIDEOCONFERENCIA meet.google.com/kkg-axtb-xki', '2021-07-30', 'irvingzuniga@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Irving Zúñiga ', '1. Se versaría sobre el número de operaciones, montos autorizados, liquidación de servicios y descuentos aplicables directos enfacturación.\r\n2. Se notificaría que OCEAS es una mutual sacerdotal y sus servicios de atención prescriben a los 2 años. La prescripción porservicios\r\n2020 comenzará en 2022. Se invita a proveedor a realizar segunda conciliación operativa de facturas del periodo 2020 a fin deque se coteje\r\nninguna se encuentre pendiente de pago antes del mes de octubre de 2021. 3. La notificación se realizaría con seis meses deanticipación\r\npues después de este periodo no podrán ser liquidadas las facturas no emitidas, no refacturadas por aclaración aplicable o enlos casos\r\npendientes de información. 4. El proveedor deberá enviar el número de servicio (ejemplo OCE21001010) y folio fiscal UUID(código\r\nalfanumérico de 32 posiciones) para poder rastrear facturas pendientes de pago. 5. Una vez recibida la conciliación adicional, sialguna\r\nfactura estuviese pendiente de liquidación, al término de 10 días hábiles liquidaría el monto total por los servicios otorgadosaplicables a la\r\nfecha. O bien, se notificará la causa de no procedencia. 6. El cierre para el envío de facturas correspondiente al año fiscal 2021 ocurrirá en\r\nnoviembre de 2021.', 'La conciliación adicional debería ocurrir a partir del 01 de agosto de 2021 y antes de la reunión en el mes de octubre para cotejar que los\r\npagos se han realizado de manera efectiva.', 'Los canales para notificación para servicios programados, hospitalización y facturacion-pagos de OCEAS son:\r\nprogramacion@oceas.org.mx, hospitalizacion@oceas.org.mx y proveedores@oceas.org.mx respectivamente. Línea de atención telefónica\r\n(Late) 55 4160 2780. ', '', '(AT) (PC)', 2, '2021-08-19 14:43:08', 1);
