INSERT INTO `minutas` VALUES (93, 85, 'VIDEOCONFERENCIA meet.google.com/mkj-yubf-snq', '2021-07-30', 'irvingzuniga@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Irving Zúñiga', '1. Se versa sobre el número de operaciones, montos autorizados, liquidación de servicios y descuentos aplicables directos en facturación.\r\n2. Se refuerzan las líneas de comunicación para la gestión de servicios de OCEAS. La unidad de administración de salud Empodera realiza las gestiones con la unidad requiriendo información en tiempo y forma para tener vista de la salud del beneficiario y conocer los montos que se generan por su atención. \r\n3. Se refuerza que las facturas en PDF y XML , acompañadas de la carta autorización por la cual desean tramitar el pago, debe llegar al correo proveedores@oceas.org.mx para que el pago de estas facturas se realice en forma. \r\n\r\n4. Se notifica que OCEAS es una mutual sacerdotal y sus servicios de atención prescriben a los 2 años. La prescripción por servicios 2020 comenzará en 2022. \r\n\r\n5. La notificación se realiza con seis meses de anticipación pues después de este periodo no podrán ser liquidadas las facturas no emitidas, no refacturadas por aclaración aplicable o en los casos pendientes de información. \r\n\r\n6. Se invita a proveedor a realizar segunda conciliación operativa de facturas del periodo 2020 a fin de que se coteje ninguna se encuentre pendiente de pago antes del mes de octubre de 2021. \r\n\r\n7. El proveedor deberá enviar el número de servicio (ejemplo OCE21001010) y folio fiscal UUID (código alfanumérico de 32 posiciones) para poder rastrear facturas pendientes de pago. 8. Una vez recibida la conciliación adicional, si alguna factura estuviese pendiente de pago al término de 10 días hábiles liquidará el monto total por los servicios otorgados aplicables a la fecha; se entregará el comprobante de pago; o bien, se notificará la causa de no procedencia. 9. El cierre para el envío de facturas correspondiente al año fiscal 2021 ocurrirá en noviembre de 2021. 10. Para los servicios de diciembre de 2021 se hará uso del crédito establecido por la relación comercial para que las facturas y liquidaciones se generen en enero de 2022.', 'Se realizará segunda reunión en el mes de octubre, una vez ocurrida la conciliación adicional solicitada. ', 'El proveedor confirma que la mayoría de los servicios han sido liquidados. El proveedor notifica que buscará mejorar tiempos de respuesta con especial atención a les solicitudes de medicamentos. Se confirma que la comunicación oficial es sólo por correo electrónico. No se reconocerán consultas brindadas sin tener un folio o carta autorización de OCEAS. Proveedor notifica que actualmente cuentan con servicios médicos las 24 horas para admisión de lunes a domingo. Proveedor notifica que NO son hospital COVID pero realizará excepciones por el convenio vigente para que se puedan referir pacientes para Triage Covid. El proveedor notificará de cambios en la administración del hospital o del grupo para poder hacer referencias correspondientes. \r\n\r\nLos canales para notificación para servicios programados, hospitalización y facturación pagos de OCEAS son:\r\nprogramacion@oceas.org.mx, hospitalizacion@oceas.org.mx y proveedores@oceas.org.mx respectivamente. Línea de atención telefónica (Late) 55 4160 2780.\r\n', '', '(AT) (PC)(SA)(AM)', 2, '2021-08-23 16:20:24', 1);
INSERT INTO `minutas` VALUES (94, 85, 'VIDEOCONFERENCIA meet.google.com/mkj-yubf-snq', '2021-07-30', 'irvingzuniga@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Irving Zúñiga', '1. Se versa sobre el número de operaciones, montos autorizados, liquidación de servicios y descuentos aplicables directos en facturación.\r\n2. Se refuerzan las líneas de comunicación para la gestión de servicios de OCEAS. La unidad de administración de salud Empodera realiza\r\nlas gestiones con la unidad requiriendo información en tiempo y forma para tener vista de la salud del beneficiario y conocer los montos\r\nque se generan por su atención. 3. Se refuerza que las facturas en PDF y XML , acompañadas de la carta autorización por la cual desean\r\ntramitar el pago, debe llegar al correo proveedores@oceas.org.mx para que el pago de estas facturas se realice en forma. 4. Se notifica que\r\nOCEAS es una mutual sacerdotal y sus servicios de atención prescriben a los 2 años. La prescripción por servicios 2020 comenzará en\r\n2022. 5. La notificación se realiza con seis meses de anticipación pues después de este periodo no podrán ser liquidadas las facturas no\r\nemitidas, no refacturadas por aclaración aplicable o en los casos pendientes de información. 6. Se invita a proveedor a realizar segunda\r\nconciliación operativa de facturas del periodo 2020 a fin de que se coteje ninguna se encuentre pendiente de pago antes del mes de octubre\r\nde 2021. 7. El proveedor deberá enviar el número de servicio (ejemplo OCE21001010) y folio fiscal UUID (código alfanumérico de 32\r\nposiciones) para poder rastrear facturas pendientes de pago. 8. Una vez recibida la conciliación adicional, si alguna factura estuviese\r\npendiente de pago al término de 10 días hábiles liquidará el monto total por los servicios otorgados aplicables a la fecha; se entregará el\r\ncomprobante de pago; o bien, se notificará la causa de no procedencia. 9. El cierre para el envío de facturas correspondiente al año fiscal\r\n2021 ocurrirá en noviembre de 2021. 10. Para los servicios de diciembre de 2021 se hará uso del crédito establecido por la relación\r\ncomercial para que las facturas y liquidaciones se generen en enero de 2022.', 'Se realizará segunda reunión en el mes de octubre, una vez ocurrida la conciliación adicional solicitada. ', 'Los canales para notificación para servicios programados, hospitalización y facturación pagos de OCEAS son:\r\nprogramacion@oceas.org.mx, hospitalizacion@oceas.org.mx y proveedores@oceas.org.mxrespectivamente\r\n', '', '(AT) (PC)(SA)(AM)', 2, '2021-08-23 16:20:24', 1);
INSERT INTO `minutas` VALUES (95, 86, 'VIDEOCONFERENCIA meet.google.com/zpq-pmtz-knp', '2021-07-30', 'irvingzuniga@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Irving Zúñiga ', '1. Se versa sobre el número de operaciones, montos autorizados, liquidación de servicios y descuentos aplicables directos en facturación.\r\n2. La comunicación con la unidad ha sido adecuada. No obstante, se fortalece el tema de que la comunicación se tiene que dar antes,\r\ndurante y después de la instancia. Antes, porque nosotros notificamos que el beneficiario va a llegar o por parte de la unidad nos notifican\r\nprevio al ingreso de los beneficiarios a hospitalización. Durante, debido que necesitamos estar en contante comunicación cada 24 horas\r\npara que realicen el envío de notas médicas y el detalle de gastos que se generen por la atención y después para el tema de conciliar los\r\nprocesos de operación y pagos. 3. El proveedor notifica no tiene identificadas facturas pendientes de pago. 4. El descuento aplicable\r\ndirectamente sobre facturación se mantiene. 5. Se refuerza que las facturas en PDF y XML, acompañadas de la carta autorización por la\r\ncual desean tramitar el pago, debe llegar al correo proveedores@oceas.org.mx para que el pago de estas facturas se realice en forma. 6. Se\r\nnotifica que OCEAS es una mutual sacerdotal y sus servicios de atención prescriben a los 2 años. La prescripción por servicios 2020\r\ncomenzará en 2022. Se invita a proveedor a realizar segunda conciliación operativa de facturas del periodo 2020 a fin de que se coteje\r\nninguna se encuentre pendiente de pago antes de octubre de 2021. 7. La notificación se realiza con seis meses de anticipación pues\r\ndespués de este periodo no podrán ser liquidadas las facturas no emitidas, no refacturadas por aclaración aplicable o en los casos\r\npendientes de información. 8. El proveedor deberá enviar el número de servicio (ejemplo OCE21001010) y folio fiscal UUID (código\r\nalfanumérico de 32 posiciones) para poder rastrear facturas pendientes de pago.', 'a) La conciliación adicional deberá ocurrir a partir del 01 de agosto de 2021 y antes de la reunión en el mes de octubre para cotejar que los\r\npagos se han realizado de manera efectiva. La notificación se realiza con seis meses de anticipación pues después de este periodo no\r\npodrán ser liquidadas las facturas no emitidas, no refacturadas por aclaración aplicable o en los casos pendientes de información. b) Una\r\nvez recibida la conciliación adicional, si alguna factura estuviese pendiente de liquidación, al término de 10 días hábiles liquidará el monto\r\ntotal por los servicios otorgados aplicables a la fecha. O bien, se notificará la causa de no procedencia c) Actualización de los datos de\r\ncontacto por parte de proveedor.', 'A. El proveedor notifica que las cuentas se encuentran liquidadas en tiempo, solo están pendientes de pago servicios recientes del mes de julio; aún en tiempo. \r\nb. Se refuerzan los canales para notificación para servicios programados, hospitalización y facturación-pagos de OCEAS son:\r\nprogramacion@oceas.org.mx, hospitalizacion@oceas.org.mx y proveedores@oceas.org.mx respectivamente. Línea de atención telefónica\r\n(Late) 55 4160 2780.', 'La próxima reunión se realizará en el mes de octubre para cotejar que nuestros pagos se realizaron en tiempo y forma para poder recibir la\r\nCarta No Adeudo.', '(AT)(PC)(VG)(MM)(CP)', 2, '2021-08-23 16:31:08', 1);
INSERT INTO `minutas` VALUES (96, 87, 'VIDEOCONFERENCIA meet.google.com/mbj-camg-jhj', '2021-07-30', 'irvingzuniga@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Irving Zúñiga', '1. Se versa sobre el número de operaciones, montos autorizados, liquidación de servicios y descuentos aplicables directos en facturación.\r\n2. La comunicación con la unidad ha sido adecuada. No obstante, se fortalece el tema de que la comunicación se tiene que dar antes,\r\ndurante y después de la instancia. Antes, porque nosotros notificamos que el beneficiario va a llegar o por parte de la unidad nos notifican\r\nprevio al ingreso de los beneficiarios a hospitalización. Durante, debido que necesitamos estar en contante comunicación cada 24 horas\r\npara que realicen el envío de notas médicas y el detalle de gastos que se generen por la atención y después para el tema de conciliar los\r\nprocesos de operación y pagos. 3. Se refuerzan las líneas de comunicación para la gestión de servicios de OCEAS. La unidad de\r\nadministración de salud Empodera realiza las gestiones con la unidad requiriendo información en tiempo y forma para tener vista de la\r\nsalud del beneficiario y conocer los montos que se generan por su atención. 4. Se refuerza que las facturas en PDF y XML, acompañadas\r\nde la carta autorización por la cual desean tramitar el pago, debe llegar al correo proveedores@oceas.org.mx para que el pago de estas\r\nfacturas se realice en forma. 5. Se mantendrán los adecuados costos que se han brindado durante el primer semestre del 2021. Se solicita\r\nque durante el transcurso del segundo semestre se otorgue un descuento del dos al cinco por ciento directo sobre facturación. La solicitud\r\nse realiza toda vez que el flujo de operaciones es adecuado y que nuestro compromiso para el pronto pago se ha mantenido y existe una\r\nadecuada comunicación administrativa. 6. Se notifica que OCEAS es una mutual sacerdotal y sus servicios de atención prescriben a los 2\r\naños. La prescripción por servicios 2020 comenzará en 2022. Se invita a proveedor a realizar segunda conciliación operativa de facturas\r\ndel periodo 2020 a fin de que se coteje ninguna se encuentre pendiente de pago antes de octubre de 2021.', 'a) La conciliación adicional deberá ocurrir a partir del 01 de agosto de 2021 y antes de la reunión en el mes de octubre para cotejar que los\r\npagos se han realizado de manera efectiva. La notificación se realiza con seis meses de anticipación pues después de este periodo no\r\npodrán ser liquidadas las facturas no emitidas, no refacturadas por aclaración aplicable o en los casos pendientes de información. b) El\r\nproveedor deberá enviar el número de servicio (ejemplo OCE21001010) y folio fiscal UUID (código alfanumérico de 32 posiciones) para\r\npoder rastrear facturas pendientes de pago. c) Una vez recibida la conciliación adicional, si alguna factura estuviese pendiente de\r\nliquidación, al término de 10 días hábiles liquidará el monto total por los servicios otorgados aplicables a la fecha. O bien, se notificará la\r\ncausa de no procedencia d) Se verificará el porcentaje descuento que nos puedan otorgar sea entre el 2% y el 5% del cual se hará la\r\nrevisión de los casos y montos para que el proveedor nos puedan brindar respuesta. El descuento deseamos sea aplicable con base en los\r\nservicios ya asignados de enero de 2021 a julio de 2021.\r\n', 'Los canales para notificación para servicios programados, hospitalización y facturación pagos de OCEAS son:\r\nprogramacion@oceas.org.mx, hospitalizacion@oceas.org.mx y proveedores@oceas.org.mx respectivamente.', 'La próxima reunión se realizará en el mes de octubre para cotejar que nuestros pagos se realizaron en tiempo y forma.', '(AT)(PC)(CM)', 2, '2021-08-23 17:29:10', 1);
INSERT INTO `minutas` VALUES (97, 89, 'VIDEOCONFERENCIA meet.google.com/jgc-ccxo-wtp', '2021-07-30', 'irvingzuniga@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Irving Zúñiga', '1. Se versa sobre el número de operaciones, montos autorizados, liquidación de servicios y descuentos aplicables directos en facturación.\r\n2. La comunicación con la unidad ha sido adecuada. No obstante, se fortalece el tema de que la comunicación se tiene que dar antes,\r\ndurante y después de la instancia. Antes, porque nosotros notificamos que el beneficiario va a llegar o por parte de la unidad nos notifican\r\nprevio al ingreso de los beneficiarios a hospitalización. Durante, debido que necesitamos estar en contante comunicación cada 24 horas\r\npara que realicen el envío de notas médicas y el detalle de gastos que se generen por la atención y después para el tema de conciliar los\r\nprocesos de operación y pagos. 3. Se notifica que OCEAS es una mutual sacerdotal y sus servicios de atención prescriben a los 2 años. La\r\nprescripción por servicios 2020 comenzará en 2022. Se invita a proveedor a realizar segunda conciliación operativa de facturas del periodo\r\n2020 a fin de que se coteje ninguna se encuentre pendiente de pago antes del mes de octubre de 2021. 4. La notificación se realiza con seis\r\nmeses de anticipación pues después de este periodo no podrán ser liquidadas las facturas no emitidas, no refacturadas por aclaración\r\naplicable o en los casos pendientes de información. 5. El proveedor deberá enviar el número de servicio (ejemplo OCE21001010) y folio\r\nfiscal UUID (código alfanumérico de 32 posiciones) para poder rastrear facturas pendientes de pago. 6. Una vez recibida la conciliación\r\nadicional, si alguna factura estuviese pendiente de liquidación, al término de 10 días hábiles liquidará el monto total por los servicios\r\notorgados aplicables a la fecha. O bien, se notificará la causa de no procedencia.\r\n', '1) La conciliación adicional deberá ocurrir a partir del 01 de agosto de 2021 y antes de la reunión en el mes de noviembre para cotejar que los\r\npagos se han realizado de manera efectiva. 2) El proveedor enviará listado de contactos actualizado. ', 'Los canales para notificación para servicios programados, hospitalización y facturacin-pagos de OCEAS son:\r\nprogramacion@oceas.org.mx, hospitalizacion@oceas.org.mx y proveedores@oceas.org.mx respectivamente. Línea de atención telefónica\r\n(Late) 55 4160 2780. ', 'Se plantea reunión en el mes de noviembre con la finalidad de cotejar que los servicios del año 2020 y 2021 estén liquidados para poder\r\nobtener la Carta No Adeudo de cada año.', '(AT)(PC)(AO)(NS)', 2, '2021-08-23 17:39:57', 1);
INSERT INTO `minutas` VALUES (98, 92, 'VIDEOCONFERENCIA meet.google.com/ekp-ynhr-ezp', '2021-07-30', 'irvingzuniga@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Irving Zúñiga', '1. Se versa sobre el número de operaciones, montos autorizados, liquidación de servicios y descuentos aplicables directos en facturación.\r\n2. El proveedor informa que  tiene identificadas facturas pendientes de pago. 3. Se notifica que OCEAS es una mutual sacerdotal y sus servicios de atención\r\nprescriben a los 2 años. La prescripción por servicios 2020 comenzará en 2022. 4.Se invita a proveedor a realizar segunda conciliación\r\noperativa de facturas del periodo 2020 a fin de que se coteje ninguna se encuentre pendiente de pago antes del mes de octubre de 2021. 5.\r\nLa notificación se realiza con seis meses de anticipación pues después de este periodo no podrán ser liquidadas las facturas no emitidas, no\r\nrefacturadas por aclaración aplicable o en los casos pendientes de información. 6. El proveedor deberá enviar el número de servicio\r\n(ejemplo OCE21001010) y folio fiscal UUID (código alfanumérico de 32 posiciones) para poder rastrear facturas pendientes de pago. 7.\r\nUna vez recibida la conciliación adicional, si alguna factura estuviese pendiente de liquidación, al término de 10 días hábiles liquidará el\r\nmonto total por los servicios otorgados aplicables a la fecha. O bien, se notificará la causa de no procedencia. 8. El cierre para el envío de\r\nfacturas correspondiente al año fiscal 2021 ocurrirá en noviembre de 2021. 9. Para los servicios de diciembre de 2021 se hará uso del\r\ncrédito establecido por la relación comercial para que las facturas y liquidaciones se generen en enero de 2022.', 'Se solicita a proveedor realizar una conciliación adicional antes de que ocurra la segunda reunión en el mes de octubre. \r\n', '\r\n\r\n\r\nA.	Los canales para notificación para servicios programados, hospitalización y facturacion-pagos de OCEAS son: programacion@oceas.org.mx, hospitalizacion@oceas.org.mx y proveedores@oceas.org.mx respectivamente. Línea de atención telefónica (Late) 55 4160 2780. \r\nB.	Se reforzará con los beneficiarios procesos para emisión de carta autorización por servicios programados y no programados con el objetivo de que los casos sean susceptibles de ser amparados por el programa. Ningún cobro de servicios se hará efectivo sin que medie una carta autorización. Cualquier gestión que no se notifique no será pagada por OCEAS.\r\nC.	La conciliación adicional deberá ocurrir a partir del 01 de agosto de 2021 y antes de la reunión en el mes de octubre. para cotejar que los pagos se han realizado de manera efectiva.\r\n', 'Se plantea reunión en el mes de octubre con la finalidad de corroborar cuales son las facturas que están pendientes del ciclo 2020 como\r\n2021 y así obtener Carta de No Adeudo. \r\n', '(AT)(PC)(AC)', 2, '2021-08-23 17:50:10', 1);
INSERT INTO `minutas` VALUES (99, 94, 'VIDEOCONFERENCIA meet.google.com/tqz-qvdj-ugg', '2021-07-30', 'irvingzuniga@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Irving Zúñiga', '1. Se versa sobre el número de operaciones, montos autorizados, liquidación de servicios y descuentos aplicables directos en facturación.\r\n2. Se notificaría que OCEAS es una mutual sacerdotal y sus servicios de atención prescriben a los 2 años. La prescripción por servicios\r\n2020 comenzará en 2022. Se invita a proveedor a realizar segunda conciliación operativa de facturas del periodo 2020 a fin de que se coteje que ninguna se encuentre pendiente de pago antes del mes de octubre de 2021. 3. La notificación se realizaría con seis meses de anticipación pues después de este periodo no podrán ser liquidadas las facturas no emitidas, no refacturadas por aclaración aplicable o en los casos pendientes de información. 4. El proveedor deberá enviar el número de servicio (ejemplo OCE21001010) y folio fiscal UUID(código\r\nalfanumérico de 32 posiciones) para poder rastrear facturas pendientes de pago. 5. Una vez recibida la conciliación adicional, si alguna factura estuviese pendiente de liquidación, al término de 10 días hábiles liquidaría el monto total por los servicios otorgados aplicables a la fecha. O bien, se notificará la causa de no procedencia. 6. El cierre para el envío de facturas correspondiente al año fiscal 2021 ocurrirá en noviembre de 2021. Se  refuerza el tema de envío de paciente de las diócesis de Xochimilco, Tláhuac y Azcapotzalco. 7. Se hará envío de guía operativa por ambas partes a fin de mejorar procesos de comunicación. ', 'a)La conciliación adicional debería ocurrir a partir del 01 de agosto de 2021 y antes de la reunión en el mes de octubre para cotejar que los\r\npagos se han realizado de manera efectiva. b) Se reforzará envío de correos de ambas partes para poder derivar los servicios correctamente.  ', 'Los canales para notificación para servicios programados, hospitalización y facturacion-pagos de OCEAS son:\r\nprogramacion@oceas.org.mx, hospitalizacion@oceas.org.mx y proveedores@oceas.org.mx respectivamente. Línea de atención telefónica\r\n(Late) 55 4160 2780. ', 'Se realizará otra reunión en el mes de octubre para cotejar que la información brindada sea de su conocimiento, así como una vez realizada la conciliación, obtener la carta de no adeudo. ', '(AT)(PC)(EB)(AG)', 2, '2021-08-23 18:11:49', 1);
INSERT INTO `minutas` VALUES (100, 93, 'VIDEOCONFERENCIA meet.google.com/rrc-fnta-gdy', '2021-07-30', 'irvingzuniga@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Irving Zúñiga', '1. Se versa sobre el número de operaciones, montos autorizados, liquidación de servicios y descuentos aplicables directos en facturación.2.\r\nSe notificaría que OCEAS es una mutual sacerdotal y sus servicios de atención prescriben a los 2 años. La prescripción por servicios2020\r\ncomenzará en 2022. Se invita a proveedor a realizar segunda conciliación operativa de facturas del periodo 2020 a fin de que se coteje ninguna se encuentre pendiente de pago antes del mes de octubre de 2021. 3. La notificación se realizaría con seis meses de anticipación\r\npues después de este periodo no podrán ser liquidadas las facturas no emitidas, no refacturadas por aclaración aplicable o en los casos\r\npendientes de información. 4. El proveedor deberá enviar el número de servicio (ejemplo OCE21001010) y folio fiscal UUID(código\r\nalfanumérico de 32 posiciones) para poder rastrear facturas pendientes de pago. 5. Una vez recibida la conciliación adicional, si alguna\r\nfactura estuviese pendiente de liquidación, al término de 10 días hábiles liquidaría el monto total por los servicios otorgados aplicables a la\r\nfecha. O bien, se notificará la causa de no procedencia. 6. El cierre para el envío de facturas correspondiente al año fiscal2021 ocurrirá en\r\nnoviembre de 2021. 8. Se refuerza protocolo de atención para pacientes COVID. ', 'a) La conciliación adicional debería ocurrir a partir del 01 de agosto de 2021 y antes de la reunión en el mes de octubre para cotejar que los\r\npagos se han realizado de manera efectiva. b)Hospital compartirá disponibilidad de camas para paciente COVID. c) Todo cambio por parte de Hospital será notificado a OCEAS.\r\n', 'Los canales para notificación para servicios programados, hospitalización y facturación-pagos de OCEAS son:\r\nprogramacion@oceas.org.mx, hospitalizacion@oceas.org.mx y proveedores@oceas.org.mx respectivamente. Línea de atención telefónica\r\n(Late) 55 4160 2780.', '', '(AT)(PC)(AM)', 2, '2021-08-23 19:41:47', 1);
INSERT INTO `minutas` VALUES (101, 33, 'VIDEOCONFERENCIA ', '2021-08-24', 'nataliaruiz@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Natalia Ruiz ', '1. Se versa sobre el número de operaciones, montos autorizados, liquidación de servicios y descuentos aplicables directos en facturación.\r\n2. Se notificaría que OCEAS es una mutual sacerdotal y sus servicios de atención prescriben a los 2 años. La prescripción por servicios\r\n2020 comenzará en 2022. Se invita a proveedor a realizar segunda conciliación operativa de facturas del periodo 2020 a fin de que se\r\ncoteje ninguna se encuentre pendiente de pago antes del mes de octubre de 2021. 3. La notificación se realizaría con seis meses de\r\nanticipación pues después de este periodo no podrán ser liquidadas las facturas no emitidas, no refacturadas por aclaración aplicable o en\r\nlos casos pendientes de información. 4. El proveedor deberá enviar el número de servicio (ejemplo OCE21001010) y folio fiscal\r\nUUID(código alfanumérico de 32 posiciones) para poder rastrear facturas pendientes de pago. 5. Una vez recibida la conciliación\r\nadicional, si alguna factura estuviese pendiente de liquidación, al término de 10 días hábiles liquidaría el monto total por los servicios\r\notorgados aplicables a la fecha. O bien, se notificará la causa de no procedencia. 6. El cierre para el envío de facturas correspondiente al año fiscal 2021 ocurrirá en noviembre de 2021. 7. Para los servicios de diciembre de 2021 se hará uso del crédito establecido por la relación comercial para que las facturas y liquidaciones se generen en enero de 2022.', 'Se notifica a proveedor reporte de incidencias en la unidad SAME CHALCO donde los beneficiarios expresamente han solicitado no sean referidos a la unidad pues han sido objeto de malos tratos. Se confirma administrativamente que la Unidad Chalco no se apega a lineamientos y procesos. Por ello, se notifica que no se enviarán más servicios a esta unidad mientras no se mejore el servicio. Durante el proceso de conciliación adicional, se liquidarán los montos comprometidos en carta autorización por los servicios ya otorgados. En octubre se realizará una gestión para conocer las acciones de mejora y valorar el retorno de gestiones con la unidad Chalco.\r\n', 'Proveedor comenta que se busca una excelente atención en todo el grupo hospitalario SAME;se reforzará este tema con la UNIDAD CHALCO. Se planeará un programa para volver a incluir la unidad Chalco. Se notifica que el Dr. Rene Antonio Sánchez Matus es el encargado general de todas las unidades SAME para temas médicos y de calidad en la atención. Se solicita matriz de escalamiento para una adecuada comunicación. \r\n\r\nSe refuerzan que los canales para notificación para servicios programados, hospitalización y facturación-pagos de OCEAS son: programacion@oceas.org.mx, hospitalizacion@oceas.org.mx y proveedores@oceas.org.mx respectivamente. Línea de atención telefónica (Late) 55 4160 2780.', 'miércoles 25/08/2021 08:50 p. m. se recibe escrito libre: Nos es grato dirigirnos a usted para informarle sobre los cambios institucionales que se han realizado en los últimos meses para la mejora continua de nuestro servicio y capital humano tales como: La implementación del área específica de atención al cliente, cursos impartidos por RH para la mejora en la calidad de la atención enfocados inicialmente en el área de recepción y enfermería, con especial énfasis en el área de trato digno y los derechos de los pacientes, reuniones semanales con los jefes de área, así como la modificación en la plantilla de aquellos colaboradores que no compartían la visión y los valores institucionales. De tal forma que en virtud de continuar ofreciendo un excelente servicio se seguirán realizando mejoras en favor de nuestros usuarios. Todo el personal de SAME Chalco tenemos el compromiso de brindar a nuestros clientes y pacientes atención de calidad y calidez', '(AT) (PC) (SF) (RS) (M)', 2, '2021-08-25 16:43:13', 1);
