INSERT INTO `minutas` VALUES (104, 34, 'VIDEOCONFERENCIA ', '2021-08-24', 'nataliaruiz@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Natalia Ruiz ', '\r\n1.	Se versa sobre el número de operaciones, montos autorizados, liquidación de servicios y descuentos aplicables directos en facturación.\r\n2.	Se comenta el caso del beneficiario MARIANO MALDONADO SIMON, quien refiere que no recibió atención adecuada por parte de la unidad MAC PERIFÉRICO. El beneficiario acudió a valoración por cuadro respiratorio compatible con Covid. El beneficiario narra que no fue atendido y no se le practicaron los estudios de imagen que requería por lo que el beneficiario se retiró y ya no quiso acudir nuevamente. En el estado de cuenta se realiza un cobro de oxígeno suplementario pero el beneficiario niega haberlo recibido. \r\n3.	Proveedor identifica caso y enviará los comentarios al mismo vía correo electrónico para revisión. \r\n4.	La comunicación con las unidades MAC ha sido aceptable en términos generales. Pero en las unidades periférico e Irapuato el tiempo de espera en línea es prolongado o se cortan las llamadas. \r\n5.	Se refuerza que bajo la actual administración el objetivo de las gestiones es la salvaguarda de la salud de los beneficiarios de OCEAS, pasando de unidad de pago a unidad de administración de servicios de salud, se requiere acceso a la información médica y administrativa en los plazos establecidos (al momento del ingreso, cada 24 horas durante la estancia y previo al egreso). Esto con el fin de tener acceso a los reportes del estado de salud del beneficiario y conocer los montos que se generan por su atención.\r\n6.	Se notifica que OCEAS es una mutual sacerdotal y sus servicios de atención prescriben a los 2 años. La prescripción por servicios 2020 comenzará en 2022. Se invita a proveedor a realizar segunda conciliación operativa de facturas del periodo 2020 a fin de que se coteje ninguna se encuentre pendiente de pago antes del mes de octubre de 2021. ', 'I.	Con relación a la prescripción de servicios, la notificación se realizaría con seis meses de anticipación, después de este periodo no podrán ser liquidadas las facturas no emitidas, no refacturadas por aclaración aplicable o en los casos pendientes de información.\r\nII.	El proveedor deberá enviar el número de servicio (ejemplo OCE21001010) y folio fiscal UUID (código alfanumérico de 32 posiciones) para poder rastrear facturas pendientes de pago. 5. Una vez recibida la conciliación adicional, si alguna factura estuviese pendiente de liquidación, al término de 10 días hábiles liquidaría el monto total por los servicios otorgados aplicables a la fecha. O bien, se notificará la causa de no procedencia. \r\nIII.	El cierre para el envío de facturas correspondiente al año fiscal 2021 ocurrirá en noviembre de 2021. \r\nIV.	Los canales para notificación para servicios programados, hospitalización y facturación-pagos de OCEAS son: programacion@oceas.org.mx, hospitalizacion@oceas.org.mx y proveedores@oceas.org.mx respectivamente. Línea de atención telefónica (Late) 55 4160 2780.  \r\nV.	Reunión en el mes de octubre para cotejar que los pagos se han realizado de manera efectiva.\r\n', 'Los canales para notificación para servicios programados, hospitalización y facturación-pagos de OCEAS son:\r\nprogramacion@oceas.org.mx, hospitalizacion@oceas.org.mx y proveedores@oceas.org.mx respectivamente. Línea de atención telefónica (Late) 55 4160 2780.  ', 'Para los servicios de diciembre de 2021 se hará uso del crédito establecido por la relación comercial para que las facturas y liquidaciones se generen en enero de 2022. \r\n\r\nSe comparte Guía Operativa de Servicios con el fin de reforzar los procesos de acuerdo con los servicios otorgados a los beneficiarios. \r\nSe solicita actualización de datos de contacto y mejora de los tiempos de respuesta a llamadas telefónicas en las unidades.\r\n\r\n', '(AT) (PC) (PA)', 2, '2021-08-25 17:29:16', 1);
INSERT INTO `minutas` VALUES (105, 95, 'VIDEOCONFERENCIA ', '2021-08-24', 'nataliaruiz@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Natalia Ruiz ', '1. Se versa sobre el número de operaciones, montos autorizados, liquidación de servicios y descuentos aplicables directos en facturación.\r\n2. Se comenta el caso del beneficiario MARIANO MALDONADO SIMON, quien refiere que no recibió atención adecuada por parte de la\r\nunidad MAC PERIFÉRICO. El beneficiario acudió a valoración por cuadro respiratorio compatible con Covid. El beneficiario narra que\r\nno fue atendido y no se le practicaron los estudios de imagen que requería por lo que el beneficiario se retiró y ya no quiso acudir\r\nnuevamente. En el estado de cuenta se realiza un cobro de oxígeno suplementario pero el beneficiario niega haberlo recibido. 3. Proveedor\r\nidentifica caso y enviará los comentarios al mismo vía correo electrónico para revisión. 4. La comunicación con las unidades MAC ha sido\r\naceptable en términos generales. Pero en las unidades periférico e Irapuato el tiempo de espera en línea es prolongado o se cortan las\r\nllamadas. 5. Se refuerza que bajo la actual administración el objetivo de las gestiones es la salvaguarda de la salud de los beneficiarios de\r\nOCEAS, pasando de unidad de pago a unidad de administración de servicios de salud, se requiere acceso a la información médica y\r\nadministrativa en los plazos establecidos (al momento del ingreso, cada 24 horas durante la estancia y previo al egreso). Esto con el fin de\r\ntener acceso a los reportes del estado de salud del beneficiario y conocer los montos que se generan por su atención. 6. Se notifica que\r\nOCEAS es una mutual sacerdotal y sus servicios de atención prescriben a los 2 años. La prescripción por servicios 2020 comenzará en\r\n2022. Se invita a proveedor a realizar segunda conciliación operativa de facturas del periodo 2020 a fin de que se coteje ninguna se\r\nencuentre pendiente de pago antes del mes de octubre de 2021.', 'I. Con relación a la prescripción de servicios, la notificación se realizaría con seis meses de anticipación, después de este periodo no\r\npodrán ser liquidadas las facturas no emitidas, no refacturadas por aclaración aplicable o en los casos pendientes de información. II. El\r\nproveedor deberá enviar el número de servicio (ejemplo OCE21001010) y folio fiscal UUID (código alfanumérico de 32 posiciones) para\r\npoder rastrear facturas pendientes de pago. 5. Una vez recibida la conciliación adicional, si alguna factura estuviese pendiente de\r\nliquidación, al término de 10 días hábiles liquidaría el monto total por los servicios otorgados aplicables a la fecha. O bien, se notificará la\r\ncausa de no procedencia. III. El cierre para el envío de facturas correspondiente al año fiscal 2021 ocurrirá en noviembre de 2021. IV. Los\r\ncanales para notificación para servicios programados, hospitalización y facturación-pagos de OCEAS son: programacion@oceas.org.mx,\r\nhospitalizacion@oceas.org.mx y proveedores@oceas.org.mx respectivamente. Línea de atención telefónica (Late) 55 4160 2780. V.\r\nReunión en el mes de octubre para cotejar que los pagos se han realizado de manera efectiva.', 'Los canales para notificación para servicios programados, hospitalización y facturación-pagos de OCEAS son:\r\nprogramacion@oceas.org.mx, hospitalizacion@oceas.org.mx y proveedores@oceas.org.mx respectivamente. Línea de atención telefónica\r\n(Late) 55 4160 2780.', 'Para los servicios de diciembre de 2021 se hará uso del crédito establecido por la relación comercial para que las facturas y liquidaciones\r\nse generen en enero de 2022. Se comparte Guía Operativa de Servicios con el fin de reforzar los procesos de acuerdo con los servicios\r\notorgados a los beneficiarios. Se solicita actualización de datos de contacto y mejora de los tiempos de respuesta a llamadas telefónicas en\r\nlas unidades.', '(AT) (PC) (PA)', 2, '2021-08-25 17:41:50', 1);
INSERT INTO `minutas` VALUES (106, 97, 'VIDEOCONFERENCIA', '2021-08-18', 'irvingzuniga@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Irving Zúñiga ', 'Se establecen procesos para solicitud, entrega, facturación y pagos de medicamentos. \r\n1. SOLICITUD: \r\na.	Se brinda clave PSOPCZ0055 de acceso a OCEAS, la cual es PSOPCZ0055 CLAVE\r\nb.	Las sucursales del proveedor ya cuentan con el manual en la intranet.\r\nc.	Se solicitará vía correo electrónico cotización de medicamentos.\r\nd.	Proveedor regresa cotización de medicamentos en formato PDF indicando costo unitario, cantidad de cajas, presentación de medicamento y costo total de cotización.\r\ne.	En caso de existir faltantes o proponer modificaciones en las cotizaciones, hacerlo saber a medicamentos@oceas.org.mx\r\nf.	Recibida la cotización y existencias, OCEAS confirma orden de compra vía correo electrónico. Se adjunta carta preliminar por costo de medicamentos y detalla cantidad de piezas a entregar.\r\ng.	Proveedor asignará sucursal de acuerdo con cercanía de domicilio o parroquia principal para que le beneficiario acuda por sus medicamentos.\r\n2. ENTREGA DE MEDICAMENTOS\r\na.	Sucursal de proveedor identifica a cliente plenamente (Identificación oficial o del programa)\r\nb.	Sucursal llena los campos necesarios en sistema para hacer la entrega de los medicamentos solicitados y descritos en carta preliminar.\r\nc.	Solo se surtirá medicamento indicado en la cotización y carta preliminar.  No se surtirán medicamentos sin existir una carta preliminar.\r\nd.	La carta preliminar deberá estar vigente, sin estatus de \"pagada\", \"entregada\", \"anulada\", etc.\r\ne.	Una vez surtido el medicamento, la sucursal deberá recabar la firma de beneficiario en el ticket, el cuál deberá contener fecha de entrega y nombre de beneficiario.\r\nf.	Una vez entregado el medicamento se deberá escanear ticket de entrega y ser enviado al correo de acuses@oceas.org.mx \r\n3. PROCESO DE FACTURACIÓN Y PAGO\r\na.	OCEAS revisa documentos escaneados, en 72 horas devuelve una carta garantía de pago a proveedor.\r\nb.	Proveedor devuelve un correo con la carta garantía de pago final, factura en formatos .PDF y .XML al correo proveedores@oceas.org.mx para tramite de pago', 'A.	Proveedor hará envío de directorio de sucursales a fin de conocer los servicios disponibles, disponibilidad, etc. \r\nB.	Proveedor compartirá con OCEAS manual operativo para puntos de venta. \r\nC.	Hará llegar el nombre de los ejecutivos que estarán al pendiente de las cotizaciones, así como sus datos de contacto. \r\nD.	Se hará llegar a proveedor el manual operativo de OCEAS.', '1.	NO SE CUENTA CON EQUIPO PARA REALIZAR EL ESCANEO DE TICKET AL MOMENTO, POR LO QUE PODRÁ TARDAR UN MÁXIMO DE 10 DÍAS HÁBILES EL ENVÍO DEL MISMO.\r\n2.	5. SE REALIZARÁ LA COTIZACIÓN DE LAS ZONAS CORRESPONDIENTES A SINALOA, SONORA, BAJA CALIFORNIA Y BAJA CALIFORNIA SUR.\r\n3.	CADA TICKET ENVIADO, DEBE IR ACOMPAÑADO DE UN FOLIO DE SERVICIO DISTINTO.\r\n4.	OCEAS realiza el pago del servicio en un período aproximado de 10 días hábiles una vez recibida la factura y carta autorización final.\r\n5.	Se inicia operación el lunes 23/08/2021, realizando 4 cotizaciones diarias. b) Los canales para notificación para servicios programados, hospitalización y facturación-pagos de OCEAS son: programacion@oceas.org.mx, hospitalizacion@oceas.org.mx y proveedores@oceas.org.mx respectivamente. Línea de atención telefónica (Late) 55 4160 2780.', 'A.	Al corte del 30 de agosto de 2021 se han gestionado ocho cotizaciones, 2 asignaciones, con un monto autorizado de servicio de $12,916.72.\r\nB.	Se llevará a cabo una segunda reunión en el mes de septiembre.\r\nC.	Los servicios programados para el mes de octubre cubrirán 4 meses. \r\nD.	Se llevará a cabo una segunda reunión en el mes de diciembre.\r\nE.	Se brinda número de línea LATE 55 41 60 27 80 para que en caso de discrepancia entre beneficiario-proveedor puedan brindar una solución.', '(AT)(PC)(CZ)(SA)', 2, '2021-08-25 18:30:17', 1);
INSERT INTO `minutas` VALUES (107, 98, 'VIDEOCONFERENCIA ', '2021-08-24', 'nataliaruiz@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Natalia Ruiz ', '1. Se versa sobre el número de operaciones, montos autorizados, liquidación de servicios y descuentos aplicables directos en facturación.\r\n2. Se notificaría que OCEAS es una mutual sacerdotal y sus servicios de atención prescriben a los 2 años. La prescripción por servicios\r\n2020 comenzará en 2022. Se invita a proveedor a realizar segunda conciliación operativa de facturas del periodo 2020 a fin de que se\r\ncoteje ninguna se encuentre pendiente de pago antes del mes de octubre de 2021. 3. La notificación se realizaría con seis meses de\r\nanticipación pues después de este periodo no podrán ser liquidadas las facturas no emitidas, no refacturadas por aclaración aplicable o en\r\nlos casos pendientes de información. 4. El proveedor deberá enviar el número de servicio (ejemplo OCE21001010) y folio fiscal\r\nUUID(código alfanumérico de 32 posiciones) para poder rastrear facturas pendientes de pago. 5. Una vez recibida la conciliación\r\nadicional, si alguna factura estuviese pendiente de liquidación, al término de 10 días hábiles liquidaría el monto total por los servicios\r\notorgados aplicables a la fecha. O bien, se notificará la causa de no procedencia. 6. El cierre para el envío de facturas correspondiente al\r\naño fiscal 2021 ocurrirá en noviembre de 2021. 7. Para los servicios de diciembre de 2021 se hará uso del crédito establecido por la\r\nrelación comercial para que las facturas y liquidaciones se generen en enero de 2022.\r\n', 'Se notifica a proveedor reporte de incidencias en la unidad SAME CHALCO donde los beneficiarios expresamente han solicitado no sean\r\nreferidos a la unidad pues han sido objeto de malos tratos. Se confirma administrativamente que la Unidad Chalco no se apega a\r\nlineamientos y procesos. Por ello, se notifica que no se enviarán más servicios a esta unidad mientras no se mejore el servicio. Durante el\r\nproceso de conciliación adicional, se liquidarán los montos comprometidos en carta autorización por los servicios ya otorgados. En\r\noctubre se realizará una gestión para conocer las acciones de mejora y valorar el retorno de gestiones con la unidad Chalco. ', 'Proveedor comenta que se busca una excelente atención en todo el grupo hospitalario SAME; se reforzará este tema con la UNIDAD\r\nCHALCO. Se planeará un programa para volver a incluir la unidad Chalco. Se notifica que el Dr. Rene Antonio Sánchez Matus es el\r\nencargado general de todas las unidades SAME para temas médicos y de calidad en la atención. Se solicita matriz de escalamiento para\r\nuna adecuada comunicación. Se refuerzan que los canales para notificación para servicios programados, hospitalización y facturación pagos de OCEAS son: programacion@oceas.org.mx, hospitalizacion@oceas.org.mx y proveedores@oceas.org.mx respectivamente. Línea\r\nde atención telefónica (Late) 55 4160 2780.\r\n', 'miércoles 25/08/2021 08:50 p. m. se recibe escrito libre: Nos es grato dirigirnos a usted para informarle sobre los cambios institucionales\r\nque se han realizado en los últimos meses para la mejora continua de nuestro servicio y capital humano tales como: La implementación del\r\nárea específica de atención al cliente, cursos impartidos por RH para la mejora en la calidad de la atención enfocados inicialmente en el\r\nárea de recepción y enfermería, con especial énfasis en el área de trato digno y los derechos de los pacientes, reuniones semanales con los\r\njefes de área, así como la modificación en la plantilla de aquellos colaboradores que no compartían la visión y los valores institucionales.\r\nDe tal forma que en virtud de continuar ofreciendo un excelente servicio se seguirán realizando mejoras en favor de nuestros usuarios.\r\nTodo el personal de SAME Chalco tenemos el compromiso de brindar a nuestros clientes y pacientes atención de calidad y calidez.', '(AT) (PC) (SF) (RS) (M)', 2, '2021-08-26 17:15:49', 1);
INSERT INTO `minutas` VALUES (108, 17, 'VIDEOCONFERENCIA ', '2021-08-24', 'nataliaruiz@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Natalia Ruiz ', '1.	Se versa sobre el número de operaciones, montos autorizados, liquidación de servicios y descuentos aplicables directos en facturación.\r\n2.	Se refuerza que OCEAS es una mutual sacerdotal y sus servicios de atención prescriben a los 2 años. La prescripción por servicios 2020 comenzará en 2022. Se invita a proveedor a realizar segunda conciliación operativa de facturas del periodo 2020 a fin de que se coteje ninguna se encuentre pendiente de pago antes del mes de octubre de 2021. \r\n3.	El proveedor notifica que sólo se encuentran dos facturas pendientes de pago. Una de ella ya en trámite. \r\n4.	El cierre para el envío de facturas correspondiente al año fiscal 2021 ocurrirá en noviembre de 2021. \r\n5.	Para los servicios de diciembre de 2021 se hará uso del crédito establecido por la relación comercial para que las facturas y liquidaciones se generen en enero de 2022.\r\n', 'Reunión en el mes de octubre para cotejar que los pagos se han realizado de manera efectiva.\r\n', 'Los canales para notificación para servicios programados, hospitalización y facturación-pagos de OCEAS son:\r\nprogramacion@oceas.org.mx, hospitalizacion@oceas.org.mx y proveedores@oceas.org.mx respectivamente. Línea de atención telefónica (Late) 55 4160 2780.\r\n', '', '(AT) (PC) (MM) (LJ)', 2, '2021-08-27 16:43:52', 1);
INSERT INTO `minutas` VALUES (109, 50, 'VIDEOCONFERENCIA ', '2021-08-24', 'nataliaruiz@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Natalia Ruiz ', '1. Se versaría sobre el número de operaciones, montos autorizados, liquidación de servicios y descuentos aplicables directos en facturación.\r\n2. Se notificaría que OCEAS es una mutual sacerdotal y sus servicios de atención prescriben a los 2 años. La prescripción por servicios\r\n2020 comenzará en 2022. Se invita a proveedor a realizar segunda conciliación operativa de facturas del periodo 2020 a fin de que se coteje ninguna se encuentre pendiente de pago antes del mes de octubre de 2021. 3. La notificación se realizaría con seis meses de anticipación pues después de este periodo no podrán ser liquidadas las facturas no emitidas, no refacturadas por aclaración aplicable o en los casos pendientes de información. 4. El proveedor deberá enviar el número de servicio (ejemplo OCE21001010) y folio fiscal UUID(código\r\nalfanumérico de 32 posiciones) para poder rastrear facturas pendientes de pago. 5. Una vez recibida la conciliación adicional, si alguna factura estuviese pendiente de liquidación, al término de 10 días hábiles liquidaría el monto total por los servicios otorgados aplicables a la fecha. O bien, se notificará la causa de no procedencia. 6. El cierre para el envío de facturas correspondiente al año fiscal2021 ocurrirá en noviembre de 2021.', 'Reunión en el mes de octubre para cotejar que los pagos se han realizado de manera efectiva. ', 'Los canales para notificación para servicios programados, hospitalización y facturación-pagos de OCEAS son:\r\nprogramacion@oceas.org.mx, hospitalizacion@oceas.org.mx y proveedores@oceas.org.mx respectivamente. Línea de atención telefónica (Late) 55 4160 2780.', '', '(AT) (PC) ', 2, '2021-08-27 17:30:31', 1);
INSERT INTO `minutas` VALUES (110, 58, 'VIDEOCONFERENCIA ', '2021-08-24', 'nataliaruiz@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Natalia Ruiz ', '1. Se versa sobre el número de operaciones, montos autorizados y liquidación de servicios. \r\n2.Se notificaría que OCEAS es una mutual sacerdotal y sus servicios de atención prescriben a los 2 años. La prescripción por servicios 2020\r\ncomenzará en 2022. Se invita a proveedor a realizar segunda conciliación operativa de facturas del periodo 2020 a fin de que se coteje ninguna se encuentre pendiente de pago antes del mes de octubre de 2021. 3. La notificación se realizaría con seis meses de anticipación pues después de este periodo no podrán ser liquidadas las facturas no emitidas, no refacturadas por aclaración aplicable o en los casos pendientes de información. 4. El proveedor deberá enviar el número de servicio (ejemplo OCE21001010) y folio fiscal UUID(código\r\nalfanumérico de 32 posiciones) para poder rastrear facturas pendientes de pago. 5. Una vez recibida la conciliación adicional, si alguna factura estuviese pendiente de liquidación, al término de 10 días hábiles liquidaría el monto total por los servicios otorgados aplicables a la fecha. O bien, se notificará la causa de no procedencia. 6. El cierre para el envío de facturas correspondiente al año fiscal 2021 ocurrirá en noviembre de 2021. 7. Para los servicios de diciembre de 2021 se hará uso del crédito establecido por la relación comercial para que las facturas y liquidaciones se generen en enero de 2022.8. Se pide actualización del directorio de contactos por parte de la unidad.9.Para reforzamiento de los procesos de servicios auxiliares se comparte Guía Operativa. 10. Se buscará contar con la Carta No adeudo 2020 y 2021 en el mes de octubre. ', 'Reunión en el mes de octubre para cotejar que los pagos se han realizado de manera efectiva.  \r\n', 'Los canales para notificación para servicios programados, hospitalización y facturación-pagos de OCEAS son:\r\nprogramacion@oceas.org.mx, hospitalizacion@oceas.org.mx y proveedores@oceas.org.mx respectivamente. Línea de atención telefónica\r\n(Late) 55 4160 2780. ', 'Se enviarán guías operativas para reforzar procesos de atención. \r\nSe pide enviar matriz de escalamiento por parte de proveedor. \r\n', '(AT) (PC) (SA) (CC)', 2, '2021-08-31 16:55:57', 1);
INSERT INTO `minutas` VALUES (111, 60, 'VIDEOCONFERENCIA ', '2021-08-24', 'nataliaruiz@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Natalia Ruiz ', '1.	Se versa sobre el número de operaciones, montos autorizados y liquidación de servicios.\r\n2.	La comunicación con la unidad ha sido aceptable. No obstante, se refuerza que bajo la actual administración el objetivo de las gestiones es la salvaguarda de la salud de los beneficiarios de OCEAS, pasando de unidad de pago a unidad de administración de servicios de salud, se requiere acceso a la información médica y administrativa en los plazos establecidos (al momento del ingreso, cada 24 horas durante la estancia y previo al egreso). Esto con el fin de tener acceso a los reportes del estado de salud del beneficiario y conocer los montos que se generan por su atención.\r\n3.	Se notificaría que OCEAS es una mutual sacerdotal y sus servicios de atención prescriben a los 2 años. La prescripción por servicios 2020 comenzará en 2022. Se invita a proveedor a realizar segunda conciliación operativa de facturas del periodo 2020 a fin de que se coteje ninguna se encuentre pendiente de pago antes del mes de octubre de 2021. \r\n4.	La notificación se realizaría con seis meses de anticipación pues después de este periodo no podrán ser liquidadas las facturas no emitidas, no refacturadas por aclaración aplicable o en los casos pendientes de información. \r\n5.	El proveedor deberá enviar el número de servicio (ejemplo OCE21001010) y folio fiscal UUID (código alfanumérico de 32 posiciones) para poder rastrear facturas pendientes de pago. \r\n6.	Una vez recibida la conciliación adicional, si alguna factura estuviese pendiente de liquidación, al término de 10 días hábiles liquidaría el monto total por los servicios otorgados aplicables a la fecha. O bien, se notificará la causa de no procedencia. \r\n7.	El cierre para el envío de facturas correspondiente al año fiscal 2021 ocurrirá en noviembre de 2021. \r\n8.	Para los servicios de diciembre de 2021 se hará uso del crédito establecido por la relación comercial para que las facturas y liquidaciones se generen en enero de 2022.', 'Reunión en el mes de octubre para cotejar que los pagos se han realizado de manera efectiva.', 'a.	Se pide actualización del directorio de contactos por parte de la unidad. \r\nb.	Para reforzamiento de los procesos de servicios auxiliares se comparte Guía Operativa. \r\nc.	Contrato en Revisión.\r\nd.	Se solicita actualización de matriz de escalamiento (si aplica). \r\ne.	Se enviarán guías operativas para reforzar procesos. \r\nf.	Los canales para notificación para servicios programados, hospitalización y facturación-pagos de OCEAS son: programacion@oceas.org.mx, hospitalizacion@oceas.org.mx y proveedores@oceas.org.mx respectivamente. Línea de atención telefónica (Late) 55 4160 2780.', '', '(AT) (PC) (ER) (AG) (LC)', 2, '2021-08-31 17:24:30', 1);
INSERT INTO `minutas` VALUES (112, 62, 'VIDEOCONFERENCIA ', '2021-08-24', 'nataliaruiz@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Natalia Ruiz ', '1.	Se versa sobre el número de operaciones, montos autorizados y liquidación de servicios.\r\n2.	La comunicación con la unidad ha sido aceptable. No obstante, se refuerza que bajo la actual administración el objetivo de las gestiones es la salvaguarda de la salud de los beneficiarios de OCEAS, pasando de unidad de pago a unidad de administración de servicios de salud, se requiere acceso a la información médica y administrativa en los plazos establecidos (al momento del ingreso, cada 24 horas durante la estancia y previo al egreso). Esto con el fin de tener acceso a los reportes del estado de salud del beneficiario y conocer los montos que se generan por su atención.\r\nSe notificaría que OCEAS es una mutual sacerdotal y sus servicios de atención prescriben a los 2 años. La prescripción por servicios 2020 comenzará en 2022. Se invita a proveedor a realizar segunda conciliación operativa de facturas del periodo 2020 a fin de que se coteje ninguna se encuentre pendiente de pago antes del mes de octubre de 2021.  El proveedor deberá enviar el número de servicio (ejemplo OCE21001010) y folio fiscal UUID (código alfanumérico de 32 posiciones) para poder rastrear facturas pendientes de pago. \r\n3.	La notificación se realizaría con seis meses de anticipación pues después de este periodo no podrán ser liquidadas las facturas no emitidas, no refacturadas por aclaración aplicable o en los casos pendientes de información. \r\n4.	El proveedor refiere que la mayoría de las facturas han sido liquidadas. \r\n5.	Una vez recibida la conciliación adicional, si alguna factura estuviese pendiente de liquidación, al término de 10 días hábiles liquidaría el monto total por los servicios otorgados aplicables a la fecha. O bien, se notificará la causa de no procedencia. \r\n6.	El cierre para el envío de facturas correspondiente al año fiscal 2021 ocurrirá en noviembre de 2021. \r\n', 'Reunión en el mes de octubre para cotejar que los pagos se han realizado de manera efectiva. ', 'a.	Los canales para notificación para servicios programados, hospitalización y facturación-pagos de OCEAS son: programacion@oceas.org.mx, hospitalizacion@oceas.org.mx y proveedores@oceas.org.mx respectivamente. Línea de atención telefónica (Late) 55 4160 2780.\r\nb.	Se pide actualización del directorio de contactos por parte de la unidad. \r\nc.	Para reforzamiento de los procesos de servicios auxiliares se comparte Guía Operativa. \r\nd.	Para los servicios de diciembre de 2021 se hará uso del crédito establecido por la relación comercial para que las facturas y liquidaciones se generen en enero de 2022.\r\ne.	Se solicita actualización de matriz de escalamiento (si aplica). \r\nf.	Se busca obtener carta no adeudo para el periodo año 2020 y periodo enero-octubre 2021.\r\n', '', '(AT) (PC) (FH)', 2, '2021-08-31 17:35:05', 1);
INSERT INTO `minutas` VALUES (113, 64, 'VIDEOCONFERENCIA meet.google.com/gtp-mddb-jbv', '2021-08-24', 'nataliaruiz@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Natalia Ruiz ', '1.	Se versa sobre el número de operaciones, montos autorizados, liquidación de servicios y descuentos aplicables directos en facturación.\r\n2.	Se notifica la incorporación de la Diócesis de Chilpancingo al Programa de Salud Sacerdotal OCEAS. Por ello nuestro interés de mantener una relación comercial y flujo de información robusto para la atención de los beneficiarios.\r\n3.	La comunicación con la unidad ha sido limitada. Se notifica a proveedor que bajo la actual administración el objetivo de las gestiones es la salvaguarda de la salud de los beneficiarios de OCEAS, pasando de unidad de pago a unidad de administración de servicios de salud, se requiere acceso a la información médica y administrativa en los plazos establecidos (al momento del ingreso, cada 24 horas durante la estancia y previo al egreso). Esto con el fin de tener acceso a los reportes del estado de salud del beneficiario y conocer los montos que se generan por su atención.\r\n4.	Proveedor notifica que los médicos especialistas no son de Staff. No obstante, solicita conocer el tabulador que se maneja de acuerdo con las especialidades de los médicos, dejando asentado Médico General $500, Especialista $700, Subespecialista $900 los cuales queda en común acuerdo que serán más IVA a fin de que el proveedor pueda facturar estas atenciones como parte de los servicios de salud prestados a la mutual. \r\n5.	Se reenviarán a la unidad las guías operativas de proveedores para otorgamiento de servicios de acuerdo con los procesos de gestión de pago directo. \r\n6.	Se elaborará un contrato OCEAS-HOSPITAL PRIVADO ANAHUAC con la finalidad de poder formalizar el otorgamiento de los servicios de estudios de laboratorios, gabinete, consultas externas, etc. \r\n7.	Se entrega minuta como manifiesto de voluntad de las partes para el otorgamiento de servicios de salud a la comunidad de beneficiarios del Programa de Salud Sacerdotal. \r\n', 'Reunión en el mes de septiembre y octubre para cotejar el avance del contrato y que los pagos se han realizado de manera efectiva.', '1.	Hospital no cuenta con médicos especialista de staff.   \r\n2.	Proveedor enviará un directorio médico a OCEAS para conocer especialidades con las que se puede contar y servicios (imagenología, cirugía, etc.). \r\n3.	Se reforzarán canales de comunicación con hospital. \r\n4.	Minuta funcionará para establecer acuerdos sobre:\r\n5.	Servicios, guías operativas, canales de comunicación, tabuladores para consulta externa, intenciones de mantener relaciones con OCEAS, estudios de laboratorios, gabinete, etc. \r\n6.	Se piden regresar minuta con nombre de las personas responsables, matriz de escalamiento para establecer acuerdos. \r\n7.	Reunión para finales de septiembre. Avance en tabulador y contrato correspondiente. \r\n8.	Esta minuta se reconoce como “Acuerdo de intención para prestación de servicios”. \r\n9.	Los canales para notificación para servicios programados, hospitalización y facturación-pagos de OCEAS son: programacion@oceas.org.mx, hospitalizacion@oceas.org.mx y proveedores@oceas.org.mx respectivamente. Línea de atención telefónica (Late) 55 4160 2780.\r\n', '', '(AT) (PC) (AG)', 2, '2021-08-31 17:49:55', 1);
