INSERT INTO `minutas` VALUES (121, 74, 'VIDEOCONFERENCIA  meet.google.com/zsj-czgs-ptv', '2021-08-25', 'irvingzuniga@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Irving Zúñiga', '1. Se versaría sobre el número de operaciones, montos autorizados, liquidación de servicios y descuentos aplicables directos en\r\nfacturación. 2. Se notificaría que OCEAS es una mutual sacerdotal y sus servicios de atención prescriben a los 2 años. La prescripción por\r\nservicios 2020 comenzará en 2022. Se invita a proveedor a realizar segunda conciliación operativa de facturas del periodo 2020 a fin de\r\nque se coteje ninguna se encuentre pendiente de pago antes del mes de octubre de 2021. 3. La notificación se realizaría con seis meses de\r\nanticipación pues después de este periodo no podrán ser liquidadas las facturas no emitidas, no refacturadas por aclaración aplicable o en\r\nlos casos pendientes de información. 4. El proveedor deberá enviar el número de servicio (ejemplo OCE21001010) y folio fiscal\r\nUUID(código alfanumérico de 32 posiciones) para poder rastrear facturas pendientes de pago. 5. Una vez recibida la conciliación\r\nadicional, si alguna factura estuviese pendiente de liquidación, al término de 10 días hábiles liquidaría el monto total por los servicios\r\notorgados aplicables a la fecha. O bien, se notificará la causa de no procedencia. 6. El cierre para el envío de facturas correspondiente al\r\naño fiscal2021 ocurrirá en noviembre de 2021. ', 'La conciliación adicional debería ocurrir a partir del 01 de agosto de 2021 y antes de la reunión en el mes de octubre para cotejar que los\r\npagos se han realizado de manera efectiva.\r\n', 'Los canales para notificación para servicios programados, hospitalización y facturación pagos de OCEAS son:\r\nprogramacion@oceas.org.mx, hospitalizacion@oceas.org.mx y proveedores@oceas.org.mx respectivamente.', 'La próxima reunión se realizará en el mes de octubre para cotejar que nuestros pagos se realizaron en tiempo y forma.\r\n', '(AT)(PC)', 2, '2021-09-01 12:02:44', 1);
