INSERT INTO `minutas` VALUES (126, 65, 'VIDEOCONFERENCIA ', '2021-08-24', 'nataliaruiz@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Natalia Ruiz ', '1. Se versa sobre el número de operaciones, montos autorizados y liquidación de servicios. 2. Se notifica que OCEAS es una mutual\r\nsacerdotal y sus servicios de atención prescriben a los 2 años. La prescripción por servicios 2020 comenzará en 2022. Se invita a\r\nproveedor a realizar segunda conciliación operativa de facturas del periodo 2020 a fin de que se coteje ninguna se encuentre pendiente de\r\npago antes del mes de octubre de 2021. 3. La notificación se realizaría con seis meses de anticipación pues después de este periodo no\r\npodrán ser liquidadas las facturas no emitidas, no refacturadas por aclaración aplicable o en los casos pendientes de información. 4. El\r\nproveedor deberá enviar el número de servicio (ejemplo OCE21001010) y folio fiscal UUID(código alfanumérico de 32 posiciones) para\r\npoder rastrear facturas pendientes de pago. 5. Una vez recibida la conciliación adicional, si alguna factura estuviese pendiente de\r\nliquidación, al término de 10 días hábiles liquidaría el monto total por los servicios otorgados aplicables a la fecha. O bien, se notificará la\r\ncausa de no procedencia. 6. El cierre para el envío de facturas correspondiente al año fiscal 2021 ocurrirá en noviembre de 2021. 7. Para\r\nlos servicios de diciembre de 2021 se hará uso del crédito establecido por la relación comercial para que las facturas y liquidaciones se\r\ngeneren en enero de 2022.8. Se pide actualización del directorio de contactos por parte de la unidad.9.Para reforzamiento de los procesos\r\nde servicios auxiliares se comparte Guía Operativa. 10. Se buscará contar con la Carta No adeudo 2020 y 2021 en el mes de octubre', 'Reunión en el mes de octubre para cotejar que los pagos se han realizado de manera efectiva.', 'Los canales para notificación para servicios programados, hospitalización y facturación-pagos de OCEAS son:\r\nprogramacion@oceas.org.mx, hospitalizacion@oceas.org.mx y proveedores@oceas.org.mx respectivamente. Línea de atención telefónica\r\n(Late) 55 4160 2780.', '', '(AT) (PC) (JV)', 2, '2021-09-02 16:54:19', 1);
INSERT INTO `minutas` VALUES (127, 38, 'VIDEOCONFERENCIA ', '2021-08-24', 'nataliaruiz@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Natalia Ruiz ', '1.)	Se versa sobre operaciones, montos autorizados, liquidación de servicios y aplicación de descuentos por casos catastróficos. \r\n2.)	Se refuerza la necesidad de mantener una adecuada comunicación con proveedor.\r\n3.)	Con relación a la liquidación de copagos con cheques, se refiere que se puedes descontar del total de la cuenta y facturar a OBRA DE CLÉRIGOS EN AYUDA SOLIDARIA A.R. sólo lo que OCEAS efectivamente liquidará. Las \r\n4.)	Se notifica que los servicios 2020 ya se encuentran bloqueados para generación o actualización cartas. Por tanto, ya no se pueden modificar.\r\n5.)	Con relación a la cancelación de facturas, se recibirán las solicitudes de cancelación el miércoles 25/08/2021 o lunes 30/08/2021. Se enviará petición a  redesmedicas1 para validación. \r\n6.)	Proveedor expone un caso de la gestión 2019 de OCEAS. La administración actual inició en enero de 2020. Por tanto, la factura 2019 se mandará directamente a OCEAS pero no se podrá brindar seguimiento pues cae en el supuesto de prescripción.\r\n7.)	Se confirman servicios pendientes de pago no aplicable al programa empresa saludable. Se requieren los datos bancarios del Dr. Del Río para el pago de los servicios. \r\n8.)	En octubre 2021 se buscará la carta de no adeudo al año 2020 y corte enero-octubre 2021. \r\n9.)	En noviembre se revisará monto actualizado de empresa saludable. \r\n10.)	En diciembre se usará crédito con hospital y se facturarán en el mes de enero. ', 'Reunión en el mes de octubre para cotejar que los pagos se han realizado de manera efectiva.', 'Los canales para notificación para servicios programados, hospitalización y facturación-pagos de OCEAS son:\r\nprogramacion@oceas.org.mx, hospitalizacion@oceas.org.mx y proveedores@oceas.org.mx respectivamente. Línea de atención telefónica\r\n(Late) 55 4160 2780. ', '', '(AT) (PC) (SE) (SC) (NC)', 2, '2021-09-02 17:27:30', 1);
INSERT INTO `minutas` VALUES (128, 70, 'VIDEOCONFERENCIA ', '2021-08-25', 'nataliaruiz@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Natalia Ruiz ', '1. Se versa sobre el número de operaciones, montos autorizados y liquidación de servicios. 2.Se notificaría que OCEAS es una mutual\r\nsacerdotal y sus servicios de atención prescriben a los 2 años. La prescripción por servicios 2020 comenzará en 2022. Se invita a\r\nproveedor a realizar segunda conciliación operativa de facturas del periodo 2020 a fin de que se coteje ninguna se encuentre pendiente de\r\npago antes del mes de octubre de 2021. 3. La notificación se realizaría con seis meses de anticipación pues después de este periodo no\r\npodrán ser liquidadas las facturas no emitidas, no refacturadas por aclaración aplicable o en los casos pendientes de información. 4. El\r\nproveedor deberá enviar el número de servicio (ejemplo OCE21001010) y folio fiscal UUID(código alfanumérico de 32 posiciones) para poder rastrear facturas pendientes de pago. 5. Una vez recibida la conciliación adicional, si alguna factura estuviese pendiente de\r\nliquidación, al término de 10 días hábiles liquidaría el monto total por los servicios otorgados aplicables a la fecha. O bien, se notificará la\r\ncausa de no procedencia. 6. El cierre para el envío de facturas correspondiente al año fiscal 2021 ocurrirá en noviembre de 2021. 7. Para los servicios de diciembre de 2021 se hará uso del crédito establecido por la relación comercial para que las facturas y liquidaciones se generen en enero de 2022.8. Se pide actualización del directorio de contactos por parte de la unidad.9.Para reforzamiento de los procesos de servicios auxiliares se comparte Guía Operativa. 10. Se buscará contar con la Carta No adeudo 2020 y 2021 en el mes de octubre. ', 'Reunión en el mes de octubre para cotejar que los pagos se han realizado de manera efectiva.', 'Los canales para notificación para servicios programados, hospitalización y facturación-pagos de OCEAS son:\r\nprogramacion@oceas.org.mx, hospitalizacion@oceas.org.mx y proveedores@oceas.org.mx respectivamente. Línea de atención telefónica (Late) 55 4160 2780. ', '', '(AT) (PC) (JM) (CC)', 2, '2021-09-03 15:15:11', 1);
