INSERT INTO `minutas` VALUES (131, 84, 'VIDEOCONFERENCIA ', '2021-08-25', 'nataliaruiz@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Natalia Ruiz ', '1. Se versa sobre el número de operaciones, montos autorizados y liquidación de servicios. 2.Se notificaría que OCEAS es una mutual\r\nsacerdotal y sus servicios de atención prescriben a los 2 años. La prescripción por servicios 2020 comenzará en 2022. Se invita a\r\nproveedor a realizar segunda conciliación operativa de facturas del periodo 2020 a fin de que se coteje ninguna se encuentre pendiente de\r\npago antes del mes de octubre de 2021. 3. La notificación se realizaría con seis meses de anticipación pues después de este periodo no\r\npodrán ser liquidadas las facturas no emitidas, no refacturadas por aclaración aplicable o en los casos pendientes de información. 4. El\r\nproveedor deberá enviar el número de servicio (ejemplo OCE21001010) y folio fiscal UUID(código alfanumérico de 32 posiciones) para poder rastrear facturas pendientes de pago. 5. Una vez recibida la conciliación adicional, si alguna factura estuviese pendiente de liquidación, al término de 10 días hábiles liquidaría el monto total por los servicios otorgados aplicables a la fecha. O bien, se notificará la causa de no procedencia. 6. El cierre para el envío de facturas correspondiente al año fiscal 2021 ocurrirá en noviembre de 2021. 7. Para los servicios de diciembre de 2021 se hará uso del crédito establecido por la relación comercial para que las facturas y liquidaciones se generen en enero de 2022.8. Se pide actualización del directorio de contactos por parte de la unidad.9.Para reforzamiento de los procesos de servicios auxiliares se comparte Guía Operativa. 10. Se buscará contar con la Carta No adeudo 2020 y 2021 en el mes de octubre. ', 'Reunión en el mes de octubre para cotejar que los pagos se han realizado de manera efectiva. ', 'Los canales para notificación para servicios programados, hospitalización y facturación-pagos de OCEAS son:\r\nprogramacion@oceas.org.mx, hospitalizacion@oceas.org.mx y proveedores@oceas.org.mx respectivamente. Línea de atención telefónica (Late) 55 4160 2780.', '', '(AT) (PC) (DL)', 2, '2021-09-03 16:01:54', 1);
INSERT INTO `minutas` VALUES (132, 81, 'VIDEOCONFERENCIA ', '2021-08-25', 'nataliaruiz@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Natalia Ruiz ', '1. Se versa sobre el número de operaciones, montos autorizados y liquidación de servicios. 2.Se notificaría que OCEAS es una mutual\r\nsacerdotal y sus servicios de atención prescriben a los 2 años. La prescripción por servicios 2020 comenzará en 2022. Se invita a\r\nproveedor a realizar segunda conciliación operativa de facturas del periodo 2020 a fin de que se coteje ninguna se encuentre pendiente de\r\npago antes del mes de octubre de 2021. 3. La notificación se realizaría con seis meses de anticipación pues después de este periodo no\r\npodrán ser liquidadas las facturas no emitidas, no refacturadas por aclaración aplicable o en los casos pendientes de información. 4. El\r\nproveedor deberá enviar el número de servicio (ejemplo OCE21001010) y folio fiscal UUID(código alfanumérico de 32 posiciones) para poder rastrear facturas pendientes de pago. 5. Una vez recibida la conciliación adicional, si alguna factura estuviese pendiente de liquidación, al término de 10 días hábiles liquidaría el monto total por los servicios otorgados aplicables a la fecha. O bien, se notificará la causa de no procedencia. 6. El cierre para el envío de facturas correspondiente al año fiscal 2021 ocurrirá en noviembre de 2021. 7. Para los servicios de diciembre de 2021 se hará uso del crédito establecido por la relación comercial para que las facturas y liquidaciones se generen en enero de 2022.8.Para reforzamiento de los procesos de servicios auxiliares se comparte Guía Operativa. 9. Se buscará contar con la Carta No adeudo 2020 y 2021 en el mes de octubre. 10.Se está en disposición de seguir colaborando con  Muñoa siempre y cuando se establezca una buena comunicación en tiempo y forma , el tiempo de respuesta es de 0 a 2 horas. Para reforzamiento de los procesos de servicios auxiliares se comparte Guía Operativa.', 'Reunión en el mes de octubre para cotejar que los pagos se han realizado de manera efectiva.', 'Los canales para notificación para servicios programados, hospitalización y facturación-pagos de OCEAS son:\r\nprogramacion@oceas.org.mx, hospitalizacion@oceas.org.mx y proveedores@oceas.org.mx respectivamente. Línea de atención telefónica (Late) 55 4160 2780. ', '', '(AT) (PC) (SA) (LC) (RZ)', 2, '2021-09-03 16:12:53', 1);
INSERT INTO `minutas` VALUES (133, 91, 'VIDEOCONFERENCIA ', '2021-08-25', 'nataliaruiz@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Natalia Ruiz ', '1. Se versa sobre el número de operaciones, montos autorizados, liquidación de servicios y descuentos aplicables directos en facturación.\r\n2. El proveedor informa que no tiene identificadas facturas pendientes de pago. 3.Con base en el número de operaciones, volumen por servicio y pagos ya realizados, se presenta al proveedor una solicitud de descuento directo sobre facturación. Este descuento se busca sobre entre el  2% y 5% (dos y cinco por ciento) . El proveedor se compromete a revisarlo e informar de la decisión. 4. Se notifica que OCEAS es una mutual sacerdotal y sus servicios de atención prescriben a los 2 años. La prescripción por servicios 2020 comenzará en 2022. Se invita a proveedor a realizar segunda conciliación operativa de facturas del periodo 2020 a fin de que se coteje ninguna se encuentre pendiente de pago antes del mes de octubre de 2021. 5. La notificación se realiza con seis meses de anticipación pues después de este periodo no podrán ser liquidadas las facturas no emitidas, no refacturadas por aclaración aplicable o en los casos pendientes de información. 6. El proveedor deberá enviar el número de servicio (ejemplo OCE21001010) y folio fiscal UUID (código alfanumérico de 32 posiciones) para poder rastrear facturas pendientes de pago. 7. Una vez recibida la conciliación adicional, si alguna factura estuviese pendiente de liquidación, al término de 10 días hábiles liquidará el monto total por los servicios otorgados aplicables a la fecha. O bien, se notificará la causa de no procedencia. 8. El cierre para el envío de facturas correspondiente al año fiscal 2021 ocurrirá en noviembre de 2021. 9. Para los servicios de diciembre de 2021 se hará uso del crédito establecido por la relación comercial para que las facturas y liquidaciones se generen en enero de 2022.10. Se buscará contar con la Carta No adeudo 2020 y 2021 en el mes de octubre. ', 'Reunión en el mes de octubre para cotejar que los pagos se han realizado de manera efectiva. ', 'Los canales para notificación para servicios programados, hospitalización y facturación-pagos de OCEAS son:\r\nprogramacion@oceas.org.mx, hospitalizacion@oceas.org.mx y proveedores@oceas.org.mx respectivamente. Línea de atención telefónica\r\n(Late) 55 4160 2780.', '', '(AT) (PC) (YP)', 2, '2021-09-03 16:23:09', 1);
INSERT INTO `minutas` VALUES (134, 5, 'REFORMA 180 Y VIDEOCONFERENCIA meet.google.com/vbb-fbii-cdr', '2021-09-13', 'irvingzuniga@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Irving Zúñiga', '1 Actualmente no está habilitada la logística solicitada por Empodera. 2 Proveedor comenta que la logística actual es para la conexión con área médica.  3 Sistema actual realiza 4 ciclos, siendo el último dirigido hasta OCEAS. 4 Proveedor comenta que su trabajo termina una vez que la llamada entra al conmutador ya que es lo que puede controlar. 5 Proveedor comenta que existen dos proveedores de telefonía (1 Micromedical, 2 Empodera,Telcel). 6 Proveedor comenta existen diversas razones por las cuales no entra la llamada como debe ser (equipos, red de telefonía, temporalidad). 7 El día sábado 11/09/2021 entro una llamada con Rosario en la madrugada, se comunicó con el médico de guardia directamente para conocer si estaba disponible y la respuesta fue afirmativa; posteriormente llama a línea LATE y no se logra la comunicación con médico por este medio. 8 Sistema de soportar el servicio. 9 Actualmente existen solo dos bloques (Medico Dictaminador y Gestor de Redes).\r\n', 'La logística será:\r\nExistirán 6 bloques: 2 para médico dictaminador, 2 para gestores de redes, 1 para coordinadores y 1 más para dirección.\r\nAl llamar debe:\r\na) Entrar llamada a línea LATE\r\nb) Debe entrar a todos los números del primer bloque solicitado por beneficiarios.\r\nc) En caso de no contestar el primer bloque y/o un bloque anterior la llamada pasará por cada uno de los bloques (6 en total). \r\nd) De no contestar ningún bloque la llamada llegará hasta OCEAS.\r\ne) Cuando se contesté una llamada, ya no deberá de entrar otra llamada a esa persona mientras este al teléfono.\r\nd) Deberán estar habilitadas las 16 líneas disponibles.\r\ne) Empodera revisará y configurará todos los equipos telefónicos para que sean compatibles y funcionales con conmutador.\r\nf) Proveedor aplicará los cambios solicitados en reunión.\r\ng) Proveedor resolverá los problemas mostrados con cascadeo en la segunda prueba.\r\n', 'Se realizan las siguiente pruebas.\r\n\r\nBLOQUE 1 MEDICO DICTAMINADOR\r\n\r\n1. Todos los teléfonos apagados para corroborar que no exista buzón activo.\r\n2. Se llama directamente a cada teléfono para corroborar que entre llamada.\r\n3. Se verifica que sistema funciona bien en bloque 1. \r\n4. Cascadeo llega hasta OCEAS\r\n5. Empodera revisará 1 de sus equipos del bloque 1.\r\n\r\nBLOQUE 2 GESTOR DE REDES\r\n\r\n1. Todos los teléfonos apagados para corroborar que no exista buzón activo.\r\n2. Se llama directamente a cada teléfono para corroborar que entre llamada.\r\n3. Se prueba conmutador 1 vez y todos los equipos suenan.\r\n4. Se prueba conmutador 1 vez más y no suenan 3 equipos de Empodera.\r\n5. Cascadeo llega hasta OCEAS pero presenta algunos problemas.\r\n6. Empodera revisará 3 de sus equipos del bloque 2.\r\n7. Entran llamadas a números que pertenecen a otros bloques.\r\n\r\nPREUBA SATURANDO EL SISTEMA.\r\n\r\n1. No es funcional para más de 5 llamadas a la vez.\r\n2. Se mantiene problema de cascadeo seleccionando la opción 3.\r\n3. Conmutador corta llamada de algunos usuarios por estructura actual.\r\n4. No permite la entrada de llamadas después de 5 entrantes.', 'Se define el problema actual en 4 comentarios.\r\n\r\n1 TEMPORALIDAD POR SISMO. El cambio se solicitó desde el mes de febrero, y se pidió nuevamente el 28 de agosto (antes de la fecha del sismo) que se aplicaran los cambios solicitados para el 1 de septiembre.\r\n\r\n2. Se realizarán las pruebas una vez que se apliquen los cambios solicitados y cubriendo las necesidades que se hacen notar.\r\n\r\n3. La distribución por calendario no es factible y es riesgosa. No se asignará nunca a una sola línea.\r\n\r\n4. Proveedor están en la primer línea para solución del problema, Empodera se hace cargo de la segunda línea.\r\n', '(AT)(LG)(FE)(R)(S)(F)', 2, '2021-09-14 10:47:10', 1);
INSERT INTO `minutas` VALUES (135, 6, 'Videoconferencia meet.google.com/sfn-xufx-pbr', '2021-10-05', 'nmendoza@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Norma Mendoza', '1. Se versa sobre el número de operaciones, montos autorizados, liquidación de servicios y descuentos aplicables directos a facturación. \r\n2. Se informa facturas en tránsito, de ellas las 10 facturas pendientes de pago del mes de agosto, del bloque en el que se aplicó el 2% de descuento, serán liquidadas en las próximas 72 horas a 10 días hábiles. \r\n\r\n3. Las facturas pendientes de pago del mes de septiembre serán liquidadas al final del mes de octubre. \r\n\r\n4. Dado el volumen de facturas se solicita apoyo para que las gestiones octubre - noviembre - diciembre sean liquidadas en enero 2022 para efectuar el cierre de año y cierre fiscal. \r\n\r\n5. Respecto a las gestiones de octubre - noviembre - diciembre serán facturadas en los meses corrientes y liquidadas en los primeros 10 días de enero 2022. \r\n\r\n6. La Lic. Jenny Judith Quintanilla Zavala comenta revisaran con dirección general la solicitud de ampliar el plazo de pago octubre - noviembre - diciembre. \r\n\r\n7. Se informa de la prescripción de compromiso de pagos por servicios 2020 comenzará en 2022. Informa el proveedor que no se encontraron adecuados pendiente de liquidar de enero a diciembre de 2020 y de enero a junio de 2021. ', '- Respuesta a la solicitud de ampliar el credito de los servicios - Octubre - Noviembre - Diciembre para ser liquidados en los 10 primeros días de Enero 2022', 'Con relación a la gestión de mejores beneficios para OCEAS, se aplicaron las notas de crédito a las siguientes facturas y montos:\r\n221932	$11,482.13	 N3651\r\n221936	$1,777.60	N3652\r\n221938	$6,079.13	N3653\r\n221939	$112,600.00	N3654	$131,938.86	\r\n', 'Se recibe notificación de Adriana Perez Villarreal <adriana.perez@probemedic.mx>  vía correo electrónico miércoles 06/10/2021 09:20 a. m.: se realizó mediante Dirección General la propuesta de crédito para el cierre de año y quedó autorizada esto contando con el pago dentro de los primeros 5 días de enero de 2022.', 'AT, PC, NM, JQ, AP, FH, EC.', 2, '2021-10-06 20:18:14', 1);
INSERT INTO `minutas` VALUES (136, 5, 'Videoconferencia - meet.google.com/sok-wktm-zuo', '2021-01-05', 'nmendoza@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Norma Mendoza', '1. Se versa sobre el número de operaciones, montos autorizados y liquidación de servicios.\r\n2.Se informa que las facturas pendientes de pago del mes de agosto serán liquidadas en las próximas 72 horas a 10 días hábiles.\r\n 3. Referente a las facturas pendientes de pago del mes de septiembre serán liquidadas al final del mes de octubre. \r\n4. Dado el volumen de facturas se solicita ampliar el plazo de pago para las gestiones octubre - noviembre - diciembre y estas sean liquidadas en enero 2021 para efectuar el cierre de año y cierre fiscal. \r\n5. Respecto a las gestiones de octubre - noviembre - diciembre serán facturadas en los meses corrientes y liquidadas en los primeros 10 días de enero 2022. \r\n6. Proveedor acepta ampliar el crédito antes mencionado y sea liquidado dentro de los primeros 10 días de enero 2022.\r\n6. Se informa de la prescripción de compromiso de pagos por servicios 2020 comenzará en 2022 por lo cual el 17 de noviembre será el último día para recibir facturas pendientes del 2020.\r\n7. Se solicita emitir cartas no adeudo enero - diciembre del 2020 y enero - junio para 2021.\r\n', 'Cartas no adeudo: periodo enero-diciembre 2020 y enero-junio 2021.', '', 'Proveedor presenta solicitud de aclaración respecto de las fechas de pago y crédito requeridos. Solicita nueva conversación. En llamada telefónica se versa nuevamente sobre los plazos, proveedor expone inquietudes respecto de los casos de septiembre y octubre para pago a proveedores. En atención a las inquietudes del proveedor, se mantiene proceso sin cambios. Se aplicará la liquidación según corresponde a los plazos previos a la reunión del 05 de octubre de 2021.', 'AT, PC, NM, GR, DG, AO.', 2, '2021-10-06 20:47:32', 1);
INSERT INTO `minutas` VALUES (137, 3, 'Videoconferencia - meet.google.com/psw-xxwn-phq', '2021-10-05', 'nmendoza@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Norma Mendoza', '1. Se versa sobre el número de operaciones, montos autorizados, liquidación de servicios. Se comentan los servicios liquidados en el año y los plazos para la liquidación de los servicios vigentes.\r\n2. En correo electrónico el proveedor notificó “empresa Farmacéuticos Echeverria no cobra el envío si tu pedido es de 10,000 pesos en adelante.”.  Por esta razón se suspendieron cotizaciones pues no es viable cargar a OCEAS los envíos por paquetería de manera adicional al costo de los medicamentos. El costo promedio de facturación es inferior a $10,000.00 y no aplica un mínimo de compra pues se entrega los medicamentos de acuerdo con prescripción del médico tratante.  \r\n3. El proveedor acepta lo referido por lo cual se llega al acuerdo con el proveedor que: por las características del proceso de atención y el objetivo de contención de costos de operaciones no cobrarán el envío por paquetería para ninguna gestión de forma adicional al costo de medicamentos por pieza aun cuando la conformación final sea inferior a la cotización inicial. \r\n4. Así mismo se solicita tener trasparencia y comunicación para las futuras gestiones con el fin de mejorar el servicio otorgado a nuestros beneficiarios. \r\n5. Se retomarán los servicios el lunes 11 de octubre. \r\n\r\n6. Se informa que las facturas pendientes de pago del mes de agosto serán liquidadas en las próximas 72 horas \r\n7. Las facturas pendientes de pago del mes de septiembre serán liquidadas al final del mes de octubre. \r\n8. Dado el volumen de servicios se solicita apoyo para que las gestiones octubre, noviembre y diciembre sean facturadas en los meses corrientes y liquidadas en los primeros 10 días de enero 2022 para efectuar el cierre de año y cierre fiscal. \r\n\r\n ', 'Se solicita la asistencia de la Lic. Jessica Vázquez en próximas juntas, esto con el fin de estar todos en la misma línea de comunicación, así mismo nos comparte el proveedor aceptar puntos de mejora.', 'Proveedor acepta ampliar el crédito antes mencionado y sea liquidado en enero 2022.', '', 'AT, PC, NM, JE.', 2, '2021-10-06 21:19:28', 1);
INSERT INTO `minutas` VALUES (138, 4, 'Videoconferencia - meet.google.com/xby-owsd-oxu', '2021-10-05', 'nmendoza@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Norma Mendoza', '1. Se versa sobre el número de operaciones, montos autorizados y liquidación de servicios. \r\n2. Se corrobora no se cuenta con facturas con retraso de pago. Las facturas pendientes en tránsito son las emitidas en el mes de septiembre para liquidación en octubre como corresponde. \r\n3. Dado el volumen de servicios, se solicita apoyo para ampliar la línea de crédito y las gestiones octubre - noviembre - diciembre sean facturadas en los meses corrientes y liquidadas en los primeros 10 días de enero 2022 para efectuar el cierre de año y cierre fiscal. \r\n4. Proveedor acepta ampliar el crédito antes mencionado y estas sean liquidadas en enero 2022. \r\n5. Proveedor nos informan que el Lic. Néstor Gabriel ya no trabaja con Farmacias especializadas por lo cual ellos nos estarán actualizando el nombre del ejecutivo de cuenta que dará seguimiento a las cotizaciones y con quien tendremos comunicación. \r\n6. Así mismo comentan que actualizaran los datos de las sucursales ya que se agregaron más a la lista y esto dará nuevas oportunidades de servicios. \r\n\r\n7. Se solicita, con base en el volumen de servicios y monto de facturación, descuento directo sobre factura del 1 al 2% adicional, aplicable al valor total de la carta autorización. \r\n\r\n8. Proveedor nos dará una respuesta sobre este descuento para realizar la renovación del contrato. \r\n\r\n9. Se informa de la prescripción de compromiso de pagos por servicios 2020 comenzará en 2022 por lo cual el 17 de noviembre será el último día para recibir facturas pendientes del 2020. \r\n10. Se solicita emitir cartas no adeudo enero - diciembre del 2020 y enero - junio para 2021\r\n', '- Lista actualizada de sucursales, por parte del proveedor.\r\n- Respuesta sobre el descuento directo del 1 al 2% sobre las facturas adicional al total.\r\n- Renovación del contrato.\r\n- Actualización sobre la nueva persona que dará seguimiento a los servicios.\r\n', '', '', 'AT, PC, NM, MH, FG.', 2, '2021-10-06 22:59:53', 1);
INSERT INTO `minutas` VALUES (139, 57, 'VIDEOCONFERENCIA ', '2021-10-05', 'nataliaruiz@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Natalia Ruiz ', '1.	Se versa sobre el número de operaciones, montos autorizados y liquidación de servicios. \r\n2.	Se encuentran 18 facturas en tránsito, las cuales se emitieron el 16 de septiembre por tal motivo se liquidarán en el mes de octubre 2021. \r\n3.	El cierre para emitir facturas será el día primero de diciembre. Sin embargo, diez días antes para las personas morales se cerrará el periodo de emisión y recepción de facturas, esto ocurrirá el día diecisiete de noviembre. Después de este periodo se pide emitir las facturas en el mes de enero 2022. \r\n4.	Los montos que no son reconocidos antes del cierre fiscal quedarán sin efecto de pago si no se cuenta Carta Autorización. Para la emisión de cartas autorización OCEAS, se requiere: a) Notificación b) Evidencia de la atención c) Facturas emitidas en tiempo y forma, como lo establece el proceso de atención para hacer la liquidación de servicios. \r\n6.	Para los servicios de diciembre de 2021 se hará uso del crédito establecido por la relación comercial para que las facturas y liquidaciones se generen en enero de 2022.\r\n7.- De acuerdo con el uso de crédito se requiere pasar de un plazo de treinta a sesenta días en donde se establece ampliar el crédito únicamente por el mes de octubre, noviembre y diciembre de 2021. \r\n8.- Las facturas del mes de noviembre y diciembre serán liquidadas dentro de los diez días hábiles del mes de enero 2022. Los servicios de 2020 quedaran sin efecto de pago en enero de 2022. \r\n9.- El proveedor deberá compartir dos Cartas No Adeudo las cuales vendrán de la siguiente forma:\r\nLa primera, del 1ro de enero al 31 de diciembre de 2020 (Año Completo). \r\nLa segunda, del 1ro de enero al 30 de junio de 2021 (Semestre).\r\n10.- La carta No Adeudo del segundo semestre 2021, se emitirá en enero de 2022, una vez que hayan sido liquidadas las facturas en enero del 2022.', 'El proveedor deberá hacer el envío de las Cartas No Adeudo dentro de los cinco días hábiles de haber recibido la minuta. Se establece que debe de ser con el Formato de la propia unidad en atención al cliente OCEAS.', 'Los canales para notificación para servicios programados, hospitalización y facturación pagos de OCEAS son: programacion@oceas.org.mx, hospitalizacion@oceas.org.mx y proveedores@oceas.org.mx respectivamente.', '', '(AT) (PC) (BJ)', 2, '2021-10-07 09:12:19', 1);
INSERT INTO `minutas` VALUES (140, 49, 'VIDEOCONFERENCIA ', '2021-10-05', 'nataliaruiz@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Natalia Ruiz ', '1. Se versa sobre el número de operaciones, montos autorizados y liquidación de servicios. 2. De acuerdo con los volúmenes de atención del año 2021, ya se ha liquidado el 80% de las facturas. Al corte quedan pendientes siete facturas emitidas en septiembre de 2021; se liquidarán la mitad de ellas en el mes de octubre y el resto en el mes de diciembre de 2021. 3. El cierre para emitir facturas será el día 1ro de diciembre. Sin embargo, el proveedor detendrá la facturación para reiniciar en enero de 2022. El pago para las facturas emitidas en enero será en 10 días hábiles. 4. Se requiere mantener la línea de comunicación fluida para la correcta emisión de carta autorización en las cual se establecen los montos susceptibles de ser cubierto por el programa y constituyen un compromiso de pago. Los montos que no son reconocidos antes del cierre fiscal, quedan sin efecto de pago. Para la emisión de carta autorización se requiere: 1.- Notificación 2.- Evidencia de la atención 3.- Facturas emitidas en tiempo y forma Paraque se pueda hacer la liquidación de servicios. 5. Para los servicios de octubre a diciembre de 2021 se hará uso del crédito establecido por la relación comercial para que las facturas y liquidaciones se generen en enero de 2022. 6.- El proveedor deberá compartir 2 Cartas No Adeudo las cuales vendrán de la siguiente forma: La primera consta del 1ro de enero al 31 de diciembre de 2020 (Año Completo) La segunda consta del 1ro de enero al 30 de junio de 2021 (Semestre) 9.- La carta No Adeudo del segundo semestre 2021, se emitirá en enero de 2022, una vez que hayan sido liquidadas las facturas en enero del 2022.', 'El proveedor deberá hacer el envío de las Cartas No Adeudo dentro de los 5 días hábiles de haber recibido la minuta, se establece que debe de ser con el Formato de la propia unidad, haciendo mención a OCEAS con la relación social.', 'Los canales para notificación para servicios programados, hospitalización y facturación pagos de OCEAS son: programacion@oceas.org.mx, hospitalizacion@oceas.org.mx y proveedores@oceas.org.mx respectivamente.', '', '(AT) (PC) (JC)', 2, '2021-10-07 09:29:46', 1);
INSERT INTO `minutas` VALUES (141, 62, 'VIDEOCONFERENCIA ', '2021-10-05', 'nataliaruiz@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Natalia Ruiz ', '1.	Se versaría sobre el número de operaciones, montos autorizados y liquidación de servicios. \r\n2.    El cierre para emitir facturas será el día 1ro de diciembre, sin embargo 10 días antes para las personas morales se cerrará el periodo de emisión y recepción de facturas, esto ocurrirá el día 17 de noviembre. Después de este periodo se pide emitir las facturas en el mes de enero 2022.\r\n3.	Los montos que no son reconocidos antes del cierre fiscal , quedan sin efecto de pago , si no se cuenta Carta Autorización no serán liquidados por OCEAS , se requiere : \r\n1.- Notificación 2.- Evidencia de la atención 3.- Facturas emitidas en tiempo y forma \r\nPara que se pueda hacer la liquidación de servicios. \r\n4.	Para los servicios de diciembre de 2021 se hará uso del crédito establecido por la relación comercial para que las facturas y liquidaciones se generen en enero de 2022.\r\n5. De acuerdo con el uso de crédito se requiere pasar de un plazo de 30 días a 60 días en donde se establece ampliar el crédito únicamente por el mes de octubre ,  noviembre y diciembre de 2021. \r\n6. Las facturas del mes de noviembre y diciembre serán liquidadas dentro de los 10 días hábiles del mes de enero 2022. Los servicios de 2020 quedaran sin efecto de pago en enero de 2022. \r\n7. El proveedor deberá compartir 2 Cartas No Adeudo las cuales vendrán de la siguiente forma:\r\nLa primera consta del 1ro de enero al 31 de diciembre de 2020 (Año Completo)\r\nLa segunda consta del 1ro de enero al 30 de junio de 2021 (Semestre)\r\n8. La carta No Adeudo del segundo semestre 2021, se emitirá en enero de 2022, una vez que hayan sido liquidadas las facturas en enero del 2022. \r\n', 'El proveedor deberá hacer el envío de las Cartas No Adeudo dentro de los 5 días hábiles de haber recibido la minuta, se establece que debe de ser con el Formato de la propia unidad, haciendo mención a OCEAS con la relación social.', 'Los canales para notificación para servicios programados, hospitalización y facturación pagos de OCEAS son: programacion@oceas.org.mx, hospitalizacion@oceas.org.mx y proveedores@oceas.org.mx respectivamente.', '', '(AT) (PC)', 2, '2021-10-07 10:19:20', 1);
