endo mención a OCEAS con la relación social.', 'Los canales para notificación para servicios programados, hospitalización y facturación pagos de OCEAS son: programacion@oceas.org.mx, hospitalizacion@oceas.org.mx y proveedores@oceas.org.mx respectivamente.', '', '(AT) (PC)', 2, '2021-10-07 11:36:11', 1);
INSERT INTO `minutas` VALUES (144, 91, 'VIDEOCONFERENCIA ', '2021-10-05', 'nataliaruiz@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Natalia Ruiz ', '1. Se versa sobre el número de operaciones, montos autorizados y liquidación de servicios. \r\n2. El proveedor informa que no tiene identificadas facturas pendientes de pago, actualmente se cuentan con 7 servicios que aun no han sido facturados de los cuales se les pide emitan la factura en enero 2022. \r\n3. El cierre para emitir facturas será el día 1ro de diciembre, sin embargo 10 días antes se cerrará el periodo para emisión y recepción de facturas esto ocurrirá el día 17 de noviembre. Después de este periodo se pide emitir las facturas en el mes de enero 2022. \r\n4. Se requiere mantener la línea de comunicación fluida para la correcta emisión de carta autorización en las cual se establecen los montos susceptibles de ser cubierto por el programa y constituyen un compromiso de pago. Los montos que no son reconocidos antes del cierre fiscal quedan sin efecto de pago. Para la emisión de carta autorización se requiere: 1.- Notificación 2.- Evidencia de la atención 3.- Facturas emitidas en tiempo y forma Paraque se pueda hacer la liquidación de servicios. \r\n5. Para los servicios de diciembre de 2021 se hará uso del crédito establecido por la relación comercial para que las facturas y liquidaciones se generen en enero de 2022. \r\n6. De acuerdo con el uso de crédito se requiere pasar de un plazo de 30 días a 60 días en donde se establece ampliar el crédito únicamente por el mes de octubre , noviembre y diciembre de 2021. \r\n7. Las facturas del mes de noviembre y diciembre serán liquidadas dentro de los 10 días hábiles del mes de enero 2022. Los servicios de 2020 quedaran sin efecto de pago en enero de 2022. \r\n8. El proveedor deberá compartir 2 Cartas No Adeudo las cuales vendrán de la siguiente forma: La primera consta del 1ro de enero al 31 de diciembre de 2020 (Año Completo) La segunda consta del 1ro de enero al 30 de junio de 2021 (Semestre) \r\n9. La carta No Adeudo del segundo semestre 2021, se emitirá en enero de 2022, una vez que hayan sido liquidadas las facturas en enero del 2022. \r\n', 'El proveedor deberá hacer el envío de las Cartas No Adeudo dentro de los 5 días hábiles de haber recibido la minuta, se establece que debe de ser con el Formato de la propia unidad, haciendo mención a OCEAS con la relación social.', 'Los canales para notificación para servicios programados, hospitalización y facturación pagos de OCEAS son: programacion@oceas.org.mx, hospitalizacion@oceas.org.mx y proveedores@oceas.org.mx respectivamente.', 'Con base en el número de operaciones, volumen por servicio y pagos ya realizados, se presenta al proveedor una solicitud de descuento directo sobre facturación. Este descuento se busca sobre el 2% (dos por ciento). El proveedor se compromete a revisarlo e informar de la decisión.', '(AT) (PC) (YP)', 2, '2021-10-07 11:51:18', 1);
INSERT INTO `minutas` VALUES (145, 43, 'VIDEOCONFERENCIA ', '2021-10-05', 'nataliaruiz@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Natalia Ruiz ', '1. Se versa sobre el número de operaciones, montos autorizados y liquidación de servicios. 2. Se recibieron 12 facturas emitidas en el mes de septiembre de las cuales se encuentran en revisión y se liquidaran en el mes de octubre del presente año. 3. El cierre para emitir facturas será el día 1ro de diciembre, sin embargo 10 días antes para las personas morales se cerrará el periodo de emisión y recepción de facturas , esto ocurrirá el día 17 de noviembre. Después de este periodo se pide emitir las facturas en el mes de enero 2022. \r\n\r\n4. Se requiere mantener la línea de comunicación fluida para la correcta emisión de carta autorización en las cual se establecen los montos susceptibles de ser cubierto por el programa y constituyen un compromiso de pago. Los montos que no son reconocidos antes del cierre fiscal quedan sin efecto de pago. Para la emisión de carta autorización se requiere: 1.- Notificación 2.- Evidencia de la atención 3.- Facturas emitidas en tiempo y forma Paraque se pueda hacer la liquidación de servicios. \r\n\r\n5. Para los servicios de diciembre de 2021 se hará uso del crédito establecido por la relación comercial para que las facturas y liquidaciones se generen en enero de 2022. 6. De acuerdo con el uso de crédito se requiere pasar de un plazo de 30 días a 60 días en donde se establece ampliar el crédito únicamente por el mes de octubre , noviembre y diciembre de 2021. 7. Las facturas del mes de noviembre y diciembre serán liquidadas dentro de los 10 días hábiles del mes de enero 2022. Los servicios de 2020 quedaran sin efecto de pago en enero de 2022. 8. El proveedor deberá compartir 2 Cartas No Adeudo las cuales vendrán de la siguiente forma: La primera consta del 1ro de enero al 31 de diciembre de 2020 (Año Completo) La segunda consta del 1ro de enero al 30 de junio de 2021 (Semestre) 9. La carta No Adeudo del segundo semestre 2021, se emitirá en enero de 2022, una vez que hayan sido liquidadas las facturas en enero del 2022.', 'El proveedor deberá hacer el envío de las Cartas No Adeudo dentro de los 5 días hábiles de haber recibido la minuta, se establece que debe de ser con el Formato de la propia unidad, haciendo mención a OCEAS con la relación social.', 'Los canales para notificación para servicios programados, hospitalización y facturación pagos de OCEAS son: programacion@oceas.org.mx, hospitalizacion@oceas.org.mx y proveedores@oceas.org.mx respectivamente.', '', '(AT) (PC) (CC)', 2, '2021-10-07 13:41:48', 1);
