o semestre 2021, se emitirá en enero de 2022, una vez que hayan sido liquidadas las facturas en enero del 2022. \r\n', 'El proveedor deberá hacer el envío de las Cartas No Adeudo dentro de los 5 días hábiles de haber recibido la minuta, se establece que debe de ser con el Formato de la propia unidad, haciendo mención a OCEAS con la relación social. Se enviarán cartas no adeudo por cada unidad.', 'Los canales para notificación para servicios programados, hospitalización y facturación pagos de OCEAS son: programacion@oceas.org.mx, hospitalizacion@oceas.org.mx y proveedores@oceas.org.mx respectivamente.', '', '(AT) (PC) (ES) (IC)', 2, '2021-10-07 15:53:42', 1);
INSERT INTO `minutas` VALUES (149, 77, 'VIDEOCONFERENCIA ', '2021-10-05', 'nataliaruiz@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Natalia Ruiz ', '1. Se versa sobre el número de operaciones, montos autorizados y liquidación de servicios. 2. Se encuentran 6 facturas pendientes de pago las cuales se emitieron en el mes de Septiembre y serán liquidadas en el mes de octubre del presente año. 3. El cierre para emitir facturas será el día 1ro de diciembre, sin embargo 10 días antes para las personas morales se cerrará el periodo de emisión y recepción de facturas , esto ocurrirá el día 17 de noviembre. Después de este periodo se pide emitir las facturas en el mes de enero 2022. \r\n\r\n4. Se requiere mantener la línea de comunicación fluida para la correcta emisión de carta autorización en las cual se establecen los montos susceptibles de ser cubierto por el programa y constituyen un compromiso de pago. Los montos que no son reconocidos antes del cierre fiscal quedan sin efecto de pago. Para la emisión de carta autorización se requiere: 1.- Notificación 2.- Evidencia de la atención 3.- Facturas emitidas en tiempo y forma Paraque se pueda hacer la liquidación de servicios. \r\n5. Para los servicios de diciembre de 2021 se hará uso del crédito establecido por la relación comercial para que las facturas y liquidaciones se generen en enero de 2022. 6. De acuerdo con el uso de crédito se requiere pasar de un plazo de 30 días a 60 días en donde se establece ampliar el crédito únicamente por el mes de octubre , noviembre y diciembre de 2021. 7. Las facturas del mes de noviembre y diciembre serán liquidadas dentro de los 10 días hábiles del mes de enero 2022. De acuerdo con prescripción, los servicios de 2020 quedarán sin efecto de pago a partir de enero de 2022. 8. El proveedor deberá compartir 2 Cartas No Adeudo las cuales vendrán de la siguiente forma: La primera consta del 1ro de enero al 31 de diciembre de 2020 (Año Completo) La segunda consta del 1ro de enero al 30 de junio de 2021 (Semestre) 9. La carta No Adeudo del segundo semestre 2021, se emitirá en enero de 2022, una vez liquidadas las facturas en enero del 2022.\r\n', 'El proveedor deberá hacer el envío de las Cartas No Adeudo dentro de los 5 días hábiles de haber recibido la minuta, se establece que debe de ser con el Formato de la propia unidad, haciendo mención a OCEAS con la relación social.', 'Los canales para notificación para servicios programados, hospitalización y facturación pagos de OCEAS son: programacion@oceas.org.mx, hospitalizacion@oceas.org.mx y proveedores@oceas.org.mx respectivamente.', '', '(AT) (PC) (SG) (LO) (KE) (AR)', 2, '2021-10-08 08:24:57', 1);
