INSERT INTO `minutas` VALUES (154, 74, 'VIDEOCONFERENCIA meet.google.com/pmn-awkr-sjn', '2021-10-06', 'irvingzuniga@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Irving Zúñiga', '1. Se versaría sobre el número de operaciones, montos autorizados y liquidación de servicios. 2. Se explicaría proceso de cierre contable\r\n2021 el cual está anunciado para el 01 de diciembre de 2021. Por lo cual, para el caso de las personas morales, el 17 de noviembre será\r\nemisión y recepción de facturas. 3. Se reiteraría sobre la prescripción de compromiso de pagos por servicios 2020, la cual comenzará en\r\n2022. Se invitaría a proveedor a realizar tercera conciliación operativa de facturas del periodo 2020 para que ninguno de los casos pudiera\r\ncaer en el supuesto de prescripción. 4. Se solicita emitir cartas no adeudo enero - diciembre del 2020 y enero - junio para 2021. 5. Para los servicios del periodo de cierre contable se hará uso del crédito establecido por la relación comercial para la continuidad de las atenciones en salud. Las facturas y liquidaciones ocurrirán en enero de 2022.\r\n', 'El proveedor deberá hacer el envío de las Cartas No Adeudo dentro de los 5 días hábiles posteriores de haber recibido la minuta, se establece que debe de ser con el Formato de la propia unidad, haciendo mención a OCEAS con la relación social.', 'Los canales para notificación para servicios programados, hospitalización y facturación pagos de OCEAS son:\r\nprogramacion@oceas.org.mx, hospitalizacion@oceas.org.mx y proveedores@oceas.org.mx respectivamente.', '', '(AT)(PC)', 2, '2021-10-08 12:03:01', 1);
