INSERT INTO `minutas` VALUES (166, 105, 'VIDEOCONFERENCIA  meet.google.com/mgt-uwnq-zog', '2021-10-07', 'irvingzuniga@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Irving Zúñiga', '1. Se versaría sobre el número de operaciones, montos autorizados y liquidación de servicios. 2. Se explicaría proceso de cierre contable\r\n2021 el cual está anunciado para el 01 de diciembre de 2021. Por lo cual, para el caso de las personas morales, el 17 de noviembre será\r\nemisión y recepción de facturas. 3. Se reiteraría sobre la prescripción de compromiso de pagos por servicios 2020, la cual comenzará en\r\n2022. Se invitaría a proveedor a realizar tercera conciliación operativa de facturas del periodo 2020 para que ninguno de los casos pudiera\r\ncaer en el supuesto de prescripción. 4. Se solicita emitir cartas no adeudo enero - diciembre del 2020 y enero - junio para 2021. 5. Para los\r\nservicios del periodo de cierre contable se hará uso del crédito establecido por la relación comercial para la continuidad de las atenciones\r\nen salud. Las facturas y liquidaciones ocurrirán en enero de 2022.\r\n', 'El proveedor deberá hacer el envío de las Cartas No Adeudo dentro de los 5 días hábiles posteriores de haber recibido la minuta, se\r\nestablece que debe de ser con el Formato de la propia unidad, haciendo mención a OCEAS con la relación social.', 'Los canales para notificación para servicios programados, hospitalización y facturación pagos de OCEAS son:\r\nprogramacion@oceas.org.mx, hospitalizacion@oceas.org.mx y proveedores@oceas.org.mx respectivamente.\r\n', '', '(AT)(PC)', 2, '2021-10-08 15:10:41', 1);
INSERT INTO `minutas` VALUES (167, 42, 'VIDEOCONFERENCIA ', '2021-10-06', 'nataliaruiz@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Natalia Ruiz ', '1. Se versa sobre el número de operaciones, montos autorizados y liquidación de servicios. 2. El cierre fiscal de OCEAS ocurrirá el 1ro de diciembre, sin embargo 10 días antes se cerrará el período para emisión y recepción de facturas para personas morales; esto ocurrirá el día 17 de noviembre. Después de este período se pide emitir las facturas en el mes de enero 2022 y continuar con los servicios a beneficiarios con la carta garantía. 3. Se requiere mantener la línea de comunicación fluida para la correcta emisión de carta autorización en las cual se establecen los montos susceptibles de ser cubierto por el programa y constituyen un compromiso de pago. Los montos que no son reconocidos antes del cierre fiscal quedan sin efecto de pago. Para la emisión de carta autorización se requiere: 1.- Notificación 2.- Evidencia de la atención 3.- Facturas emitidas en tiempo y forma Paraque se pueda hacer la liquidación de servicios. 4. Para los servicios otorgados en octubre, noviembre y diciembre de 2021 se hará uso del crédito establecido por la relación comercial para que las facturas y liquidaciones se generen en enero de 2022. 5. De acuerdo con el uso de crédito se solicita pasar de un plazo de pago de 30 días a 60 días naturales en donde se establece ampliar el crédito únicamente por los meses de octubre , noviembre y diciembre de 2021. 6. Las facturas emitidas en los meses antes mencionados serán liquidadas dentro de los 10 días hábiles del mes de enero 2022 una vez recibida la factura. De acuerdo con prescripción, los servicios de 2020 quedarán sin efecto de pago a partir de enero de 2022. 7. El proveedor deberá compartir 2 Cartas No Adeudo las cuales vendrán de la siguiente forma: La primera abarca el período del 1ro de enero al 31 de diciembre de 2020 (Año Completo) La segunda consta del período del 1ro de enero al 30 de junio de 2021 (Semestre) 8. La carta No Adeudo del segundo semestre 2021, se emitirá en enero de 2022, unavez que hayan sido liquidadas las facturas en enero del 2022.', 'El proveedor deberá hacer el envío de las Cartas No Adeudo dentro de los 5 días hábiles de haber recibido la minuta, se establece que debe de ser con el Formato de la propia unidad, haciendo mención a OCEAS con la relación social.', 'Los canales para notificación para servicios programados, hospitalización y facturación pagos de OCEAS son: programacion@oceas.org.mx, hospitalizacion@oceas.org.mx y proveedores@oceas.org.mx respectivamente.\r\n', '', '(AT) (PC) (CG)', 2, '2021-10-08 15:40:53', 1);
INSERT INTO `minutas` VALUES (168, 58, 'VIDEOCONFERENCIA ', '2021-10-06', 'nataliaruiz@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Natalia Ruiz ', '1. Se versa sobre el número de operaciones, montos autorizados y liquidación de servicios. 2. Se encuentran 3 (tres) facturas pendientes de pago las cuales se emitieron en el mes de septiembre y serán liquidadas en el mes de octubre del presente año. 3. El cierre para emitir facturas será el día 1ro de diciembre, sin embargo 10 días antes para las personas morales se cerrará el periodo de emisión y recepción de facturas, esto ocurrirá el día 17 de noviembre. Después de este periodo se pide emitir las facturas en el mes de enero 2022.\r\n4. Se requiere mantener la línea de comunicación fluida para la correcta emisión de carta autorización en las cual se establecen los montos susceptibles de ser cubierto por el programa y constituyen un compromiso de pago. Los montos que no son reconocidos antes del cierre fiscal quedan sin efecto de pago. Para la emisión de carta autorización se requiere: 1.- Notificación 2.- Evidencia de la atención 3.- Facturas emitidas en tiempo y forma Paraque se pueda hacer la liquidación de servicios.\r\n5. Para los servicios de diciembre de 2021 se hará uso del crédito establecido por la relación comercial para que las facturas y liquidaciones se generen en enero de 2022. 6. De acuerdo con el uso de crédito se requiere pasar de un plazo de 30 días a 60 días en donde se establece ampliar el crédito únicamente por el mes de octubre, noviembre y diciembre de 2021. 7. Las facturas del mes de noviembre y diciembre serán liquidadas dentro de los 10 días hábiles del mes de enero 2022.\r\nDe acuerdo con prescripción, los servicios de 2020 quedarán sin efecto de pago a partir de enero de 2022. El proveedor deberá compartir 2 Cartas No Adeudo las cuales vendrán de la siguiente forma: La primera consta del 1ro de enero al 31 de diciembre de 2020 (Año Completo) La segunda consta del 1ro de enero al 30 de junio de 2021 (Semestre) 9. La carta No Adeudo del segundo semestre 2021, se emitirá en enero de 2022, una vez que hayan sido liquidadas las facturas en enero del 2022.', 'El proveedor deberá hacer el envío de las Cartas No Adeudo dentro de los 5 días hábiles de haber recibido la minuta, se establece que debe de ser con el Formato de la propia unidad, haciendo mención a OCEAS con la relación social.', 'Los canales para notificación para servicios programados, hospitalización y facturación pagos de OCEAS son: programacion@oceas.org.mx, hospitalizacion@oceas.org.mx y proveedores@oceas.org.mx respectivamente.', '', '(AT) (PC) (SA) (CC)', 2, '2021-10-08 15:48:24', 1);
INSERT INTO `minutas` VALUES (169, 56, 'VIDEOCONFERENCIA ', '2021-10-06', 'nataliaruiz@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Natalia Ruiz ', '1. Se versa sobre el número de operaciones, montos autorizados y liquidación de servicios. 2. Se encuentran 6 (seis) facturas pendientes de pago las cuales se emitieron en el mes de septiembre y serán liquidadas en el mes de octubre del presente año. 3. El cierre para emitir facturas será el día 1ro de diciembre, sin embargo 10 días antes para las personas morales se cerrará el periodo de emisión y recepción de facturas, esto ocurrirá el día 17 de noviembre. Después de este periodo se pide emitir las facturas en el mes de enero 2022. \r\n\r\n4. Se requiere mantener la línea de comunicación fluida para la correcta emisión de carta autorización en las cual se establecen los montos susceptibles de ser cubierto por el programa y constituyen un compromiso de pago. Los montos que no son reconocidos antes del cierre fiscal quedan sin efecto de pago. Para la emisión de carta autorización se requiere: 1.- Notificación 2.- Evidencia de la atención 3.- Facturas emitidas en tiempo y forma Paraque se pueda hacer la liquidación de servicios.\r\n\r\n5. Para los servicios de diciembre de 2021 se hará uso del crédito establecido por la relación comercial para que las facturas y liquidaciones se generen en enero de 2022. 6. De acuerdo con el uso de crédito se requiere pasar de un plazo de 30 días a 60 días en donde se establece ampliar el crédito únicamente por el mes de octubre, noviembre y diciembre de 2021. 7. Las facturas del mes de noviembre y diciembre serán liquidadas dentro de los 10 días hábiles del mes de enero 2022. \r\nDe acuerdo con prescripción, los servicios de 2020 quedarán sin efecto de pago a partir de enero de 2022.\r\n8. El proveedor deberá compartir 2 Cartas No Adeudo las cuales vendrán de la siguiente forma: La primera consta del 1ro de enero al 31 de diciembre de 2020 (Año Completo) La segunda consta del 1ro de enero al 30 de junio de 2021 (Semestre) 9. La carta No Adeudo del segundo semestre 2021, se emitirá en enero de 2022, una vez liquidadas las facturas en enero del 2022.', 'El proveedor deberá hacer el envío de las Cartas No Adeudo dentro de los 5 días hábiles de haber recibido la minuta, se establece que debe de ser con el Formato de la propia unidad, haciendo mención a OCEAS con la relación social.', 'Los canales para notificación para servicios programados, hospitalización y facturación pagos de OCEAS son: programacion@oceas.org.mx, hospitalizacion@oceas.org.mx y proveedores@oceas.org.mx respectivamente.', '', '(AT) (PC) (AF) (CH)', 2, '2021-10-08 15:55:30', 1);
INSERT INTO `minutas` VALUES (170, 67, 'VIDEOCONFERENCIA ', '2021-10-06', 'nataliaruiz@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Natalia Ruiz ', '1. Se versa sobre el número de operaciones, montos autorizados y liquidación de servicios. 2. El cierre fiscal de OCEAS ocurrirá el 1ro de diciembre, sin embargo 10 días antes se cerrará el período para emisión y recepción de facturas para personas morales; esto ocurrirá el día 17 de noviembre. Después de este período se pide emitir las facturas en el mes de enero 2022 y continuar con los servicios a beneficiarios con la carta garantía. \r\n3. Se requiere mantener la línea de comunicación fluida para la correcta emisión de carta autorización en las cual se establecen los montos susceptibles de ser cubierto por el programa y constituyen un compromiso de pago. Los montos que no son reconocidos antes del cierre fiscal quedan sin efecto de pago. Para la emisión de carta autorización se requiere: 1.- Notificación 2.- Evidencia de la atención 3.- Facturas emitidas en tiempo y forma Paraque se pueda hacer la liquidación de servicios.\r\n4. Para los servicios otorgados en octubre, noviembre y diciembre de 2021 se hará uso del crédito establecido por la relación comercial para que las facturas y liquidaciones se generen en enero de 2022. 5. De acuerdo con el uso de crédito se solicita pasar de un plazo de pago de 30 días a 60 días naturales en donde se establece ampliar el crédito únicamente por los meses de octubre , noviembre y diciembre de 2021. 6. Las facturas emitidas en los meses antes mencionados serán liquidadas dentro de los 10 días hábiles del mes de enero 2022 una vez recibida la factura. \r\nDe acuerdo con prescripción, los servicios de 2020 quedarán sin efecto de pago a partir de enero de 2022, debido a que OCEAS es una MUTUAL y su prescripción es a los 2 años. \r\n7. El proveedor deberá compartir 2 Cartas No Adeudo las cuales vendrán de la siguiente forma: La primera abarca el período del 1ro de enero al 31 de diciembre de 2020 (Año Completo) La segunda consta del período del 1ro de enero al 30 de junio de 2021 (Semestre).\r\n', 'El proveedor deberá hacer el envío de las Cartas No Adeudo dentro de los 5 días hábiles de haber recibido la minuta, se establece que debe de ser con el Formato de la propia unidad, haciendo mención a OCEAS con la relación social.', 'Los canales para notificación para servicios programados, hospitalización y facturación pagos de OCEAS son: programacion@oceas.org.mx, hospitalizacion@oceas.org.mx y proveedores@oceas.org.mx respectivamente.', 'La carta No Adeudo del segundo semestre 2021, se emitirá en enero de 2022, unavez\r\nque hayan sido liquidadas las facturas en enero del 2022.', '(AT) (PC) (NS)', 2, '2021-10-08 16:01:54', 1);
INSERT INTO `minutas` VALUES (171, 44, 'VIDEOCONFERENCIA meet.google.com/nnd-gphs-cvo', '2021-10-08', 'irvingzuniga@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Irving Zúñiga', '1. Se versaría sobre el número de operaciones, montos autorizados y liquidación de servicios. 2. Se explicaría proceso de cierre contable\r\n2021 el cual está anunciado para el 01 de diciembre de 2021. Por lo cual, para el caso de las personas morales, el 17 de noviembre será\r\nemisión y recepción de facturas. 3. Se reiteraría sobre la prescripción de compromiso de pagos por servicios 2020, la cual comenzará en\r\n2022. Se invitaría a proveedor a realizar tercera conciliación operativa de facturas del periodo 2020 para que ninguno de los casos pudiera\r\ncaer en el supuesto de prescripción. 4. Se solicita emitir cartas no adeudo enero - diciembre del 2020 y enero - junio para 2021. 5. Para los\r\nservicios del periodo de cierre contable se hará uso del crédito establecido por la relación comercial para la continuidad de las atenciones\r\nen salud. Las facturas y liquidaciones ocurrirán en enero de 2022.\r\n', 'El proveedor deberá hacer el envío de las Cartas No Adeudo dentro de los 5 días hábiles posteriores de haber recibido la minuta, se\r\nestablece que debe de ser con el Formato de la propia unidad, haciendo mención a OCEAS con la relación social.', 'Los canales para notificación para servicios programados, hospitalización y facturación pagos de OCEAS son:\r\nprogramacion@oceas.org.mx, hospitalizacion@oceas.org.mx y proveedores@oceas.org.mx respectivamente.', '', '(AT)(PC)', 2, '2021-10-08 17:01:38', 1);
