INSERT INTO `minutas` VALUES (176, 90, 'meet.google.com/cst-bpam-shu', '2021-10-07', 'nataliaruiz@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Natalia Ruiz ', '1. Se versa sobre el número de operaciones, montos autorizados y liquidación de servicios. \r\n2. Se encuentran 3 facturas en tránsito, las cuales se emitieron en el mes de septiembre por tal motivo se liquidarán en el mes de octubre 2021. \r\n3. El cierre para emitir facturas será el día primero de diciembre. Sin embargo, diez días antes para las personas morales se cerrará el periodo de emisión y recepción de facturas, esto ocurrirá el día diecisiete de noviembre. Después de este periodo se pide emitir las facturas en el mes de enero 2022. \r\n4. Se requiere mantener la línea de comunicación fluida para la correcta emisión de carta autorización en las cual se establecen los montos susceptibles de ser cubierto por el programa y constituyen un compromiso de pago. Los montos que no son reconocidos antes del cierre fiscal quedan sin efecto de pago. Para la emisión de carta autorización se requiere: 1.- Notificación 2.- Evidencia de la atención 3.- Facturas emitidas en tiempo y forma Paraque se pueda hacer la liquidación de servicios. \r\n5. Para los servicios de diciembre de 2021 se hará uso del crédito establecido por la relación comercial para que las facturas y liquidaciones se generen en enero de 2022. \r\n6.- . De acuerdo con prescripción, los servicios de 2020 quedarán sin efecto de pago a partir de enero de 2022. \r\n7. El proveedor deberá enviar el número de servicio (ejemplo OCE21001010) y folio fiscal UUID(código alfanumérico de 32 posiciones) para poder rastrear facturas pendientes de pago\r\n8.- El proveedor deberá compartir dos Cartas No Adeudo las cuales vendrán de la siguiente forma: La primera, del 1ro de enero al 31 de diciembre de 2020 (Año Completo). La segunda, del 1ro de enero al 30 de junio de 2021 (Semestre). \r\n9.- La carta No Adeudo del segundo semestre 2021, se emitirá en enero de 2022, una vez que hayan sido liquidadas las facturas en enero del 2022.', 'El proveedor deberá hacer el envío de las Cartas No Adeudo dentro de los cinco días hábiles de haber recibido la minuta. Se establece que debe de ser con el Formato de la propia unidad en atención al cliente OCEAS. ', 'Los canales para notificación para servicios programados, hospitalización y facturación pagos de OCEAS son: programacion@oceas.org.mx, hospitalizacion@oceas.org.mx y proveedores@oceas.org.mx respectivamente.', '', '(AT) (PC) (CA)', 2, '2021-10-12 10:01:19', 1);
