el segundo semestre 2021, se emitirá en enero de 2022, una vez que hayan sido liquidadas las facturas en enero del 2022.', 'El proveedor deberá hacer el envío de las Cartas No Adeudo dentro de los cinco días hábiles de haber recibido la minuta. Se establece que debe de ser con el Formato de la propia unidad en atención al cliente OCEAS. ', 'Los canales para notificación para servicios programados, hospitalización y facturación pagos de OCEAS son: programacion@oceas.org.mx, hospitalizacion@oceas.org.mx y proveedores@oceas.org.mx respectivamente.', '', '(AT) (PC) (CC) (JM)', 2, '2021-10-12 11:55:43', 1);
