segunda, del 1ro de enero al 30 de junio de 2021 (Semestre). 9.- La carta No Adeudo del segundo semestre 2021, se emitirá en enero de 2022, una vez liquidadas las facturas en enero del 2022.\r\n', 'El proveedor deberá hacer el envío de las Cartas No Adeudo dentro de los cinco días hábiles de haber recibido la minuta. Se establece que debe de ser con el Formato de la propia unidad en atención al cliente OCEAS. ', 'Los canales para notificación para servicios programados, hospitalización y facturación pagos de OCEAS son: programacion@oceas.org.mx, hospitalizacion@oceas.org.mx y proveedores@oceas.org.mx respectivamente.', '', '(AT) (PC) (MM) (TI)', 2, '2021-10-12 12:53:50', 1);
