o Adeudo del segundo semestre 2021, se emitirá en enero de 2022, una vez que hayan sido liquidadas las facturas en enero del 2022.', 'El proveedor deberá hacer el envío de las Cartas No Adeudo dentro de los cinco días hábiles de haber recibido la minuta. Se establece que debe de ser con el Formato de la propia unidad en atención al cliente OCEAS. ', 'Los canales para notificación para servicios programados, hospitalización y facturación pagos de OCEAS son: programacion@oceas.org.mx, hospitalizacion@oceas.org.mx y proveedores@oceas.org.mx respectivamente.', '', '(AT) (PC) (MP) (AP)', 2, '2021-10-12 13:03:58', 1);
INSERT INTO `minutas` VALUES (184, 71, 'meet.google.com/pzr-xkgi-yxj', '2021-10-08', 'nataliaruiz@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Natalia Ruiz ', '1. Se versa sobre el número de operaciones, montos autorizados, liquidación de servicios. 2.- El proveedor informa que no tiene identificadas facturas pendientes de pago. 3. Se notifica que OCEAS es una mutual sacerdotal y sus servicios de atención prescriben a los 2 años. La prescripción por servicios 2020 comenzará en 2022. Se invita a proveedor a realizar segunda conciliación operativa de facturas del periodo 2020 a fin de que se coteje ninguna se encuentre pendiente de pago antes del mes de octubre de 2021. 4. La notificación se realiza con tres meses de anticipación pues después de este periodo no podrán ser liquidadas las facturas no emitidas, no refacturadas por aclaración aplicable o en los casos pendientes de información. 5. El proveedor deberá enviar el número de servicio (ejemplo OCE21001010) y folio fiscal UUID (código alfanumérico de 32 posiciones) para poder rastrear facturas pendientes de pago. 6. Una vez recibida la conciliación adicional, si alguna factura estuviese pendiente de liquidación, al término de 10 días hábiles liquidaría el monto total por los servicios otorgados aplicables a la fecha. O bien, se notificará la causa de no procedencia. 7. El cierre para emitir facturas será el día primero de diciembre. Sin embargo, diez días antes para las personas morales se cerrará el periodo de emisión y recepción de facturas, esto ocurrirá el día diecisiete de noviembre. Después de este periodo se pide emitir las facturas en el mes de enero 2022. \r\n8. Se requiere mantener la línea de comunicación fluida para la correcta emisión de carta autorización en las cual se establecen los montos susceptibles de ser cubierto por el programa y constituyen un compromiso de pago. Los montos que no son reconocidos antes del cierre fiscal quedan sin efecto de pago. Para la emisión de carta autorización se requiere: 1.- Notificación 2.- Evidencia de la atención 3.- Facturas emitidas en tiempo y forma Paraque se pueda hacer la liquidación de servicios.', 'El proveedor deberá hacer el envío de las Cartas No Adeudo dentro de los cinco días hábiles de haber recibido la minuta. Se establece que debe de ser con el Formato de la propia unidad en atención al cliente OCEAS. ', 'Los canales para notificación para servicios programados, hospitalización y facturación pagos de OCEAS son: programacion@oceas.org.mx, hospitalizacion@oceas.org.mx y proveedores@oceas.org.mx respectivamente.', 'El proveedor deberá compartir dos Cartas No Adeudo las cuales vendrán de la siguiente forma: La primera, del 1ro de enero al 31 de diciembre de 2020 (Año Completo). La segunda, del 1ro de enero al 30 de junio de 2021 (Semestre). 10. La carta No Adeudo del segundo semestre 2021, se emitirá en enero de 2022, una vez que hayan sido liquidadas las facturas en enero de 2022.', '(AT) (PC) (LG)', 2, '2021-10-12 13:18:46', 1);
INSERT INTO `minutas` VALUES (185, 11, 'meet.google.com/wdv-upbc-xji', '2021-10-06', 'nataliaruiz@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Natalia Ruiz ', '1. Se versa sobre el número de operaciones, montos autorizados y liquidación de servicios. 2. De acuerdo con los volúmenes de atención del año 2021, con grupo San José Texcoco, Polanco Tecámac, Polanco Ixtapaluca y Polanco Coacalco se encuentran 5 facturas pendientes de pago de las cuales se emitieron en el mes de septiembre y serán liquidadas en el presente año (cuatro en octubre de 2021- $58,987.68-, una en diciembre de 2021 –$204,861.29-). 3. El cierre para emitir facturas será el día 1ro de diciembre, sin embargo 10 días antes se cerrará el periodo para emisión y recepción de facturas esto ocurrirá el día 17 de noviembre. Después de este periodo se pide emitir las facturas en el mes de enero 2022. \r\n\r\n4. Se requiere mantener la línea de comunicación fluida para la correcta emisión de carta autorización en las cual se establecen los montos susceptibles de ser cubierto por el programa y constituyen un compromiso de pago. Los montos que no son reconocidos antes del cierre fiscal quedan sin efecto de pago. Para la emisión de carta autorización se requiere: 1.- Notificación 2.- Evidencia de la atención 3.- Facturas emitidas en tiempo y forma Paraque se pueda hacer la liquidación de servicios. \r\n\r\n5. De acuerdo con el uso de crédito se requiere pasar de un plazo de 30 días a 60 días en donde se establece ampliar el crédito únicamente por el mes de octubre, noviembre y diciembre de 2021. 6. Las facturas del periodo de cierre serán liquidadas dentro de los 10 días hábiles del mes de enero 2022. De acuerdo con prescripción, los servicios de 2020 quedarán sin efecto de pago a partir de enero de 2022. 7. El proveedor deberá compartir 2 Cartas No Adeudo las cuales vendrán de la siguiente forma: La primera consta del 1ro de enero al 31 de diciembre de 2020 (Año Completo) La segunda consta del 1ro de enero al 30 de junio de 2021 (Semestre) 8. La carta No Adeudo del segundo semestre 2021, se emitirá en enero de 2022, una vez que hayan sido liquidadas las facturas en enero del 2022.', 'El proveedor deberá hacer el envío de las Cartas No Adeudo dentro de los 5 días hábiles de haber recibido la minuta, se establece que debe de ser con el Formato de la propia unidad, haciendo mención a OCEAS con la relación social.\r\n', 'Los canales para notificación para servicios programados, hospitalización y facturación pagos de OCEAS son: programacion@oceas.org.mx, hospitalizacion@oceas.org.mx y proveedores@oceas.org.mx respectivamente.', '', '(AT) (PC) (AR) (GC) (VM) (MG) (MR)', 2, '2021-10-12 18:20:59', 1);
INSERT INTO `minutas` VALUES (186, 51, 'meet.google.com/yoy-sojg-nec', '2021-10-06', 'nataliaruiz@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Natalia Ruiz ', '1.	Se versa sobre el número de operaciones, montos autorizados y liquidación de servicios.\r\n 2.	Se encuentran 2 facturas en tránsito, las cuales se emitieron en el mes de septiembre, por tal motivo se liquidarán en el mes de octubre 2021 .\r\n3.	El cierre para emitir facturas será el día 1ro de diciembre, sin embargo 10 días antes para las personas morales se cerrará el periodo de emisión y recepción de facturas, esto ocurrirá el día 17 de noviembre. Después de este periodo se pide emitir las facturas en el mes de enero 2022. \r\n4.	Los montos que no son reconocidos antes del cierre fiscal, quedan sin efecto de pago , si no se cuenta Carta Autorización no serán liquidados por OCEAS , por tal motivo se requiere : \r\na)	Notificación b) Evidencia de la atención c) Facturas emitidas en tiempo y forma .Para que se pueda hacer la liquidación de servicios. \r\n5.	Cartas Autorización del año 2020 no son susceptibles a modificación por tal motivo si no se ajustan los montos no serán liquidadas las facturas. \r\n6.  Proveedor deberá enviar las facturas que se tienen pendientes de pago del año 2020 y 2021 , de las cuales se requiere  enviar el número de servicio (ejemplo OCE21001010) y folio fiscal UUID(código alfanumérico de 32 posiciones) para poder rastrear facturas y asi mismo puedan ser liquidadas.  \r\n7. El proveedor deberá compartir 2 Cartas No Adeudo las cuales vendrán de la siguiente forma: La primera consta del 1ro de enero al 31 de diciembre de 2020 (Año Completo) La segunda consta del 1ro de enero al 30 de junio de 2021 (Semestre).\r\n8.	La carta No Adeudo del segundo semestre 2021, se emitirá en enero de 2022, una vez que hayan sido liquidadas las facturas en enero del 2022.\r\n', 'El proveedor deberá hacer el envío de las Cartas No Adeudo dentro de los cinco días hábiles de haber recibido la minuta. Se establece que debe de ser con el Formato de la propia unidad en atención al cliente OCEAS.', 'Los canales para notificación para servicios programados, hospitalización y facturación pagos de OCEAS son: programacion@oceas.org.mx, hospitalizacion@oceas.org.mx y proveedores@oceas.org.mx respectivamente.', 'jueves 07/10/2021 12:53 p. m. se liquidan facturas emitidas el 2021-09-06T12:12:25	2021-09-216c148e-ac68-4eb5-9d8f-25726742e3a8; 97f566c1-6d06-4f99-9d52-8def0312b447.', '(AT) (PC) (VM) (SC)', 2, '2021-10-14 10:27:46', 1);
INSERT INTO `minutas` VALUES (187, 51, 'meet.google.com/vuv-eqjx-rph', '2021-10-11', 'nataliaruiz@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Natalia Ruiz ', '1. Se versa sobre el número de operaciones, montos autorizados y liquidación de servicios. \r\n2. Proveedor refiere que se encuentran tres facturas pendientes de pagos. Se informa que las facturas se liquidarán siempre y cuando cumplan las características de pago: a) Notificación b) Evidencia de la atención c) Facturas emitidas en tiempo y forma y que cumplan con el monto autorizado de acuerdo con las Cartas Finales para poder proceder a pago. No se pueden reconocer como descuentos montos efectivamente liquidados por los beneficiarios.\r\n3. Particularmente para los casos 2020, se precisa que no son susceptibles de modificación toda vez que el año fiscal correspondiente ha cerrado. 4. La Administradora se compromete a gestionar en un plazo de 48 horas la liquidación de las facturas pendiente de liquidación siempre que estás se limiten a los montos efectivamente autorizados y comprometidos en carta autorización. Se podrán aplicar notas de crédito con tal efecto. \r\n 5. Cartas Autorización del año 2020 no son susceptibles a modificación por tal motivo si no se ajustan los montos no serán liquidadas las facturas. \r\n', '', '// martes 12/10/2021 02:41 p. m. se recibe mensaje de Viveck Marin veckym@hotmail.com: como acordamos el día de ayer en reunión virtual; les estoy enviando las facturas pendientes de pago con nota de crédito, por así convenir para el pronto pago.\r\nBB59864   $150427.20   NOTA DE CREDITO   NCB151 $5000.00      CARTA GARANTIA OCE20000356\r\nBB59862   $144479.04   NOTA DE CREDITO   NCB149 $34464.85    CARTA GARANTIA OCE20003662\r\nBB59865   $31859.31     NOTA DE CREDITO   NCB147 $5000.00      CARTA GARANTIA OCE21004826\r\nBB58965   $13839.67     NOTA DE CREDITO   NCB152 $5000.00      CARTA GARANTIA OCE21000437\r\nBB59863  $174647.97   NOTA DE CREDITO    NCB153 $14098.80   CARTA GARANTIA OCE 200004652 Y OCE20004745\r\n', 'A través de llamada telefónica cel. 871 135 0809 con Contadora Diana Acosta se\r\nSe refuerza: \r\n1. Que se requiere mantener la línea de comunicación fluida para la correcta emisión de carta autorización en las cual se establecen los montos susceptibles de ser cubierto por el programa y constituyen un compromiso de pago. \r\n2. En todos los casos se deberá presentar la cuenta hospitalaria previa al egreso sin ningún tipo de descuento, área médica emitirá el dictamen correspondiente e informará al proveedor cuales son los montos a cargo del cliente OCEAS y a cargo del beneficiario. \r\n3. Se reconoce al beneficiario la posibilidad de reservarse el derecho de liquidar y facturar los montos que le correspondan de acuerdo con sus mejores intereses. No obstante, en ningún caso se podrán facturar a OCEAS montos liquidados en efectivos o a través de cuentas que no estén a nombre de Obra de clérigos en Ayuda Solidaria A.R.\r\n4. Reiteramos, sólo se podrá facturar a OCEAS los montos efectivamente liquidados mediante transferencia bancaria. \r\n\r\n//jueves, 14 de octubre de 2021 04:02 p. m. se liquidaron las cinco facturas requeridas por el proveedor en las cuales se aplicó nota de crédito. Se requiere emisión de cartas no adeudo. ', '(AT) (PC) (VM) (B)', 2, '2021-10-14 11:01:22', 1);
INSERT INTO `minutas` VALUES (188, 110, 'meet.google.com/rhd-sjmd-nio', '2021-10-07', 'nataliaruiz@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Natalia Ruiz ', '1. Se versa sobre el número de operaciones, montos autorizados y liquidación de servicios. 2. El proveedor informa que no tiene identificadas facturas pendientes de pago. 3. El cierre para emitir facturas será el día 1ro de diciembre, sin embargo 10 días antes para las personas morales se cerrará el periodo de emisión y recepción de facturas, esto ocurrirá el día 17 de noviembre. Después de este periodo se pide emitir las facturas en el mes de enero 2022. \r\n\r\n4. Se requiere mantener la línea de comunicación fluida para la correcta emisión de carta autorización en las cual se establecen los montos susceptibles de ser cubierto por el programa y constituyen un compromiso de pago. Los montos que no son reconocidos antes del cierre fiscal quedan sin efecto de pago. Para la emisión de carta autorización se requiere: 1.- Notificación 2.- Evidencia de la atención 3.- Facturas emitidas en tiempo y forma Paraque se pueda hacer la liquidación de servicios.\r\n\r\n5. Para los servicios de diciembre de 2021 se hará uso del crédito establecido por la relación comercial para que las facturas y liquidaciones se generen en enero de 2022. 6. De acuerdo con el uso de crédito se requiere pasar de un plazo de 30 días a 60 días en donde se establece ampliar el crédito únicamente por el mes de octubre, noviembre y diciembre de 2021. 7. Las facturas del mes de noviembre y diciembre serán liquidadas dentro de los 10 días hábiles del mes de enero 2022. De acuerdo con prescripción, los servicios de 2020 quedarán sin efecto de pago a partir de enero de 2022. 8. El proveedor deberá compartir 2 Cartas No Adeudo las cuales vendrán de la siguiente forma: La primera consta del 1ro de enero al 31 de diciembre de 2020 (Año Completo) La segunda consta del 1ro de enero al 30 de junio de 2021 (Semestre). 9. Proveedor pide Contrato para formalizar el convenio por tal motivo se le compartirá la propuesta de contrato el cual estará en revisión en el mes de enero del año 2022.', 'El proveedor deberá hacer el envío de las Cartas No Adeudo dentro de los 5 días hábiles de haber recibido la minuta, se establece que debe de ser con el Formato de la propia unidad, haciendo mención a OCEAS con la relación social.', 'Los canales para notificación para servicios programados, hospitalización y facturación pagos de OCEAS son: programacion@oceas.org.mx, hospitalizacion@oceas.org.mx y proveedores@oceas.org.mx respectivamente.', 'La carta No Adeudo del segundo semestre 2021, se emitirá en enero de 2022, una vez que hayan sido liquidadas las facturas en enero del 2022. ', '(AT) (PC) (LB)', 2, '2021-10-14 11:21:56', 1);
INSERT INTO `minutas` VALUES (189, 38, 'meet.google.com/tch-bcwc-xyg', '2021-10-07', 'nataliaruiz@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Natalia Ruiz ', '1. Se versa sobre el número de operaciones, montos autorizados y liquidación de servicios. \r\n2. Proveedor refiere que se encuentran 3 facturas pendientes de pagos las cuales se encuentran en revisión para la liquidación de pagos. \r\n3. El cierre para emitir facturas será el día 1ro de diciembre, sin embargo 10 días antes para las personas morales se cerrará el periodo de emisión y recepción de facturas , esto ocurrirá el día 17 de noviembre. Después de este periodo se pide emitir las facturas en el mes de enero 2022. \r\n4. Se requiere mantener la línea de comunicación fluida para la correcta emisión de carta autorización en las cual se establecen los montos susceptibles de ser cubierto por el programa y constituyen un compromiso de pago. Los montos que no son reconocidos antes del cierre fiscal quedan sin efecto de pago. Para la emisión de carta autorización se requiere: \r\na) Notificación b) Evidencia de la atención c) Facturas emitidas en tiempo y forma. Para que se pueda hacer la liquidación de servicios. \r\n5. Para los servicios de diciembre de 2021 se hará uso del crédito establecido por la relación comercial para que las facturas y liquidaciones se generen en enero de 2022. \r\n6. De acuerdo con el uso de crédito se requiere pasar de un plazo de 30 días a 60 días en donde se establece ampliar el crédito únicamente por el mes de octubre , noviembre y diciembre de 2021.\r\n 7. Las facturas del mes de noviembre y diciembre serán liquidadas dentro de los 10 días hábiles del mes de enero 2022. De acuerdo con prescripción, los servicios de 2020 quedarán sin efecto de pago a partir de enero de 2022. \r\n8. El proveedor deberá compartir 2 Cartas No Adeudo las cuales vendrán de la siguiente forma: La primera consta del 1ro de enero al 31 de diciembre de 2020 (Año Completo) La segunda consta del 1ro de enero al 30 de junio de 2021 (Semestre) \r\n9. La carta No Adeudo del segundo semestre 2021, se emitirá en enero de 2022, una vez que hayan sido liquidadas las facturas en enero del 2022.\r\n', 'El proveedor deberá hacer el envío de las Cartas No Adeudo dentro de los cinco días hábiles de haber recibido la minuta. Se establece que debe de ser con el Formato de la propia unidad en atención al cliente OCEAS.', 'Los canales para notificación para servicios programados, hospitalización y facturación pagos de OCEAS son: programacion@oceas.org.mx, hospitalizacion@oceas.org.mx y proveedores@oceas.org.mx respectivamente.', 'Reunión adicional al termino del mes de  octubre. ', '(AT) (PC) (SC) (SE) (RG) (SH) (EM)', 2, '2021-10-14 11:37:01', 1);
INSERT INTO `minutas` VALUES (190, 112, 'meet.google.com/boj-yjyy-ikd', '2021-10-11', 'nataliaruiz@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Natalia Ruiz ', '1. Se versa sobre el número de operaciones, montos autorizados y liquidación de servicios. \r\n2. El proveedor informa que no tiene identificadas facturas pendientes de pago. \r\n3. El cierre para emitir facturas será el día 1ro de diciembre, sin embargo 10 días antes para las personas morales se cerrará el periodo de emisión y recepción de facturas , esto ocurrirá el día 17 de noviembre. Después de este periodo se pide emitir las facturas en el mes de enero 2022. \r\n4. Para los servicios de diciembre de 2021 se hará uso del crédito establecido por la relación comercial para que las facturas y liquidaciones se generen en enero de 2022. \r\n5. De acuerdo con el uso de crédito se requiere pasar de un plazo de 30 días a 60 días en donde se establece ampliar el crédito únicamente por el mes de octubre, noviembre y diciembre de 2021.\r\n6. Las facturas del mes de noviembre y diciembre serán liquidadas dentro de los 10 días hábiles del mes de enero 2022. \r\n7. Proveedor deberá compartir el catálogo de insumos con el que cuentan para poder revisar la información y ampliar los servicios. \r\n', '', 'Los canales para notificación para servicios programados, hospitalización y facturación pagos de OCEAS son: programacion@oceas.org.mx, hospitalizacion@oceas.org.mx y proveedores@oceas.org.mx respectivamente.', '', '(AT) (PC) (RC)', 2, '2021-10-14 12:08:17', 1);
INSERT INTO `minutas` VALUES (191, 49, 'meet.google.com/mmd-upku-uht', '2021-10-08', 'nataliaruiz@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Natalia Ruiz', '1. Se versa sobre el número de operaciones, montos autorizados y liquidación de servicios. \r\n2.- Proveedor otorgará los servicios quedando en común acuerdo que OCEAS liquidará dichos servicios en el mes de enero 2022. \r\n3. Las Cartas Preliminares se seguirán emitiendo sin ningún problema, en las cuales pedimos envíen factura en el mes de enero para que puedan ser procedentes a pago. \r\n4.- Las facturas que se tienen pendientes de pago y fueron emitidas en el mes de septiembre se liquidaran en el mes de octubre del presente año. \r\n5.- Para la atención de los médicos se seguirá haciendo la liquidación de los honorarios ya que son montos distintos, en diciembre varios médicos aceptan no facturar si no hasta enero, si fuera el caso con la unidad, será aprobado que facturen en el mes de enero. \r\n6. El proveedor deberá compartir 2 Cartas No Adeudo las cuales vendrán de la siguiente forma:\r\nLa primera consta del 1ro de enero al 31 de diciembre de 2020 (Año Completo)\r\nLa segunda consta del 1ro de enero al 30 de junio de 2021 (Semestre)\r\n7. La carta No Adeudo del segundo semestre 2021, se emitirá en enero de 2022, una vez que hayan sido liquidadas las facturas en enero del 2022. \r\n', '', '', '', '(AT) (PC) (JC) (ME)', 2, '2021-10-14 12:29:42', 1);
INSERT INTO `minutas` VALUES (192, 111, 'meet.google.com/jbr-xqkj-iak', '2021-10-08', 'nataliaruiz@empoderasalud.mx', 'alejandrotoledo@empoderasalud.mx', 'Natalia Ruiz ', '1.	Se versa sobre el número de operaciones, montos autorizados y liquidación de servicios.\r\n2.	El proveedor informa que no tiene identificadas facturas pendientes de pago. \r\n3.	El cierre para emitir facturas será el día 1ro de diciembre, sin embargo 10 días antes para las personas morales se cerrará el periodo de emisión y recepción de facturas, esto ocurrirá el día 17 de noviembre. Después de este periodo se pide emitir las facturas en el mes de enero 2022. \r\n4.	Los montos que no son reconocidos antes del cierre fiscal, quedan sin efecto de pago , si no se cuenta Carta Autorización no serán liquidados por OCEAS , por tal motivo se requiere : \r\nb)	Notificación b) Evidencia de la atención c) Facturas emitidas en tiempo y forma. Para que se pueda hacer la liquidación de servicios. \r\n5. Para los servicios de diciembre de 2021 se hará uso del crédito establecido por la relación comercial para que las facturas y liquidaciones se generen en enero de 2022.  \r\n6. De acuerdo con el uso de crédito se requiere pasar de un plazo de 30 días a 60 días en donde se establece ampliar el crédito únicamente por el mes de octubre, noviembre y diciembre de 2021.  \r\n7. Las facturas del mes de noviembre y diciembre serán liquidadas dentro de los 10 días hábiles del mes de enero 2022.\r\n', '', 'Los canales para notificación para servicios programados, hospitalización y facturación pagos de OCEAS son: programacion@oceas.org.mx, hospitalizacion@oceas.org.mx y proveedores@oceas.org.mx respectivamente.', '', '(AT) (PC) (OT) (SG)', 2, '2021-10-14 12:45:48', 1);
