INSERT INTO `notasmedicas` VALUES (1, '318xz7v0', 3, 3, 'Llamada telefonica', 'Gabriela Garza ', 'COVID', '2021-07-19', '14:07:21', 0, 'F', '', '', '', '', '', '', 'APP: Niega alergias y crónico-degenerativos.\r\nPA: Inicia hace 8 dias con síntomas de resfriado, leves. Se realiza prueba covid el 08/07/2021 y es positiva.  Recibe tratamiento por seis días con resultado favorable. Recibe valoración por neumólogo a distancia por presentar saturación por debajo de 90 (74-86) y fluctuación de temperatura de 37°-39°. Tratante le cambio esquema el día 13. Nota del 13-07-21 del Dr. Joel Oswaldo Ortega Estrada. Oseltamivir, paracetamol-ketoprofeno, umckaloabo, clorhid', 'Al momento temperatura 38.4°, en posición en decúbito prono satura 86%, tos con flemas de difícil expectoración, desatura a la movilización, sin datos de dificultad respiratoria (jadeo, coanosis).', '', '', 'Familiar comenta que consiguieron un concentrador de oxígeno. Se orienta sobre el uso de concentrador. Se brindan datos de alarma. Pendiente seguimiento.', 'Reservado a evolución', '', '', '', '0', 2, 1);
INSERT INTO `notasmedicas` VALUES (2, 'q6nio174', 3, 3, 'Llamada telefonica', 'Gabriela Garza', 'seguimiento covid', '2021-07-19', '14:12:53', 0, 'F', '', '', '', '', '', '', 'Comenta que la señorita Tania se encuentra en cama, se agita si se sienta, tolera via oral, dieta a base de papillas de verduras y frutas. Sin elevación de la temperatura el día de hoy, 34.5*c, Termino tratamiento (oseltamivir, paracetamol-ketoprofeno, umckaloabo, clorhidrato de piridoxina, budesónida, colecalciferol, aminoácidos) y no mejoró. Dr. Joel Oswaldo Ortega Estrada neumólogo de primera opinión Indico ampolletas (no recuerda nombre) y tuvo mejoría parcial. Motivo por el cual acudió a se', 'Al momento temperatura 38.4°, en posición en decúbito prono satura 86%, tos con flemas de difícil expectoración, desatura a la movilización, sin datos de dificultad respiratoria (jadeo, coanosis).', '', ' Se le brinda asesoría de como colocar bolsa mascarilla reservorio y datos de alarma.', 'Dexametasona ampolletas 8mg/2 ml cada 24 por 7 días, Enoxaparina 60mg im cada 24 x 6 dias   Tylex 750m g 1 cada 6 hrs por tres días, Actus capsulas 30mg 1 cada 12 hrs x 10 días, además de  checar oxigenación, si es menor 86%,  debe conseguir tanque de oxigeno, además de conseguir mascarilla bolsa reservorio. \r\nCuenta con concentrador hasta 10 litros lpm, tiene puntas nasales satura 96%, Temp 34.9 .actualmente, no tiene glucómetro.  ', 'De acuerdo con el médico, En nueve días, debe haber avance. ', '', '', '', '0', 2, 1);
INSERT INTO `notasmedicas` VALUES (3, 'j0119krf', 3, 3, 'Notificacion de App', 'Gabriela Garza', 'Seguimiento Covid', '2021-07-19', '14:15:13', 0, 'F', '', '', '', '', '', '', '18/07/2021 Se recibe llamada al número 722 154 7198, 09:46 pm, la señora: Gabriela Garza informa:', 'el día de ayer un neumólogo de la raza y modifico tratamiento – dexametasona 8 mg IM c/24 por 7 días, enoxaparina 60 mg SC c/24 por 6 días, tylex 750 mg c/6 horas por 3 días, athus 30 mg 1 c/12 h por 10 días, ha presentado mejoría.\r\nSPO2 91% al ambiente, no ha requerido oxigeno puesto que le indicaron que al saturar a 86 iniciara con oxigenoterapia, permanece en decúbito prono por 20 horas al día por indicación médica, T:36.1, se ha alimentado e hidratado adecuadamente. ', 'Comenta que persisten accesos de tos, presencia flemas de difícil expectoración, niega otros.', 'Se reporta con evolución favorable. No obstante, continuará ligado a evolución', '', '', '', '', '', '0', 2, 1);
INSERT INTO `notasmedicas` VALUES (4, 'cg5q2qzb', 3, 3, 'Llamada telefonica', 'FAMILIAR', 'SEGUIMIENTO COVID', '2021-07-19', '19:03:35', 0, 'F', '', '', '', '', '', '', 'Paciente femenino de 25 años de edad, cursando el doceavo cumpliendo definición operacional  de caso confirmado de covid 19.', 'se encuentra menos agitada al moverse y menos nerviosa respecto a la enfermedad, presenta poca tos seca, sin flema expulsada  rinorrea blanca, aumento tiempo de dormir, evacuación presente. Uresis: presente, adquire color (no palidez)', 'O:  concentrador 5% Sat 91% con puntas nasales, ya consiguieron la mascarilla. Fiebre: 35.1°C,  A: Radiografía de tórax anteropsoterior, presencia de aumento de la trama bronquial, zona de condensación en pulmón derecho. ', 'Se reciben estudios de laboratorio Leucocitos 7.22 µL;  Eritrocitos 5.49millones/µl, Hemoglobina 15.8g/dL Hematócrito 47.7%  Plaqueta 285 000, Neutrófilos  83.1  Dimero-D  0.34 , Proteína C Reactiva, 5.60 mg/Dl Ferritina 205 ng/dl  Procalcitonina 0.10   Proteína C Reactiva 5.60 mg/dL ', 'P: Medicamentos le aplicaron el día de hoy, Paracetamol 750mg, hasta este momento.', 'Facvorable. No obstante dependiente de evolución', '', '', '', '0', 2, 1);
INSERT INTO `notasmedicas` VALUES (5, 'qq5hx7z5', 59, 973, 'Correo electronico', 'DRA. ROSA EQUIHUA', 'CONSULTA POR PRESENTAR ASTENIA Y ADINAMIA PROGRESIVA DESDE SU EGRESO HOSPITALARIO', '2021-09-22', '10:56:09', 60, 'M', '', '', '100/60 mmHg', '95 lmp', '', '', ' 3 MESES, AUNÁNDOSE MAREOS, PALPITACIONES, PÉRDIDA PONDERAL NO CUANTIFICADA EN LOS UTLIMOS 4 MESES. EL PACIENTE TRAE CONSIGO RESULTADOS DE EXAMENES DE LABORATORIO DE DOS FECHAS. LABORATORIOS 15/04/21 HB 10.9, HTO 32.3, VCM 89, CMHG 32.2, HCM 27.1, LEUCOS 13, 000, SEGMENTADOS 79, NEUT 79%, PLAQ 452,000, PCR 4.2, VSG 9, ALFAFETO PROTEINA 9.65, ANTIGENO CARCINOEMBRIONARIO 10.6, MACADOR TUMORAL CA-125/ CA 15-3/ CA 19-9 NEGATIVOS. 24/04/21 HB 9.3, HTO 30,VCM 87, CMHG 30, CMHG 31, LEUCOS 16.1, NEUT 81', 'Paciente masculino orientado en sus tres esferas, leve deshidratacion y moderada palidez en piel y tegumentos . Afebril. Asintomatico. Hipotenso. Fascies de fatiga/cansancio. Cardiopulmonar sin alteraciones. Extremidades íntegras.', '15/04/21 \r\nHB 10.9, Hto 32.3, VCM 89, CMHG 32.2, HCM 27.1, Leucos 13, 000, Segmentados 79, NEUT	 79%, PLAQ 452,000, PCR 4.2, VSG 9, Alfafeto proteina 9.65, Antigeno carcinoembrionario 10.6, macador tumoral ca-125/ ca 15-3/ ca 19-9 negativos.\r\n24/04/21\r\nHb 9.3, Hto 30,VCM 87, CMHG 30, CMHG 31, Leucos 16.1, NEUT 81%, PLAQ 513, glucosa 129, TP 13, TPT 28.\r\nEGO sin presencia de infección\r\n', 'IDX. ANEMIA TROMBOCITOSIS DESCARTAR PROCESO INFECCIOSO PERSISTENTE/RECIDIVANTE', 'BH, QS y EGO\r\nReferir a especialidad\r\n', 'reservado', '', '', '', '0', 2, 1);
INSERT INTO `notasmedicas` VALUES (6, 'htpglw5t', 60, 973, 'Correo electronico', 'DRA. ROSA V MENDOZA EQUIHUA', 'Lumbalgia severa y Sx Facetario lumbar', '2021-09-22', '11:11:13', 60, 'M', '', '', '100/60 mmHg', '95 lmp', '', '', 'Masculino de 59 años de edad, Antecedentes de importancia: Hospitalizado en OCT 2020  por 7 dias Dx ingreso: Lumbalgia severa y Sx Facetario lumbar, DX egreso: Espondilodiscitis L5-S1 . En su estancia intrahospitalaria se le realizó una biospia de L5 en la cual se reportó material hematopurulento, quantiferon (+) y cultivo (+) Staphyloccoco y RESUMEN: Enterococo (+).  Se egresó con trataminto ambulatorio: Linezolid 600 mg VO 1 cada 12 horas, Levofloxacino 750 mg VO 1 cada 24 horas y Arcoxia 120 ', '\r\nEXPLORACIÓN: Paciente masculino orientado en sus tres esferas, leve deshidratacion y moderada palidez en piel y tegumentos . Afebril. Asintomatico. Hipotenso. Fascies de fatiga/cansancio. Cardiopulmonar sin alteraciones. Extremidades íntegras', 'LABORATORIOS: 15/04/21 \r\nHB 10.9, Hto 32.3, VCM 89, CMHG 32.2, HCM 27.1, Leucos 13, 000, Segmentados 79, NEUT	 79%, PLAQ 452,000, PCR 4.2, VSG 9, Alfafeto proteina 9.65, Antigeno carcinoembrionario 10.6, macador tumoral ca-125/ ca 15-3/ ca 19-9 negativos.\r\n24/04/21\r\nHb 9.3, Hto 30,VCM 87, CMHG 30, CMHG 31, Leucos 16.1, NEUT 81%, PLAQ 513, glucosa 129, TP 13, TPT 28.\r\nEGO sin presencia de infección.\r\n\r\n', 'DX: ANEMIA \r\n	TROMBOCITOSIS\r\n	Descartar proceso infeccioso persistente/recidivante\r\n\r\n', 'PLAN: BH, QS y EGO\r\nReferir a especialidad\r\n', 'PRONOSTICO: RESERVADO', '', '', '', '0', 2, 1);
