INSERT INTO `notasmedicas` VALUES (13, 'cimj0dde', 72, 1309, 'Notificacion de App', 'TOLEDO ', 'SEGUIMIENTO ', '2021-10-07', '10:17:58', 44, 'M', '', '', '', '', '', '', 'PACIENTE DE 44 AÑOS CON ANTECEDENTES DE HIPERURICEMIA D ELARGA EVOLUCION BAJO TRATAMIENTO SIN MEJORÍA. ACTUALMENTE EN FASE AGUDA ', '', 'GLUCOSA 94, UREA 179, CREATININA 0.75, AC URICO 14.3, COLESTEROL 228.3, TRIGLICERIDOS 164.1 NITROGENO 8.4', '', 'ALOPURINOL 300 MG TOMAR 1 TABLETA CADA 24 HORAS POR 15 DÍAS \r\nCOLCHICINA 1 MG TOMAR 1 TABLETA CADA 24 HORAS POR 15 DÍAS \r\nINDOMETACINA 25MG TOMAR 1 TABLETA CADA 8 HORAS POR 5 DÍAS \r\nINGESTA ABUNDANTE DE LIQUIDOS 3 LITROS AL DÍA \r\nVALORACIÓN POR REUMATOLOGIA ', 'RESERVADO ', '', '', '', '0', 2, 1);
INSERT INTO `notasmedicas` VALUES (14, 'p3rtbgh4', 83, 362, 'Correo electronico', 'MARCO TULIO', 'PROGRAMACIÓN DE CIRUGÍA', '2021-11-05', '14:37:47', 81, 'M', '1.67', '90', '120/80', '94', '20', '36', 'SE RECIBE MAIL DE DR MARCO TULIO MENDOZA CABRAL ENVIA NOTA MEDICA POR VALORACION DEL 20.09.21 DONDE SE SOLICITA PROGRAMAR CATETERISMO CARDIACO, TABULADOR A OFRECER CIRUJANO $23335.20 ANESTESIA $7000.56 AYUDANTE $4664.80, SE SOLICITA A AREA DE REDES SE SOLICITE A MEDICO EL ENVIO DE FORMATO DE ATENCION DONDE ESPECIFIQUE UNIDAD DONDE SE BRINDARA ATENCION, DATOS COMPLETOS DE MEDICO	', 'SE ESTABLECE CONTACTO CON EL DR TULIO MENDOZA E INFORMA QUE SE ENCUENTRA OCUPADO, PIDE SE LE MANDE CORREO CON LA SOLICITUD DE LO QUE SE HACE FALTA Y NOS BRINDARÁ INFORMACIÓN	', 'CORONARIA IZQUIERDA:\r\n• TRONCO (TCI): De buen desarrollo y calibre, corto, sin lesiones angiograficas significativas. TIMI III\r\n• DESCENDENTE ANTERIOR (ADA): Arteria de buen desarrollo y calibre, con arteromatosis difusa con flujo TIMI 3, la\r\nsegunda diagonal presenta lesión del 90% con flujo distal TIMI 2. \r\n• CIRCUNFLEJA (CX): Co­dominante, de buen desarrollo, de gran calibre y adecuado flujo, con ateromatosis difiusa, sin\r\nlesiones significativas. CX Flujo TIMI 3\r\nCORONARIA DERECHA (CD): Co­d', 'Previa asepsia y antisepsia de región de arteria radial derecha, se infiltró con 3cc de xilocaína simple al 2%, puncionamos\r\narteria radial con técnica de seldinger modificada y se colocó introductor radial 6fr y enseguida administramos 5,000 ui de\r\nheparina. Se utilizó catéter Ikari y guia derecho 6fr para angiografía coronaria izquierda y derecha, asi como para\r\nangioplastia a la segunda diagonal. Utilizamos 120 cc de medio de contraste no iónico y 9,000 ui de heparina.', 'Damos por terminado el procedimiento, retiramos introductor radial con colocación simultánea de vendaje hemostático,\r\nposterior a esto se verifica ausencia de sangrado, sin presentar compromiso neurovascular de la extremidad, paciente pasa\r\na unidad de terapa intermedia para vigilancia.\r\nContraste utilizado: 120 cc de contraste no ionico y 9,000 UI de heparina.', 'ANGIOGRAFIA Y ANGIOPLASTIA CORONARIA', 'DR GUILLERMO ANTONIO LLAMAS ESPERON ', 'CARDIOLOGO', '5472268', '900', 2, 1);
